     &      clinet2(2,2,0:3),
     &      clzlinet_mu(0:3),crzlinet_mu(0:3),
     &      clflinet_mu(0:3),crflinet_mu(0:3),
     &      cwline,cwline_aux,cwline_aux1,
     &      cwline_mu(0:3),cwline_mu_aux(0:3),
     &      cwwline2(2,2),cwline_mu1(2,0:3),
     &      twtlinet(2),twtlinet1(2,0:3),
     &      ttwlinet(2),ttwlinet1(2,0:3),
