     &     ,r8_1(2),r8_2(2),r8_12(2,2),r8_21(2,2),r8_trip12(2,2)
     &     ,r8_56,r8_156(2),r8_256(2)
     &     ,r8_1526(2,2),r8_5261(2,2)
     &     ,r8_2516(2,2),r8_5162(2,2)
