* quqd -- p=p1578,q=p1578
      quqd=p1578(0)*p1578(0)-p1578(1)*p1578(1)-p1578(2)*p1578(2)
     & -p1578(3)*p1578(3)
      s1578=quqd
  
      do m=0,3
        p2786(m)=-p2(m)+p786(m)
      enddo
* pk0 -- p=p2786
