* quqd -- p=p2578,q=p2578
      quqd=p2578(0)*p2578(0)-p2578(1)*p2578(1)-p2578(2)*p2578(2)
     & -p2578(3)*p2578(3)
      s2578=quqd
  
      do m=0,3
