      s2756=quqd
  
  
* polarizations                                                         
  
* pol -- p=p1,m=0,e1=ce1(1)%e,e2=ce1(2)%e,e3=0,nhz=0                    
      rkt=sqrt(p1(1)**2+p1(2)**2)
      IF(abs(rkt/p1(0)).GT.1.d-10)THEN
      ce1(1)%e(1)=p1(1)*p1(3)/p1(0)/rkt
      ce1(1)%e(2)=p1(2)*p1(3)/p1(0)/rkt
      ce1(1)%e(3)=-rkt/p1(0)
      ce1(2)%e(1)=-p1(2)/rkt
      ce1(2)%e(2)=p1(1)/rkt
      ELSE
      ce1(1)%e(1)=1.d0
      ce1(1)%e(2)=0.d0
      ce1(1)%e(3)=0.d0
      ce1(2)%e(1)=0.d0
      ce1(2)%e(2)=1.d0
      ENDIF
* pol -- p=p2,m=0,e1=ce2(1)%e,e2=ce2(2)%e,e3=0,nhz=0                    
      rkt=sqrt(p2(1)**2+p2(2)**2)
      IF(abs(rkt/p2(0)).GT.1.d-10)THEN
      ce2(1)%e(1)=p2(1)*p2(3)/p2(0)/rkt
      ce2(1)%e(2)=p2(2)*p2(3)/p2(0)/rkt
      ce2(1)%e(3)=-rkt/p2(0)
      ce2(2)%e(1)=-p2(2)/rkt
      ce2(2)%e(2)=p2(1)/rkt
      ELSE
      ce2(1)%e(1)=1.d0
      ce2(1)%e(2)=0.d0
      ce2(1)%e(3)=0.d0
      ce2(2)%e(1)=0.d0
      ce2(2)%e(2)=-1.d0
      ENDIF
  
  
      do i1=1,2
* pk0 -- p=ce1(i1)%e
      ce1(i1)%ek0=ce1(i1)%e(0)-ce1(i1)%e(1)
      end do
      do i1=1,2
* pk0 -- p=ce2(i1)%e
      ce2(i1)%ek0=ce2(i1)%e(0)-ce2(i1)%e(1)
      end do
  
* triple vertex                                                         
*** triple vertex -- pfz(mu)=p2(mu),pwm(mu)=p1(mu),pwp(mu)=(-p1(mu)-p2(m
* u)),efz=ce2(i2),ewm=ce1(i1),ewp=#,res=ctrip12(i1?,i2?)%e(mu#)
      do mu=0,3
      vfz(mu)=p1(mu)-(-p1(mu)-p2(mu))
      vwm(mu)=(-p1(mu)-p2(mu))-p2(mu)
      vwp(mu)=p2(mu)-p1(mu)
      end do !mu
* vfz%efz
      do i2=1,2
* p.q -- p.q=ce2(i2)%v,p=ce2(i2)%e,q=vfz,bef=,aft=
      ce2(i2)%v=(ce2(i2)%e(0)*vfz(0)-ce2(i2)%e(1)*vfz(1)-ce2(i2)
     & %e(2)*vfz(2)-ce2(i2)%e(3)*vfz(3))
      end do
* vwm%ewm
      do i1=1,2
* p.q -- p.q=ce1(i1)%v,p=ce1(i1)%e,q=vwm,bef=,aft=
      ce1(i1)%v=(ce1(i1)%e(0)*vwm(0)-ce1(i1)%e(1)*vwm(1)-ce1(i1)
     & %e(2)*vwm(2)-ce1(i1)%e(3)*vwm(3))
      end do
* efz%ewm
      do i2=1,2
      do i1=1,2
* p.q -- p.q=caux,p=ce2(i2)%e,q=ce1(i1)%e,bef=,aft=
      caux=(ce2(i2)%e(0)*ce1(i1)%e(0)-ce2(i2)%e(1)*ce1(i1)%e(1)-
     & ce2(i2)%e(2)*ce1(i1)%e(2)-ce2(i2)%e(3)*ce1(i1)%e(3))
      do mu=0,3
      ctrip12(i1,i2)%e(mu)=ce2(i2)%v*ce1(i1)%e(mu)+ce1(i1)%v*ce2
     & (i2)%e(mu)+vwp(mu)*caux
      end do
      end do
      end do
      do i1=1,2
      do i2=1,2
* pk0 -- p=ctrip12(i1,i2)%e
      ctrip12(i1,i2)%ek0=ctrip12(i1,i2)%e(0)-ctrip12(i1,i2)%e(1)
      end do
      end do
  
  
* compute all forks ( W's, Z's, gamma's, higgs's                        
*   "decaying" to two fermions)                                         
*                                                                       
  
*      W's                                                              
* quqd -- p=p5,q=p6
      quqd=p5(0)*p6(0)-p5(1)*p6(1)-p5(2)*p6(2)-p5(3)*p6(3)
      s56=2.d0*quqd
      cdw=-wcl/(s56-cmw2)
* TW10 -- qu=p5,qd=p6,v=0,a=cw56%e(0),cl=cdw,nsum=0
      eps_0=-p5(2)*p6(3)+p6(2)*p5(3)
      ceps_0=eps_0*cim
      auxa=-quqd+p5k0*p6(0)+p6k0*p5(0)
      cw56%e(0)=cdw*(auxa-ceps_0)
* TW10 -- qu=p5,qd=p6,v=1,a=cw56%e(1),cl=cdw,nsum=0
      auxa=-quqd+p5k0*p6(1)+p6k0*p5(1)
      cw56%e(1)=cdw*(auxa-ceps_0)
* TW10 -- qu=p5,qd=p6,v=2,a=cw56%e(2),cl=cdw,nsum=0
      eps_0=-p5k0*p6(3)+p6k0*p5(3)
      ceps_0=eps_0*cim
      auxa=p5k0*p6(2)+p6k0*p5(2)
      cw56%e(2)=cdw*(auxa-ceps_0)
* TW10 -- qu=p5,qd=p6,v=3,a=cw56%e(3),cl=cdw,nsum=0
      eps_0=p5k0*p6(2)-p6k0*p5(2)
      ceps_0=eps_0*cim
      auxa=p5k0*p6(3)+p6k0*p5(3)
      cw56%e(3)=cdw*(auxa-ceps_0)
* pk0 -- p=cw56%e
      cw56%ek0=cw56%e(0)-cw56%e(1)
* quqd -- p=p7,q=p8
      quqd=p7(0)*p8(0)-p7(1)*p8(1)-p7(2)*p8(2)-p7(3)*p8(3)
      s78=2.d0*quqd
      cdw=-wcl/(s78-cmw2)
* TW10 -- qu=p7,qd=p8,v=0,a=cw78%e(0),cl=cdw,nsum=0
      eps_0=-p7(2)*p8(3)+p8(2)*p7(3)
      ceps_0=eps_0*cim
      auxa=-quqd+p7k0*p8(0)+p8k0*p7(0)
      cw78%e(0)=cdw*(auxa-ceps_0)
* TW10 -- qu=p7,qd=p8,v=1,a=cw78%e(1),cl=cdw,nsum=0
      auxa=-quqd+p7k0*p8(1)+p8k0*p7(1)
      cw78%e(1)=cdw*(auxa-ceps_0)
* TW10 -- qu=p7,qd=p8,v=2,a=cw78%e(2),cl=cdw,nsum=0
      eps_0=-p7k0*p8(3)+p8k0*p7(3)
      ceps_0=eps_0*cim
      auxa=p7k0*p8(2)+p8k0*p7(2)
      cw78%e(2)=cdw*(auxa-ceps_0)
* TW10 -- qu=p7,qd=p8,v=3,a=cw78%e(3),cl=cdw,nsum=0
      eps_0=p7k0*p8(2)-p8k0*p7(2)
      ceps_0=eps_0*cim
      auxa=p7k0*p8(3)+p8k0*p7(3)
      cw78%e(3)=cdw*(auxa-ceps_0)
* pk0 -- p=cw78%e
      cw78%ek0=cw78%e(0)-cw78%e(1)
  
*      Z's and gammas                                                   
      rmassl=rmass(id3)
      rmassr=-rmass(id4)
* quqd -- p=p3,q=p4
      quqd=p3(0)*p4(0)-p3(1)*p4(1)-p3(2)*p4(2)-p3(3)*p4(3)
      s34=2.d0*quqd+rmass2(id3)+rmass2(id4)
      ccr=zcr(id3)/(-s34+cmz2)
      ccl=zcl(id3)/(-s34+cmz2)
* T -- qu=p3,qd=p4,v=0,a=clinet_mu(0)%a,b=clinet_mu(0)%b,c=clinet_mu(0)%
* c,d=clinet_mu(0)%d,cr=ccr,cl=ccl,nsum=0
      eps_0=-p3(2)*p4(3)+p4(2)*p3(3)
      ceps_0=eps_0*cim
      ceps_1=p3(3)*cim
      ceps_2=p4(3)*cim
      auxa=-quqd+p3k0*p4(0)+p4k0*p3(0)
      clinet_mu(0)%a(1,1)=ccr*(auxa+ceps_0)
      clinet_mu(0)%a(2,2)=ccl*(auxa-ceps_0)
      clinet_mu(0)%b(1,2)=-ccl*(p4(2)+ceps_2)
      clinet_mu(0)%b(2,1)=ccr*(p4(2)-ceps_2)
      clinet_mu(0)%c(1,2)=ccr*(p3(2)+ceps_1)
      clinet_mu(0)%c(2,1)=ccl*(-p3(2)+ceps_1)
      clinet_mu(0)%d(1,1)=ccl
      clinet_mu(0)%d(2,2)=ccr
* T -- qu=p3,qd=p4,v=1,a=clinet_mu(1)%a,b=clinet_mu(1)%b,c=clinet_mu(1)%
* c,d=clinet_mu(1)%d,cr=ccr,cl=ccl,nsum=0
      auxa=-quqd+p3k0*p4(1)+p4k0*p3(1)
      clinet_mu(1)%a(1,1)=ccr*(auxa+ceps_0)
      clinet_mu(1)%a(2,2)=ccl*(auxa-ceps_0)
      clinet_mu(1)%b(1,2)=-ccl*(p4(2)+ceps_2)
      clinet_mu(1)%b(2,1)=ccr*(p4(2)-ceps_2)
      clinet_mu(1)%c(1,2)=ccr*(p3(2)+ceps_1)
      clinet_mu(1)%c(2,1)=ccl*(-p3(2)+ceps_1)
      clinet_mu(1)%d(1,1)=ccl
      clinet_mu(1)%d(2,2)=ccr
* T -- qu=p3,qd=p4,v=2,a=clinet_mu(2)%a,b=clinet_mu(2)%b,c=clinet_mu(2)%
* c,d=clinet_mu(2)%d,cr=ccr,cl=ccl,nsum=0
      eps_0=-p3k0*p4(3)+p4k0*p3(3)
      ceps_0=eps_0*cim
      auxa=p3k0*p4(2)+p4k0*p3(2)
      clinet_mu(2)%a(1,1)=ccr*(auxa+ceps_0)
      clinet_mu(2)%a(2,2)=ccl*(auxa-ceps_0)
      clinet_mu(2)%b(1,2)=-ccl*p4k0
      clinet_mu(2)%b(2,1)=ccr*p4k0
      clinet_mu(2)%c(1,2)=ccr*p3k0
      clinet_mu(2)%c(2,1)=-ccl*p3k0
* T -- qu=p3,qd=p4,v=3,a=clinet_mu(3)%a,b=clinet_mu(3)%b,c=clinet_mu(3)%
* c,d=clinet_mu(3)%d,cr=ccr,cl=ccl,nsum=0
      eps_0=p3k0*p4(2)-p4k0*p3(2)
      ceps_0=eps_0*cim
      ceps_1=p3k0*cim
      ceps_2=p4k0*cim
      auxa=+p3k0*p4(3)+p4k0*p3(3)
      clinet_mu(3)%a(1,1)=ccr*(auxa+ceps_0)
      clinet_mu(3)%a(2,2)=ccl*(auxa-ceps_0)
      clinet_mu(3)%b(1,2)=-ccl*ceps_2
      clinet_mu(3)%b(2,1)=-ccr*ceps_2
      clinet_mu(3)%c(1,2)=ccr*ceps_1
      clinet_mu(3)%c(2,1)=ccl*ceps_1
      do mu=0,3
* mline -- res=cz34(&1,&2)%e(mu),abcd=clinet_mu(mu)%,m1=rmassl,m2=rmassr
* ,den=0,nsum=0
      do iut=1,2
      do jut=1,2
      cz34(iut,jut)%e(mu)=clinet_mu(mu)%a(iut,jut)+rmassl*clinet
     & _mu(mu)%b(iut,jut)+rmassr*clinet_mu(mu)%c(iut,jut)+rmassl
     & *rmassr*clinet_mu(mu)%d(iut,jut)
      enddo
      enddo
      end do
  
      if (imass(id3).eq.1) then
        do i1=1,2
          do i2=1,2
* p.q -- p.q=cauxdot,p=p34,q=cz34(i1,i2)%e,bef=,aft=
      cauxdot=(p34(0)*cz34(i1,i2)%e(0)-p34(1)*cz34(i1,i2)%e(1)-p
     & 34(2)*cz34(i1,i2)%e(2)-p34(3)*cz34(i1,i2)%e(3))
            do mu=0,3
             cz34(i1,i2)%e(mu)=cz34(i1,i2)%e(mu)-p34(mu)*cauxdot
     &             /cmz2
            enddo
          enddo
        enddo
      endif
      do i1=1,2
      do i2=1,2
* pk0 -- p=cz34(i1,i2)%e
      cz34(i1,i2)%ek0=cz34(i1,i2)%e(0)-cz34(i1,i2)%e(1)
      end do
      end do
      ccr=fcr(id3)/(-s34)
      ccl=fcl(id3)/(-s34)
* T -- qu=p3,qd=p4,v=0,a=clinet_mu(0)%a,b=clinet_mu(0)%b,c=clinet_mu(0)%
* c,d=clinet_mu(0)%d,cr=ccr,cl=ccl,nsum=0
      eps_0=-p3(2)*p4(3)+p4(2)*p3(3)
      ceps_0=eps_0*cim
      ceps_1=p3(3)*cim
      ceps_2=p4(3)*cim
      auxa=-quqd+p3k0*p4(0)+p4k0*p3(0)
      clinet_mu(0)%a(1,1)=ccr*(auxa+ceps_0)
      clinet_mu(0)%a(2,2)=ccl*(auxa-ceps_0)
      clinet_mu(0)%b(1,2)=-ccl*(p4(2)+ceps_2)
      clinet_mu(0)%b(2,1)=ccr*(p4(2)-ceps_2)
      clinet_mu(0)%c(1,2)=ccr*(p3(2)+ceps_1)
      clinet_mu(0)%c(2,1)=ccl*(-p3(2)+ceps_1)
      clinet_mu(0)%d(1,1)=ccl
      clinet_mu(0)%d(2,2)=ccr
* T -- qu=p3,qd=p4,v=1,a=clinet_mu(1)%a,b=clinet_mu(1)%b,c=clinet_mu(1)%
* c,d=clinet_mu(1)%d,cr=ccr,cl=ccl,nsum=0
      auxa=-quqd+p3k0*p4(1)+p4k0*p3(1)
      clinet_mu(1)%a(1,1)=ccr*(auxa+ceps_0)
      clinet_mu(1)%a(2,2)=ccl*(auxa-ceps_0)
      clinet_mu(1)%b(1,2)=-ccl*(p4(2)+ceps_2)
      clinet_mu(1)%b(2,1)=ccr*(p4(2)-ceps_2)
      clinet_mu(1)%c(1,2)=ccr*(p3(2)+ceps_1)
      clinet_mu(1)%c(2,1)=ccl*(-p3(2)+ceps_1)
      clinet_mu(1)%d(1,1)=ccl
      clinet_mu(1)%d(2,2)=ccr
* T -- qu=p3,qd=p4,v=2,a=clinet_mu(2)%a,b=clinet_mu(2)%b,c=clinet_mu(2)%
* c,d=clinet_mu(2)%d,cr=ccr,cl=ccl,nsum=0
      eps_0=-p3k0*p4(3)+p4k0*p3(3)
      ceps_0=eps_0*cim
      auxa=p3k0*p4(2)+p4k0*p3(2)
      clinet_mu(2)%a(1,1)=ccr*(auxa+ceps_0)
      clinet_mu(2)%a(2,2)=ccl*(auxa-ceps_0)
      clinet_mu(2)%b(1,2)=-ccl*p4k0
      clinet_mu(2)%b(2,1)=ccr*p4k0
      clinet_mu(2)%c(1,2)=ccr*p3k0
      clinet_mu(2)%c(2,1)=-ccl*p3k0
* T -- qu=p3,qd=p4,v=3,a=clinet_mu(3)%a,b=clinet_mu(3)%b,c=clinet_mu(3)%
* c,d=clinet_mu(3)%d,cr=ccr,cl=ccl,nsum=0
      eps_0=p3k0*p4(2)-p4k0*p3(2)
      ceps_0=eps_0*cim
      ceps_1=p3k0*cim
      ceps_2=p4k0*cim
      auxa=+p3k0*p4(3)+p4k0*p3(3)
      clinet_mu(3)%a(1,1)=ccr*(auxa+ceps_0)
      clinet_mu(3)%a(2,2)=ccl*(auxa-ceps_0)
      clinet_mu(3)%b(1,2)=-ccl*ceps_2
      clinet_mu(3)%b(2,1)=-ccr*ceps_2
      clinet_mu(3)%c(1,2)=ccr*ceps_1
      clinet_mu(3)%c(2,1)=ccl*ceps_1
      do mu=0,3
* mline -- res=cf34(&1,&2)%e(mu),abcd=clinet_mu(mu)%,m1=rmassl,m2=rmassr
* ,den=0,nsum=0
      do iut=1,2
      do jut=1,2
      cf34(iut,jut)%e(mu)=clinet_mu(mu)%a(iut,jut)+rmassl*clinet
     & _mu(mu)%b(iut,jut)+rmassr*clinet_mu(mu)%c(iut,jut)+rmassl
     & *rmassr*clinet_mu(mu)%d(iut,jut)
      enddo
      enddo
      end do
  
      do i1=1,2
      do i2=1,2
* pk0 -- p=cf34(i1,i2)%e
      cf34(i1,i2)%ek0=cf34(i1,i2)%e(0)-cf34(i1,i2)%e(1)
      end do
      end do
  
*      higgs                                                            
  
      if (id3.eq.5) then
  
* TH -- qu=p3,qd=p4,a=clineth%a,b=clineth%b,c=clineth%c,coupl=rhbb
      auxa=-p3k0*p4(2)+p4k0*p3(2)
      cauxa=auxa-cim*(p4(3)*p3k0-p3(3)*p4k0)
      clineth%a(1,2)=rhbb*cauxa
      clineth%a(2,1)=-rhbb*conjg(cauxa)
      clineth%b(1,1)=rhbb*p4k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=rhbb*p3k0
      clineth%c(2,2)=clineth%c(1,1)
* mline -- res=ch34(&1,&2),abcd=clineth%,m1=rmassl,m2=rmassr,den=(s34-cm
* h2),nsum=0
      do iut=1,2
      do jut=1,2
      ch34(iut,jut)=(clineth%a(iut,jut)+rmassl*clineth%b(iut,jut
     & )+rmassr*clineth%c(iut,jut)+rmassl*rmassr*clineth%d(iut,j
     & ut))/(s34-cmh2)
      enddo
      enddo
  
      else
        do i3=1,2
          do i4=1,2
            ch34(i3,i4)=czero
          enddo
        enddo
      endif
  
  
* compute all forks ( W's, Z's, gamma's, higgs's                        
*   "decaying" to two fermions) with one gluon                          
* pk0's are included in gluonic t's for further use                     
* in two-gluons terms                                                   
*                                                                       
  
*      W's                                                              
* quqd -- p=p1,q=p56
      quqd=p1(0)*p56(0)-p1(1)*p56(1)-p1(2)*p56(2)-p1(3)*p56(3)
      s156=2.d0*quqd+s56
* quqd -- p=p5,q=p1
      quqd=p5(0)*p1(0)-p5(1)*p1(1)-p5(2)*p1(2)-p5(3)*p1(3)
      s51=2.d0*quqd
* quqd -- p=p1,q=p6
      quqd=p1(0)*p6(0)-p1(1)*p6(1)-p1(2)*p6(2)-p1(3)*p6(3)
      s16=2.d0*quqd
* quqd -- p=p2,q=p56
      quqd=p2(0)*p56(0)-p2(1)*p56(1)-p2(2)*p56(2)-p2(3)*p56(3)
      s256=2.d0*quqd+s56
* quqd -- p=p5,q=p2
      quqd=p5(0)*p2(0)-p5(1)*p2(1)-p5(2)*p2(2)-p5(3)*p2(3)
      s52=2.d0*quqd
* quqd -- p=p2,q=p6
      quqd=p2(0)*p6(0)-p2(1)*p6(1)-p2(2)*p6(2)-p2(3)*p6(3)
      s26=2.d0*quqd
* quqd -- p=p1,q=p78
      quqd=p1(0)*p78(0)-p1(1)*p78(1)-p1(2)*p78(2)-p1(3)*p78(3)
      s178=2.d0*quqd+s78
* quqd -- p=p7,q=p1
      quqd=p7(0)*p1(0)-p7(1)*p1(1)-p7(2)*p1(2)-p7(3)*p1(3)
      s71=2.d0*quqd
* quqd -- p=p1,q=p8
      quqd=p1(0)*p8(0)-p1(1)*p8(1)-p1(2)*p8(2)-p1(3)*p8(3)
      s18=2.d0*quqd
* quqd -- p=p2,q=p78
      quqd=p2(0)*p78(0)-p2(1)*p78(1)-p2(2)*p78(2)-p2(3)*p78(3)
      s278=2.d0*quqd+s78
* quqd -- p=p7,q=p2
      quqd=p7(0)*p2(0)-p7(1)*p2(1)-p7(2)*p2(2)-p7(3)*p2(3)
      s72=2.d0*quqd
* quqd -- p=p2,q=p8
      quqd=p2(0)*p8(0)-p2(1)*p8(1)-p2(2)*p8(2)-p2(3)*p8(3)
      s28=2.d0*quqd
  
      if(abs(id5).lt.7)then
      cdw=-wcl/(s156-cmw2)
* quqd -- p=p5,q=p51
      quqd=p5(0)*p51(0)-p5(1)*p51(1)-p5(2)*p51(2)-p5(3)*p51(3)
      ccl=gs/(s51*p51k0)
      do i1=1,2
* TWL0 -- qu=p5,qd=p51,v=ce1(i1)%e,a=l5_1(i1)%a,c=l5_1(i1)%c,cl=ccl,nsum
* =0
      ceps_0=-ce1(i1)%ek0*(p5(2)*p51(3)-p51(2)*p5(3))+p5k0*(ce1(
     & i1)%e(2)*p51(3)-p51(2)*ce1(i1)%e(3))-p51k0*(ce1(i1)%e(2)*
     & p5(3)-p5(2)*ce1(i1)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-ce1(i1)%e(3)*p5k0+p5(3)*ce1(i1)%ek0
      ceps_1=ceps_1*cim
      cvqu=ce1(i1)%e(0)*p5(0)-ce1(i1)%e(1)*p5(1)-ce1(i1)%e(2)*p5
     & (2)-ce1(i1)%e(3)*p5(3)
      cvqd=ce1(i1)%e(0)*p51(0)-ce1(i1)%e(1)*p51(1)-ce1(i1)%e(2)*
     & p51(2)-ce1(i1)%e(3)*p51(3)
      cauxa=-ce1(i1)%ek0*quqd+p5k0*cvqd+p51k0*cvqu
      cauxc=+ce1(i1)%ek0*p5(2)-p5k0*ce1(i1)%e(2)
      l5_1(i1)%a(2)=ccl*(cauxa-ceps_0)
      l5_1(i1)%c(2)=ccl*(-cauxc+ceps_1)
      end do
* quqd -- p=p51,q=p6
      quqd=p51(0)*p6(0)-p51(1)*p6(1)-p51(2)*p6(2)-p51(3)*p6(3)
* TWR0 -- qu=p51,qd=p6,v=0,a=rwlinet_mu(0)%a,b=rwlinet_mu(0)%b,cl=cdw,ns
* um=0
      eps_0=-p51(2)*p6(3)+p6(2)*p51(3)
      ceps_0=eps_0*cim
      ceps_2=p6(3)*cim
      auxa=-quqd+p51k0*p6(0)+p6k0*p51(0)
      rwlinet_mu(0)%a(2)=cdw*(auxa-ceps_0)
      rwlinet_mu(0)%b(1)=-cdw*(p6(2)+ceps_2)
* TWR0 -- qu=p51,qd=p6,v=1,a=rwlinet_mu(1)%a,b=rwlinet_mu(1)%b,cl=cdw,ns
* um=0
      auxa=-quqd+p51k0*p6(1)+p6k0*p51(1)
      rwlinet_mu(1)%a(2)=cdw*(auxa-ceps_0)
      rwlinet_mu(1)%b(1)=-cdw*(p6(2)+ceps_2)
* TWR0 -- qu=p51,qd=p6,v=2,a=rwlinet_mu(2)%a,b=rwlinet_mu(2)%b,cl=cdw,ns
* um=0
      eps_0=-p51k0*p6(3)+p6k0*p51(3)
      ceps_0=eps_0*cim
      auxa=p51k0*p6(2)+p6k0*p51(2)
      rwlinet_mu(2)%a(2)=cdw*(auxa-ceps_0)
      rwlinet_mu(2)%b(1)=-cdw*p6k0
* TWR0 -- qu=p51,qd=p6,v=3,a=rwlinet_mu(3)%a,b=rwlinet_mu(3)%b,cl=cdw,ns
* um=0
      eps_0=p51k0*p6(2)-p6k0*p51(2)
      ceps_0=eps_0*cim
      ceps_2=p6k0*cim
      auxa=p51k0*p6(3)+p6k0*p51(3)
      rwlinet_mu(3)%a(2)=cdw*(auxa-ceps_0)
      rwlinet_mu(3)%b(1)=-cdw*ceps_2
      do i1=1,2
      do mu=0,3
* TLTR0_W -- aa=cw516(i1)%e(mu),a1=l5_1(i1)%a,c1=l5_1(i1)%c,a2=rwlinet_m
* u(mu)%a,b2=rwlinet_mu(mu)%b,prq=s51,bef=,aft=
      cw516(i1)%e(mu)=(l5_1(i1)%c(2)*s51*rwlinet_mu(mu)%b(1)+l5_
     & 1(i1)%a(2)*rwlinet_mu(mu)%a(2))
      end do
      end do
* quqd -- p=p16,q=p6
      quqd=p16(0)*p6(0)-p16(1)*p6(1)-p16(2)*p6(2)-p16(3)*p6(3)
      ccl=gs/(s16*p16k0)
      do i1=1,2
* TWR0 -- qu=p16,qd=p6,v=ce1(i1)%e,a=r6_1(i1)%a,b=r6_1(i1)%b,cl=ccl,nsum
* =0
      ceps_0=-ce1(i1)%ek0*(p16(2)*p6(3)-p6(2)*p16(3))+p16k0*(ce1
     & (i1)%e(2)*p6(3)-p6(2)*ce1(i1)%e(3))-p6k0*(ce1(i1)%e(2)*p1
     & 6(3)-p16(2)*ce1(i1)%e(3))
      ceps_0=ceps_0*cim
      ceps_2=-ce1(i1)%e(3)*p6k0+p6(3)*ce1(i1)%ek0
      ceps_2=ceps_2*cim
      cvqu=ce1(i1)%e(0)*p16(0)-ce1(i1)%e(1)*p16(1)-ce1(i1)%e(2)*
     & p16(2)-ce1(i1)%e(3)*p16(3)
      cvqd=ce1(i1)%e(0)*p6(0)-ce1(i1)%e(1)*p6(1)-ce1(i1)%e(2)*p6
     & (2)-ce1(i1)%e(3)*p6(3)
      cauxa=-ce1(i1)%ek0*quqd+p16k0*cvqd+p6k0*cvqu
      cauxb=-ce1(i1)%ek0*p6(2)+p6k0*ce1(i1)%e(2)
      r6_1(i1)%a(2)=ccl*(cauxa-ceps_0)
      r6_1(i1)%b(1)=ccl*(cauxb-ceps_2)
      end do
* quqd -- p=p5,q=p16
      quqd=p5(0)*p16(0)-p5(1)*p16(1)-p5(2)*p16(2)-p5(3)*p16(3)
* TWL0 -- qu=p5,qd=p16,v=0,a=lwlinet_mu(0)%a,c=lwlinet_mu(0)%c,cl=cdw,ns
* um=0
      eps_0=-p5(2)*p16(3)+p16(2)*p5(3)
      ceps_0=eps_0*cim
      ceps_1=p5(3)*cim
      auxa=-quqd+p5k0*p16(0)+p16k0*p5(0)
      lwlinet_mu(0)%a(2)=cdw*(auxa-ceps_0)
      lwlinet_mu(0)%c(2)=cdw*(-p5(2)+ceps_1)
* TWL0 -- qu=p5,qd=p16,v=1,a=lwlinet_mu(1)%a,c=lwlinet_mu(1)%c,cl=cdw,ns
* um=0
      auxa=-quqd+p5k0*p16(1)+p16k0*p5(1)
      lwlinet_mu(1)%a(2)=cdw*(auxa-ceps_0)
      lwlinet_mu(1)%c(2)=cdw*(-p5(2)+ceps_1)
* TWL0 -- qu=p5,qd=p16,v=2,a=lwlinet_mu(2)%a,c=lwlinet_mu(2)%c,cl=cdw,ns
* um=0
      eps_0=-p5k0*p16(3)+p16k0*p5(3)
      ceps_0=eps_0*cim
      auxa=p5k0*p16(2)+p16k0*p5(2)
      lwlinet_mu(2)%a(2)=cdw*(auxa-ceps_0)
      lwlinet_mu(2)%c(2)=-cdw*p5k0
* TWL0 -- qu=p5,qd=p16,v=3,a=lwlinet_mu(3)%a,c=lwlinet_mu(3)%c,cl=cdw,ns
* um=0
      eps_0=p5k0*p16(2)-p16k0*p5(2)
      ceps_0=eps_0*cim
      ceps_1=p5k0*cim
      auxa=p5k0*p16(3)+p16k0*p5(3)
      lwlinet_mu(3)%a(2)=cdw*(auxa-ceps_0)
      lwlinet_mu(3)%c(2)=cdw*ceps_1
      do i1=1,2
      do mu=0,3
* TLTR0_W -- aa=cw516(i1)%e(mu),a1=lwlinet_mu(mu)%a,c1=lwlinet_mu(mu)%c,
* a2=r6_1(i1)%a,b2=r6_1(i1)%b,prq=s16,bef=cw516(i1)%e(mu)+,aft=
      cw516(i1)%e(mu)=cw516(i1)%e(mu)+(lwlinet_mu(mu)%c(2)*s16*r
     & 6_1(i1)%b(1)+lwlinet_mu(mu)%a(2)*r6_1(i1)%a(2))
      end do
      end do
      do i1=1,2
* pk0 -- p=cw516(i1)%e
      cw516(i1)%ek0=cw516(i1)%e(0)-cw516(i1)%e(1)
      end do
      cdw=-wcl/(s256-cmw2)
* quqd -- p=p5,q=p52
      quqd=p5(0)*p52(0)-p5(1)*p52(1)-p5(2)*p52(2)-p5(3)*p52(3)
      ccl=gs/(s52*p52k0)
      do i1=1,2
* TWL0 -- qu=p5,qd=p52,v=ce2(i1)%e,a=l5_2(i1)%a,c=l5_2(i1)%c,cl=ccl,nsum
* =0
      ceps_0=-ce2(i1)%ek0*(p5(2)*p52(3)-p52(2)*p5(3))+p5k0*(ce2(
     & i1)%e(2)*p52(3)-p52(2)*ce2(i1)%e(3))-p52k0*(ce2(i1)%e(2)*
     & p5(3)-p5(2)*ce2(i1)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-ce2(i1)%e(3)*p5k0+p5(3)*ce2(i1)%ek0
      ceps_1=ceps_1*cim
      cvqu=ce2(i1)%e(0)*p5(0)-ce2(i1)%e(1)*p5(1)-ce2(i1)%e(2)*p5
     & (2)-ce2(i1)%e(3)*p5(3)
      cvqd=ce2(i1)%e(0)*p52(0)-ce2(i1)%e(1)*p52(1)-ce2(i1)%e(2)*
     & p52(2)-ce2(i1)%e(3)*p52(3)
      cauxa=-ce2(i1)%ek0*quqd+p5k0*cvqd+p52k0*cvqu
      cauxc=+ce2(i1)%ek0*p5(2)-p5k0*ce2(i1)%e(2)
      l5_2(i1)%a(2)=ccl*(cauxa-ceps_0)
      l5_2(i1)%c(2)=ccl*(-cauxc+ceps_1)
      end do
* quqd -- p=p52,q=p6
      quqd=p52(0)*p6(0)-p52(1)*p6(1)-p52(2)*p6(2)-p52(3)*p6(3)
* TWR0 -- qu=p52,qd=p6,v=0,a=rwlinet_mu(0)%a,b=rwlinet_mu(0)%b,cl=cdw,ns
* um=0
      eps_0=-p52(2)*p6(3)+p6(2)*p52(3)
      ceps_0=eps_0*cim
      ceps_2=p6(3)*cim
      auxa=-quqd+p52k0*p6(0)+p6k0*p52(0)
      rwlinet_mu(0)%a(2)=cdw*(auxa-ceps_0)
      rwlinet_mu(0)%b(1)=-cdw*(p6(2)+ceps_2)
* TWR0 -- qu=p52,qd=p6,v=1,a=rwlinet_mu(1)%a,b=rwlinet_mu(1)%b,cl=cdw,ns
* um=0
      auxa=-quqd+p52k0*p6(1)+p6k0*p52(1)
      rwlinet_mu(1)%a(2)=cdw*(auxa-ceps_0)
      rwlinet_mu(1)%b(1)=-cdw*(p6(2)+ceps_2)
* TWR0 -- qu=p52,qd=p6,v=2,a=rwlinet_mu(2)%a,b=rwlinet_mu(2)%b,cl=cdw,ns
* um=0
      eps_0=-p52k0*p6(3)+p6k0*p52(3)
      ceps_0=eps_0*cim
      auxa=p52k0*p6(2)+p6k0*p52(2)
      rwlinet_mu(2)%a(2)=cdw*(auxa-ceps_0)
      rwlinet_mu(2)%b(1)=-cdw*p6k0
* TWR0 -- qu=p52,qd=p6,v=3,a=rwlinet_mu(3)%a,b=rwlinet_mu(3)%b,cl=cdw,ns
* um=0
      eps_0=p52k0*p6(2)-p6k0*p52(2)
      ceps_0=eps_0*cim
      ceps_2=p6k0*cim
      auxa=p52k0*p6(3)+p6k0*p52(3)
      rwlinet_mu(3)%a(2)=cdw*(auxa-ceps_0)
      rwlinet_mu(3)%b(1)=-cdw*ceps_2
      do i1=1,2
      do mu=0,3
* TLTR0_W -- aa=cw526(i1)%e(mu),a1=l5_2(i1)%a,c1=l5_2(i1)%c,a2=rwlinet_m
* u(mu)%a,b2=rwlinet_mu(mu)%b,prq=s52,bef=,aft=
      cw526(i1)%e(mu)=(l5_2(i1)%c(2)*s52*rwlinet_mu(mu)%b(1)+l5_
     & 2(i1)%a(2)*rwlinet_mu(mu)%a(2))
      end do
      end do
* quqd -- p=p26,q=p6
      quqd=p26(0)*p6(0)-p26(1)*p6(1)-p26(2)*p6(2)-p26(3)*p6(3)
      ccl=gs/(s26*p26k0)
      do i1=1,2
* TWR0 -- qu=p26,qd=p6,v=ce2(i1)%e,a=r6_2(i1)%a,b=r6_2(i1)%b,cl=ccl,nsum
* =0
      ceps_0=-ce2(i1)%ek0*(p26(2)*p6(3)-p6(2)*p26(3))+p26k0*(ce2
     & (i1)%e(2)*p6(3)-p6(2)*ce2(i1)%e(3))-p6k0*(ce2(i1)%e(2)*p2
     & 6(3)-p26(2)*ce2(i1)%e(3))
      ceps_0=ceps_0*cim
      ceps_2=-ce2(i1)%e(3)*p6k0+p6(3)*ce2(i1)%ek0
      ceps_2=ceps_2*cim
      cvqu=ce2(i1)%e(0)*p26(0)-ce2(i1)%e(1)*p26(1)-ce2(i1)%e(2)*
     & p26(2)-ce2(i1)%e(3)*p26(3)
      cvqd=ce2(i1)%e(0)*p6(0)-ce2(i1)%e(1)*p6(1)-ce2(i1)%e(2)*p6
     & (2)-ce2(i1)%e(3)*p6(3)
      cauxa=-ce2(i1)%ek0*quqd+p26k0*cvqd+p6k0*cvqu
      cauxb=-ce2(i1)%ek0*p6(2)+p6k0*ce2(i1)%e(2)
      r6_2(i1)%a(2)=ccl*(cauxa-ceps_0)
      r6_2(i1)%b(1)=ccl*(cauxb-ceps_2)
      end do
* quqd -- p=p5,q=p26
      quqd=p5(0)*p26(0)-p5(1)*p26(1)-p5(2)*p26(2)-p5(3)*p26(3)
* TWL0 -- qu=p5,qd=p26,v=0,a=lwlinet_mu(0)%a,c=lwlinet_mu(0)%c,cl=cdw,ns
* um=0
      eps_0=-p5(2)*p26(3)+p26(2)*p5(3)
      ceps_0=eps_0*cim
      ceps_1=p5(3)*cim
      auxa=-quqd+p5k0*p26(0)+p26k0*p5(0)
      lwlinet_mu(0)%a(2)=cdw*(auxa-ceps_0)
      lwlinet_mu(0)%c(2)=cdw*(-p5(2)+ceps_1)
* TWL0 -- qu=p5,qd=p26,v=1,a=lwlinet_mu(1)%a,c=lwlinet_mu(1)%c,cl=cdw,ns
* um=0
      auxa=-quqd+p5k0*p26(1)+p26k0*p5(1)
