     & 1(i1)%b(1,2)+clinet_mu(mu)%d(2,2)*r4_1(i1)%a(2,2))
      clinet1(i1,mu)%c(2,2)=rmass(id3)*(clinet_mu(mu)%c(2,1)*r4_
     & 1(i1)%c(1,2)+clinet_mu(mu)%a(2,2)*r4_1(i1)%d(2,2))
      clinet1(i1,mu)%d(2,2)=clinet_mu(mu)%b(2,1)*r4_1(i1)%c(1,2)
     & +clinet_mu(mu)%d(2,2)*s14*r4_1(i1)%d(2,2)
      end do
      end do
      do i1=1,2
      do mu=0,3
* mline -- res=cz314(&1,i1,&2)%e(mu),abcd=clinet1(i1,mu)%,m1=rmassl,m2=r
* massr,den=(-s134+cmz2),nsum=1
      do iut=1,2
      do jut=1,2
      cz314(iut,i1,jut)%e(mu)=cz314(iut,i1,jut)%e(mu)+(clinet1(i
     & 1,mu)%a(iut,jut)+rmassl*clinet1(i1,mu)%b(iut,jut)+rmassr*
     & clinet1(i1,mu)%c(iut,jut)+rmassl*rmassr*clinet1(i1,mu)%d(
     & iut,jut))/(-s134+cmz2)
      enddo
      enddo
      end do
      end do
      if (imass(id3).eq.1) then
        do i1=1,2
          do i2=1,2
            do i3=1,2
* p.q -- p.q=cauxdot,p=p134,q=cz314(i1,i2,i3)%e,bef=,aft=
      cauxdot=(p134(0)*cz314(i1,i2,i3)%e(0)-p134(1)*cz314(i1,i2,
     & i3)%e(1)-p134(2)*cz314(i1,i2,i3)%e(2)-p134(3)*cz314(i1,i2
     & ,i3)%e(3))
              do mu=0,3
                cz314(i1,i2,i3)%e(mu)=cz314(i1,i2,i3)%e(mu)
     &             -p134(mu)*cauxdot/cmz2
              enddo
            enddo
          enddo
        enddo
      endif
      do i1=1,2
      do i2=1,2
      do i3=1,2
* pk0 -- p=cz314(i1,i2,i3)%e
      cz314(i1,i2,i3)%ek0=cz314(i1,i2,i3)%e(0)-cz314(i1,i2,i3)%e
     & (1)
      end do
      end do
      end do
* quqd -- p=p31,q=p4
      quqd=p31(0)*p4(0)-p31(1)*p4(1)-p31(2)*p4(2)-p31(3)*p4(3)
* T -- qu=p31,qd=p4,v=0,a=clinet_mu(0)%a,b=clinet_mu(0)%b,c=clinet_mu(0)
* %c,d=clinet_mu(0)%d,cr=fcr(id3),cl=fcl(id3),nsum=0
      eps_0=-p31(2)*p4(3)+p4(2)*p31(3)
      ceps_0=eps_0*cim
      ceps_1=p31(3)*cim
      ceps_2=p4(3)*cim
      auxa=-quqd+p31k0*p4(0)+p4k0*p31(0)
      clinet_mu(0)%a(1,1)=fcr(id3)*(auxa+ceps_0)
      clinet_mu(0)%a(2,2)=fcl(id3)*(auxa-ceps_0)
      clinet_mu(0)%b(1,2)=-fcl(id3)*(p4(2)+ceps_2)
      clinet_mu(0)%b(2,1)=fcr(id3)*(p4(2)-ceps_2)
      clinet_mu(0)%c(1,2)=fcr(id3)*(p31(2)+ceps_1)
      clinet_mu(0)%c(2,1)=fcl(id3)*(-p31(2)+ceps_1)
      clinet_mu(0)%d(1,1)=fcl(id3)
      clinet_mu(0)%d(2,2)=fcr(id3)
* T -- qu=p31,qd=p4,v=1,a=clinet_mu(1)%a,b=clinet_mu(1)%b,c=clinet_mu(1)
* %c,d=clinet_mu(1)%d,cr=fcr(id3),cl=fcl(id3),nsum=0
      auxa=-quqd+p31k0*p4(1)+p4k0*p31(1)
      clinet_mu(1)%a(1,1)=fcr(id3)*(auxa+ceps_0)
      clinet_mu(1)%a(2,2)=fcl(id3)*(auxa-ceps_0)
      clinet_mu(1)%b(1,2)=-fcl(id3)*(p4(2)+ceps_2)
      clinet_mu(1)%b(2,1)=fcr(id3)*(p4(2)-ceps_2)
      clinet_mu(1)%c(1,2)=fcr(id3)*(p31(2)+ceps_1)
      clinet_mu(1)%c(2,1)=fcl(id3)*(-p31(2)+ceps_1)
      clinet_mu(1)%d(1,1)=fcl(id3)
      clinet_mu(1)%d(2,2)=fcr(id3)
* T -- qu=p31,qd=p4,v=2,a=clinet_mu(2)%a,b=clinet_mu(2)%b,c=clinet_mu(2)
* %c,d=clinet_mu(2)%d,cr=fcr(id3),cl=fcl(id3),nsum=0
      eps_0=-p31k0*p4(3)+p4k0*p31(3)
      ceps_0=eps_0*cim
      auxa=p31k0*p4(2)+p4k0*p31(2)
      clinet_mu(2)%a(1,1)=fcr(id3)*(auxa+ceps_0)
      clinet_mu(2)%a(2,2)=fcl(id3)*(auxa-ceps_0)
      clinet_mu(2)%b(1,2)=-fcl(id3)*p4k0
      clinet_mu(2)%b(2,1)=fcr(id3)*p4k0
      clinet_mu(2)%c(1,2)=fcr(id3)*p31k0
      clinet_mu(2)%c(2,1)=-fcl(id3)*p31k0
* T -- qu=p31,qd=p4,v=3,a=clinet_mu(3)%a,b=clinet_mu(3)%b,c=clinet_mu(3)
* %c,d=clinet_mu(3)%d,cr=fcr(id3),cl=fcl(id3),nsum=0
      eps_0=p31k0*p4(2)-p4k0*p31(2)
      ceps_0=eps_0*cim
      ceps_1=p31k0*cim
      ceps_2=p4k0*cim
      auxa=+p31k0*p4(3)+p4k0*p31(3)
      clinet_mu(3)%a(1,1)=fcr(id3)*(auxa+ceps_0)
      clinet_mu(3)%a(2,2)=fcl(id3)*(auxa-ceps_0)
      clinet_mu(3)%b(1,2)=-fcl(id3)*ceps_2
      clinet_mu(3)%b(2,1)=-fcr(id3)*ceps_2
      clinet_mu(3)%c(1,2)=fcr(id3)*ceps_1
      clinet_mu(3)%c(2,1)=fcl(id3)*ceps_1
      do i1=1,2
      do mu=0,3
* TT -- aa=clinet1(i1,mu)%a,bb=clinet1(i1,mu)%b,cc=clinet1(i1,mu)%c,dd=c
* linet1(i1,mu)%d,a1=l3_1(i1)%a,b1=l3_1(i1)%b,c1=l3_1(i1)%c,d1=l3_1(i1)%
* d,a2=clinet_mu(mu)%a,b2=clinet_mu(mu)%b,c2=clinet_mu(mu)%c,d2=clinet_m
* u(mu)%d,prq=s31,m=rmass(id3),nsum=0
      clinet1(i1,mu)%a(1,1)=l3_1(i1)%a(1,1)*clinet_mu(mu)%a(1,1)
     & +l3_1(i1)%c(1,2)*s31*clinet_mu(mu)%b(2,1)
      clinet1(i1,mu)%b(1,1)=rmass(id3)*(l3_1(i1)%d(1,1)*clinet_m
     & u(mu)%a(1,1)+l3_1(i1)%b(1,2)*clinet_mu(mu)%b(2,1))
      clinet1(i1,mu)%c(1,1)=rmass(id3)*(l3_1(i1)%a(1,1)*clinet_m
     & u(mu)%d(1,1)+l3_1(i1)%c(1,2)*clinet_mu(mu)%c(2,1))
      clinet1(i1,mu)%d(1,1)=l3_1(i1)%d(1,1)*s31*clinet_mu(mu)%d(
     & 1,1)+l3_1(i1)%b(1,2)*clinet_mu(mu)%c(2,1)
      clinet1(i1,mu)%a(1,2)=rmass(id3)*(l3_1(i1)%a(1,1)*clinet_m
     & u(mu)%b(1,2)+l3_1(i1)%c(1,2)*clinet_mu(mu)%a(2,2))
      clinet1(i1,mu)%b(1,2)=l3_1(i1)%d(1,1)*s31*clinet_mu(mu)%b(
     & 1,2)+l3_1(i1)%b(1,2)*clinet_mu(mu)%a(2,2)
      clinet1(i1,mu)%c(1,2)=l3_1(i1)%a(1,1)*clinet_mu(mu)%c(1,2)
     & +l3_1(i1)%c(1,2)*s31*clinet_mu(mu)%d(2,2)
      clinet1(i1,mu)%d(1,2)=rmass(id3)*(l3_1(i1)%d(1,1)*clinet_m
     & u(mu)%c(1,2)+l3_1(i1)%b(1,2)*clinet_mu(mu)%d(2,2))
      clinet1(i1,mu)%a(2,1)=rmass(id3)*(l3_1(i1)%c(2,1)*clinet_m
     & u(mu)%a(1,1)+l3_1(i1)%a(2,2)*clinet_mu(mu)%b(2,1))
      clinet1(i1,mu)%b(2,1)=l3_1(i1)%b(2,1)*clinet_mu(mu)%a(1,1)
     & +l3_1(i1)%d(2,2)*s31*clinet_mu(mu)%b(2,1)
      clinet1(i1,mu)%c(2,1)=l3_1(i1)%c(2,1)*s31*clinet_mu(mu)%d(
     & 1,1)+l3_1(i1)%a(2,2)*clinet_mu(mu)%c(2,1)
      clinet1(i1,mu)%d(2,1)=rmass(id3)*(l3_1(i1)%b(2,1)*clinet_m
     & u(mu)%d(1,1)+l3_1(i1)%d(2,2)*clinet_mu(mu)%c(2,1))
      clinet1(i1,mu)%a(2,2)=l3_1(i1)%c(2,1)*s31*clinet_mu(mu)%b(
     & 1,2)+l3_1(i1)%a(2,2)*clinet_mu(mu)%a(2,2)
      clinet1(i1,mu)%b(2,2)=rmass(id3)*(l3_1(i1)%b(2,1)*clinet_m
     & u(mu)%b(1,2)+l3_1(i1)%d(2,2)*clinet_mu(mu)%a(2,2))
      clinet1(i1,mu)%c(2,2)=rmass(id3)*(l3_1(i1)%c(2,1)*clinet_m
     & u(mu)%c(1,2)+l3_1(i1)%a(2,2)*clinet_mu(mu)%d(2,2))
      clinet1(i1,mu)%d(2,2)=l3_1(i1)%b(2,1)*clinet_mu(mu)%c(1,2)
     & +l3_1(i1)%d(2,2)*s31*clinet_mu(mu)%d(2,2)
      end do
      end do
      do i1=1,2
      do mu=0,3
* mline -- res=cf314(&1,i1,&2)%e(mu),abcd=clinet1(i1,mu)%,m1=rmassl,m2=r
* massr,den=(-s134),nsum=0
      do iut=1,2
      do jut=1,2
      cf314(iut,i1,jut)%e(mu)=(clinet1(i1,mu)%a(iut,jut)+rmassl*
     & clinet1(i1,mu)%b(iut,jut)+rmassr*clinet1(i1,mu)%c(iut,jut
     & )+rmassl*rmassr*clinet1(i1,mu)%d(iut,jut))/(-s134)
      enddo
      enddo
      end do
      end do
* quqd -- p=p3,q=p14
      quqd=p3(0)*p14(0)-p3(1)*p14(1)-p3(2)*p14(2)-p3(3)*p14(3)
* T -- qu=p3,qd=p14,v=0,a=clinet_mu(0)%a,b=clinet_mu(0)%b,c=clinet_mu(0)
* %c,d=clinet_mu(0)%d,cr=fcr(id3),cl=fcl(id3),nsum=0
      eps_0=-p3(2)*p14(3)+p14(2)*p3(3)
      ceps_0=eps_0*cim
      ceps_1=p3(3)*cim
      ceps_2=p14(3)*cim
      auxa=-quqd+p3k0*p14(0)+p14k0*p3(0)
      clinet_mu(0)%a(1,1)=fcr(id3)*(auxa+ceps_0)
      clinet_mu(0)%a(2,2)=fcl(id3)*(auxa-ceps_0)
      clinet_mu(0)%b(1,2)=-fcl(id3)*(p14(2)+ceps_2)
      clinet_mu(0)%b(2,1)=fcr(id3)*(p14(2)-ceps_2)
      clinet_mu(0)%c(1,2)=fcr(id3)*(p3(2)+ceps_1)
      clinet_mu(0)%c(2,1)=fcl(id3)*(-p3(2)+ceps_1)
      clinet_mu(0)%d(1,1)=fcl(id3)
      clinet_mu(0)%d(2,2)=fcr(id3)
* T -- qu=p3,qd=p14,v=1,a=clinet_mu(1)%a,b=clinet_mu(1)%b,c=clinet_mu(1)
* %c,d=clinet_mu(1)%d,cr=fcr(id3),cl=fcl(id3),nsum=0
      auxa=-quqd+p3k0*p14(1)+p14k0*p3(1)
      clinet_mu(1)%a(1,1)=fcr(id3)*(auxa+ceps_0)
      clinet_mu(1)%a(2,2)=fcl(id3)*(auxa-ceps_0)
      clinet_mu(1)%b(1,2)=-fcl(id3)*(p14(2)+ceps_2)
      clinet_mu(1)%b(2,1)=fcr(id3)*(p14(2)-ceps_2)
      clinet_mu(1)%c(1,2)=fcr(id3)*(p3(2)+ceps_1)
      clinet_mu(1)%c(2,1)=fcl(id3)*(-p3(2)+ceps_1)
      clinet_mu(1)%d(1,1)=fcl(id3)
      clinet_mu(1)%d(2,2)=fcr(id3)
* T -- qu=p3,qd=p14,v=2,a=clinet_mu(2)%a,b=clinet_mu(2)%b,c=clinet_mu(2)
* %c,d=clinet_mu(2)%d,cr=fcr(id3),cl=fcl(id3),nsum=0
      eps_0=-p3k0*p14(3)+p14k0*p3(3)
      ceps_0=eps_0*cim
      auxa=p3k0*p14(2)+p14k0*p3(2)
      clinet_mu(2)%a(1,1)=fcr(id3)*(auxa+ceps_0)
      clinet_mu(2)%a(2,2)=fcl(id3)*(auxa-ceps_0)
      clinet_mu(2)%b(1,2)=-fcl(id3)*p14k0
      clinet_mu(2)%b(2,1)=fcr(id3)*p14k0
      clinet_mu(2)%c(1,2)=fcr(id3)*p3k0
      clinet_mu(2)%c(2,1)=-fcl(id3)*p3k0
* T -- qu=p3,qd=p14,v=3,a=clinet_mu(3)%a,b=clinet_mu(3)%b,c=clinet_mu(3)
* %c,d=clinet_mu(3)%d,cr=fcr(id3),cl=fcl(id3),nsum=0
      eps_0=p3k0*p14(2)-p14k0*p3(2)
      ceps_0=eps_0*cim
      ceps_1=p3k0*cim
      ceps_2=p14k0*cim
      auxa=+p3k0*p14(3)+p14k0*p3(3)
      clinet_mu(3)%a(1,1)=fcr(id3)*(auxa+ceps_0)
      clinet_mu(3)%a(2,2)=fcl(id3)*(auxa-ceps_0)
      clinet_mu(3)%b(1,2)=-fcl(id3)*ceps_2
      clinet_mu(3)%b(2,1)=-fcr(id3)*ceps_2
      clinet_mu(3)%c(1,2)=fcr(id3)*ceps_1
      clinet_mu(3)%c(2,1)=fcl(id3)*ceps_1
      do i1=1,2
      do mu=0,3
* TT -- aa=clinet1(i1,mu)%a,bb=clinet1(i1,mu)%b,cc=clinet1(i1,mu)%c,dd=c
* linet1(i1,mu)%d,a1=clinet_mu(mu)%a,b1=clinet_mu(mu)%b,c1=clinet_mu(mu)
* %c,d1=clinet_mu(mu)%d,a2=r4_1(i1)%a,b2=r4_1(i1)%b,c2=r4_1(i1)%c,d2=r4_
* 1(i1)%d,prq=s14,m=rmass(id3),nsum=0
      clinet1(i1,mu)%a(1,1)=clinet_mu(mu)%a(1,1)*r4_1(i1)%a(1,1)
     & +clinet_mu(mu)%c(1,2)*s14*r4_1(i1)%b(2,1)
      clinet1(i1,mu)%b(1,1)=rmass(id3)*(clinet_mu(mu)%d(1,1)*r4_
     & 1(i1)%a(1,1)+clinet_mu(mu)%b(1,2)*r4_1(i1)%b(2,1))
      clinet1(i1,mu)%c(1,1)=rmass(id3)*(clinet_mu(mu)%a(1,1)*r4_
     & 1(i1)%d(1,1)+clinet_mu(mu)%c(1,2)*r4_1(i1)%c(2,1))
      clinet1(i1,mu)%d(1,1)=clinet_mu(mu)%d(1,1)*s14*r4_1(i1)%d(
     & 1,1)+clinet_mu(mu)%b(1,2)*r4_1(i1)%c(2,1)
      clinet1(i1,mu)%a(1,2)=rmass(id3)*(clinet_mu(mu)%a(1,1)*r4_
     & 1(i1)%b(1,2)+clinet_mu(mu)%c(1,2)*r4_1(i1)%a(2,2))
      clinet1(i1,mu)%b(1,2)=clinet_mu(mu)%d(1,1)*s14*r4_1(i1)%b(
     & 1,2)+clinet_mu(mu)%b(1,2)*r4_1(i1)%a(2,2)
      clinet1(i1,mu)%c(1,2)=clinet_mu(mu)%a(1,1)*r4_1(i1)%c(1,2)
     & +clinet_mu(mu)%c(1,2)*s14*r4_1(i1)%d(2,2)
      clinet1(i1,mu)%d(1,2)=rmass(id3)*(clinet_mu(mu)%d(1,1)*r4_
     & 1(i1)%c(1,2)+clinet_mu(mu)%b(1,2)*r4_1(i1)%d(2,2))
      clinet1(i1,mu)%a(2,1)=rmass(id3)*(clinet_mu(mu)%c(2,1)*r4_
     & 1(i1)%a(1,1)+clinet_mu(mu)%a(2,2)*r4_1(i1)%b(2,1))
      clinet1(i1,mu)%b(2,1)=clinet_mu(mu)%b(2,1)*r4_1(i1)%a(1,1)
     & +clinet_mu(mu)%d(2,2)*s14*r4_1(i1)%b(2,1)
      clinet1(i1,mu)%c(2,1)=clinet_mu(mu)%c(2,1)*s14*r4_1(i1)%d(
     & 1,1)+clinet_mu(mu)%a(2,2)*r4_1(i1)%c(2,1)
      clinet1(i1,mu)%d(2,1)=rmass(id3)*(clinet_mu(mu)%b(2,1)*r4_
     & 1(i1)%d(1,1)+clinet_mu(mu)%d(2,2)*r4_1(i1)%c(2,1))
      clinet1(i1,mu)%a(2,2)=clinet_mu(mu)%c(2,1)*s14*r4_1(i1)%b(
     & 1,2)+clinet_mu(mu)%a(2,2)*r4_1(i1)%a(2,2)
      clinet1(i1,mu)%b(2,2)=rmass(id3)*(clinet_mu(mu)%b(2,1)*r4_
     & 1(i1)%b(1,2)+clinet_mu(mu)%d(2,2)*r4_1(i1)%a(2,2))
      clinet1(i1,mu)%c(2,2)=rmass(id3)*(clinet_mu(mu)%c(2,1)*r4_
     & 1(i1)%c(1,2)+clinet_mu(mu)%a(2,2)*r4_1(i1)%d(2,2))
      clinet1(i1,mu)%d(2,2)=clinet_mu(mu)%b(2,1)*r4_1(i1)%c(1,2)
     & +clinet_mu(mu)%d(2,2)*s14*r4_1(i1)%d(2,2)
      end do
      end do
      do i1=1,2
      do mu=0,3
* mline -- res=cf314(&1,i1,&2)%e(mu),abcd=clinet1(i1,mu)%,m1=rmassl,m2=r
* massr,den=(-s134),nsum=1
      do iut=1,2
      do jut=1,2
      cf314(iut,i1,jut)%e(mu)=cf314(iut,i1,jut)%e(mu)+(clinet1(i
     & 1,mu)%a(iut,jut)+rmassl*clinet1(i1,mu)%b(iut,jut)+rmassr*
     & clinet1(i1,mu)%c(iut,jut)+rmassl*rmassr*clinet1(i1,mu)%d(
     & iut,jut))/(-s134)
      enddo
      enddo
      end do
      end do
      do i1=1,2
      do i2=1,2
      do i3=1,2
* pk0 -- p=cf314(i1,i2,i3)%e
      cf314(i1,i2,i3)%ek0=cf314(i1,i2,i3)%e(0)-cf314(i1,i2,i3)%e
     & (1)
      end do
      end do
      end do
  
*      higgs                                                            
  
      if (id3.eq.5) then
  
* TH -- qu=p31,qd=p4,a=clineth%a,b=clineth%b,c=clineth%c,coupl=rhbb
      auxa=-p31k0*p4(2)+p4k0*p31(2)
      cauxa=auxa-cim*(p4(3)*p31k0-p31(3)*p4k0)
      clineth%a(1,2)=rhbb*cauxa
      clineth%a(2,1)=-rhbb*conjg(cauxa)
      clineth%b(1,1)=rhbb*p4k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=rhbb*p31k0
      clineth%c(2,2)=clineth%c(1,1)
      do i1=1,2
* TTs -- aa=clineth1(i1)%a,bb=clineth1(i1)%b,cc=clineth1(i1)%c,dd=clinet
* h1(i1)%d,a1=l3_1(i1)%a,b1=l3_1(i1)%b,c1=l3_1(i1)%c,d1=l3_1(i1)%d,a2=cl
* ineth%a,b2=clineth%b,c2=clineth%c,d2=clineth%d,prq=s31,m=rmass(id3),ns
* um=0
      do jut=1,2
