     & cy2
      clineth1(i1)%b(1,jut)=l3_1(i1)%d(1,1)*cy1+l3_1(i1)%b(1,2)*
     & cx2
      clineth1(i1)%c(1,jut)=l3_1(i1)%a(1,1)*cw1+l3_1(i1)%c(1,2)*
