* 1)%a,b2=r4_1(i1)%b,c2=r4_1(i1)%c,d2=r4_1(i1)%d,prq=s14,m=rmass(id3),ns
* um=0
      do iut=1,2
      cx1=clineth%a(iut,1)+clineth%c(iut,1)*rmass(id3)
      cx2=clineth%c(iut,2)*s14+clineth%a(iut,2)*rmass(id3)
      cy1=clineth%b(iut,1)+clineth%d(iut,1)*rmass(id3)
      cy2=clineth%d(iut,2)*s14+clineth%b(iut,2)*rmass(id3)
      cw1=clineth%c(iut,1)*s14+clineth%a(iut,1)*rmass(id3)
      cw2=clineth%a(iut,2)+clineth%c(iut,2)*rmass(id3)
