      ch314(iut,i1,jut)=ch314(iut,i1,jut)+(clineth1(i1)%a(iut,ju
     & t)+rmassl*clineth1(i1)%b(iut,jut)+rmassr*clineth1(i1)%c(i
     & ut,jut)+rmassl*rmassr*clineth1(i1)%d(iut,jut))/(s134-cmh2
     & )
      enddo
      enddo
      end do
  
      else
        do i3=1,2
