* quqd -- p=p3,q=p32
      quqd=p3(0)*p32(0)-p3(1)*p32(1)-p3(2)*p32(2)-p3(3)*p32(3)
      ccr=gs/((s32-rmass2(id3))*p32k0)
      ccl=gs/((s32-rmass2(id3))*p32k0)
      do i1=1,2
* T -- qu=p3,qd=p32,v=ce2(i1)%e,a=l3_2(i1)%a,b=l3_2(i1)%b,c=l3_2(i1)%c,d
* =l3_2(i1)%d,cr=ccr,cl=ccl,nsum=0
      ceps_0=-ce2(i1)%ek0*(p3(2)*p32(3)-p32(2)*p3(3))+p3k0*(ce2(
