* quqd -- p=p3,q=p24
      quqd=p3(0)*p24(0)-p3(1)*p24(1)-p3(2)*p24(2)-p3(3)*p24(3)
* T -- qu=p3,qd=p24,v=0,a=clinet_mu(0)%a,b=clinet_mu(0)%b,c=clinet_mu(0)
