      clinet_mu(2)%b(2,1)=fcr(id3)*p24k0
      clinet_mu(2)%c(1,2)=fcr(id3)*p3k0
      clinet_mu(2)%c(2,1)=-fcl(id3)*p3k0
* T -- qu=p3,qd=p24,v=3,a=clinet_mu(3)%a,b=clinet_mu(3)%b,c=clinet_mu(3)
* %c,d=clinet_mu(3)%d,cr=fcr(id3),cl=fcl(id3),nsum=0
      eps_0=p3k0*p24(2)-p24k0*p3(2)
      ceps_0=eps_0*cim
      ceps_1=p3k0*cim
      ceps_2=p24k0*cim
      auxa=+p3k0*p24(3)+p24k0*p3(3)
      clinet_mu(3)%a(1,1)=fcr(id3)*(auxa+ceps_0)
      clinet_mu(3)%a(2,2)=fcl(id3)*(auxa-ceps_0)
      clinet_mu(3)%b(1,2)=-fcl(id3)*ceps_2
      clinet_mu(3)%b(2,1)=-fcr(id3)*ceps_2
      clinet_mu(3)%c(1,2)=fcr(id3)*ceps_1
      clinet_mu(3)%c(2,1)=fcl(id3)*ceps_1
      do i1=1,2
      do mu=0,3
* TT -- aa=clinet1(i1,mu)%a,bb=clinet1(i1,mu)%b,cc=clinet1(i1,mu)%c,dd=c
* linet1(i1,mu)%d,a1=clinet_mu(mu)%a,b1=clinet_mu(mu)%b,c1=clinet_mu(mu)
* %c,d1=clinet_mu(mu)%d,a2=r4_2(i1)%a,b2=r4_2(i1)%b,c2=r4_2(i1)%c,d2=r4_
* 2(i1)%d,prq=s24,m=rmass(id3),nsum=0
      clinet1(i1,mu)%a(1,1)=clinet_mu(mu)%a(1,1)*r4_2(i1)%a(1,1)
     & +clinet_mu(mu)%c(1,2)*s24*r4_2(i1)%b(2,1)
      clinet1(i1,mu)%b(1,1)=rmass(id3)*(clinet_mu(mu)%d(1,1)*r4_
     & 2(i1)%a(1,1)+clinet_mu(mu)%b(1,2)*r4_2(i1)%b(2,1))
      clinet1(i1,mu)%c(1,1)=rmass(id3)*(clinet_mu(mu)%a(1,1)*r4_
     & 2(i1)%d(1,1)+clinet_mu(mu)%c(1,2)*r4_2(i1)%c(2,1))
      clinet1(i1,mu)%d(1,1)=clinet_mu(mu)%d(1,1)*s24*r4_2(i1)%d(
     & 1,1)+clinet_mu(mu)%b(1,2)*r4_2(i1)%c(2,1)
      clinet1(i1,mu)%a(1,2)=rmass(id3)*(clinet_mu(mu)%a(1,1)*r4_
     & 2(i1)%b(1,2)+clinet_mu(mu)%c(1,2)*r4_2(i1)%a(2,2))
      clinet1(i1,mu)%b(1,2)=clinet_mu(mu)%d(1,1)*s24*r4_2(i1)%b(
     & 1,2)+clinet_mu(mu)%b(1,2)*r4_2(i1)%a(2,2)
      clinet1(i1,mu)%c(1,2)=clinet_mu(mu)%a(1,1)*r4_2(i1)%c(1,2)
     & +clinet_mu(mu)%c(1,2)*s24*r4_2(i1)%d(2,2)
      clinet1(i1,mu)%d(1,2)=rmass(id3)*(clinet_mu(mu)%d(1,1)*r4_
     & 2(i1)%c(1,2)+clinet_mu(mu)%b(1,2)*r4_2(i1)%d(2,2))
      clinet1(i1,mu)%a(2,1)=rmass(id3)*(clinet_mu(mu)%c(2,1)*r4_
     & 2(i1)%a(1,1)+clinet_mu(mu)%a(2,2)*r4_2(i1)%b(2,1))
      clinet1(i1,mu)%b(2,1)=clinet_mu(mu)%b(2,1)*r4_2(i1)%a(1,1)
     & +clinet_mu(mu)%d(2,2)*s24*r4_2(i1)%b(2,1)
      clinet1(i1,mu)%c(2,1)=clinet_mu(mu)%c(2,1)*s24*r4_2(i1)%d(
     & 1,1)+clinet_mu(mu)%a(2,2)*r4_2(i1)%c(2,1)
      clinet1(i1,mu)%d(2,1)=rmass(id3)*(clinet_mu(mu)%b(2,1)*r4_
     & 2(i1)%d(1,1)+clinet_mu(mu)%d(2,2)*r4_2(i1)%c(2,1))
      clinet1(i1,mu)%a(2,2)=clinet_mu(mu)%c(2,1)*s24*r4_2(i1)%b(
     & 1,2)+clinet_mu(mu)%a(2,2)*r4_2(i1)%a(2,2)
      clinet1(i1,mu)%b(2,2)=rmass(id3)*(clinet_mu(mu)%b(2,1)*r4_
     & 2(i1)%b(1,2)+clinet_mu(mu)%d(2,2)*r4_2(i1)%a(2,2))
      clinet1(i1,mu)%c(2,2)=rmass(id3)*(clinet_mu(mu)%c(2,1)*r4_
     & 2(i1)%c(1,2)+clinet_mu(mu)%a(2,2)*r4_2(i1)%d(2,2))
      clinet1(i1,mu)%d(2,2)=clinet_mu(mu)%b(2,1)*r4_2(i1)%c(1,2)
     & +clinet_mu(mu)%d(2,2)*s24*r4_2(i1)%d(2,2)
      end do
      end do
      do i1=1,2
      do mu=0,3
* mline -- res=cf324(&1,i1,&2)%e(mu),abcd=clinet1(i1,mu)%,m1=rmassl,m2=r
* massr,den=(-s234),nsum=1
      do iut=1,2
      do jut=1,2
      cf324(iut,i1,jut)%e(mu)=cf324(iut,i1,jut)%e(mu)+(clinet1(i
     & 1,mu)%a(iut,jut)+rmassl*clinet1(i1,mu)%b(iut,jut)+rmassr*
     & clinet1(i1,mu)%c(iut,jut)+rmassl*rmassr*clinet1(i1,mu)%d(
     & iut,jut))/(-s234)
      enddo
      enddo
      end do
      end do
      do i1=1,2
      do i2=1,2
      do i3=1,2
* pk0 -- p=cf324(i1,i2,i3)%e
      cf324(i1,i2,i3)%ek0=cf324(i1,i2,i3)%e(0)-cf324(i1,i2,i3)%e
     & (1)
      end do
      end do
      end do
  
*      higgs                                                            
  
      if (id3.eq.5) then
  
* TH -- qu=p32,qd=p4,a=clineth%a,b=clineth%b,c=clineth%c,coupl=rhbb
      auxa=-p32k0*p4(2)+p4k0*p32(2)
      cauxa=auxa-cim*(p4(3)*p32k0-p32(3)*p4k0)
      clineth%a(1,2)=rhbb*cauxa
      clineth%a(2,1)=-rhbb*conjg(cauxa)
      clineth%b(1,1)=rhbb*p4k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=rhbb*p32k0
      clineth%c(2,2)=clineth%c(1,1)
      do i1=1,2
* TTs -- aa=clineth1(i1)%a,bb=clineth1(i1)%b,cc=clineth1(i1)%c,dd=clinet
* h1(i1)%d,a1=l3_2(i1)%a,b1=l3_2(i1)%b,c1=l3_2(i1)%c,d1=l3_2(i1)%d,a2=cl
* ineth%a,b2=clineth%b,c2=clineth%c,d2=clineth%d,prq=s32,m=rmass(id3),ns
* um=0
      do jut=1,2
      cx1=clineth%a(1,jut)+rmass(id3)*clineth%b(1,jut)
      cx2=clineth%a(2,jut)+rmass(id3)*clineth%b(2,jut)
      cy1=s32*clineth%b(1,jut)+rmass(id3)*clineth%a(1,jut)
      cy2=s32*clineth%b(2,jut)+rmass(id3)*clineth%a(2,jut)
      cw1=clineth%c(1,jut)+rmass(id3)*clineth%d(1,jut)
      cw2=clineth%c(2,jut)+rmass(id3)*clineth%d(2,jut)
      cz1=s32*clineth%d(1,jut)+rmass(id3)*clineth%c(1,jut)
      cz2=s32*clineth%d(2,jut)+rmass(id3)*clineth%c(2,jut)
      clineth1(i1)%a(1,jut)=l3_2(i1)%a(1,1)*cx1+l3_2(i1)%c(1,2)*
     & cy2
      clineth1(i1)%b(1,jut)=l3_2(i1)%d(1,1)*cy1+l3_2(i1)%b(1,2)*
     & cx2
      clineth1(i1)%c(1,jut)=l3_2(i1)%a(1,1)*cw1+l3_2(i1)%c(1,2)*
     & cz2
      clineth1(i1)%d(1,jut)=l3_2(i1)%d(1,1)*cz1+l3_2(i1)%b(1,2)*
     & cw2
      clineth1(i1)%a(2,jut)=l3_2(i1)%c(2,1)*cy1+l3_2(i1)%a(2,2)*
     & cx2
      clineth1(i1)%b(2,jut)=l3_2(i1)%b(2,1)*cx1+l3_2(i1)%d(2,2)*
     & cy2
      clineth1(i1)%c(2,jut)=l3_2(i1)%c(2,1)*cz1+l3_2(i1)%a(2,2)*
     & cw2
      clineth1(i1)%d(2,jut)=l3_2(i1)%b(2,1)*cw1+l3_2(i1)%d(2,2)*
     & cz2
      end do
      end do
      do i1=1,2
* mline -- res=ch324(&1,i1,&2),abcd=clineth1(i1)%,m1=rmassl,m2=rmassr,de
* n=(s234-cmh2),nsum=0
      do iut=1,2
      do jut=1,2
      ch324(iut,i1,jut)=(clineth1(i1)%a(iut,jut)+rmassl*clineth1
     & (i1)%b(iut,jut)+rmassr*clineth1(i1)%c(iut,jut)+rmassl*rma
     & ssr*clineth1(i1)%d(iut,jut))/(s234-cmh2)
      enddo
      enddo
      end do
* TH -- qu=p3,qd=p24,a=clineth%a,b=clineth%b,c=clineth%c,coupl=rhbb
      auxa=-p3k0*p24(2)+p24k0*p3(2)
      cauxa=auxa-cim*(p24(3)*p3k0-p3(3)*p24k0)
      clineth%a(1,2)=rhbb*cauxa
      clineth%a(2,1)=-rhbb*conjg(cauxa)
      clineth%b(1,1)=rhbb*p24k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=rhbb*p3k0
      clineth%c(2,2)=clineth%c(1,1)
      do i1=1,2
* TsT -- aa=clineth1(i1)%a,bb=clineth1(i1)%b,cc=clineth1(i1)%c,dd=clinet
* h1(i1)%d,a1=clineth%a,b1=clineth%b,c1=clineth%c,d1=clineth%d,a2=r4_2(i
* 1)%a,b2=r4_2(i1)%b,c2=r4_2(i1)%c,d2=r4_2(i1)%d,prq=s24,m=rmass(id3),ns
* um=0
      do iut=1,2
      cx1=clineth%a(iut,1)+clineth%c(iut,1)*rmass(id3)
      cx2=clineth%c(iut,2)*s24+clineth%a(iut,2)*rmass(id3)
      cy1=clineth%b(iut,1)+clineth%d(iut,1)*rmass(id3)
      cy2=clineth%d(iut,2)*s24+clineth%b(iut,2)*rmass(id3)
      cw1=clineth%c(iut,1)*s24+clineth%a(iut,1)*rmass(id3)
      cw2=clineth%a(iut,2)+clineth%c(iut,2)*rmass(id3)
      cz1=clineth%d(iut,1)*s24+clineth%b(iut,1)*rmass(id3)
      cz2=clineth%b(iut,2)+clineth%d(iut,2)*rmass(id3)
      clineth1(i1)%a(iut,1)=cx1*r4_2(i1)%a(1,1)+cx2*r4_2(i1)%b(2
     & ,1)
      clineth1(i1)%b(iut,1)=cy1*r4_2(i1)%a(1,1)+cy2*r4_2(i1)%b(2
     & ,1)
      clineth1(i1)%c(iut,1)=cw1*r4_2(i1)%d(1,1)+cw2*r4_2(i1)%c(2
     & ,1)
      clineth1(i1)%d(iut,1)=cz1*r4_2(i1)%d(1,1)+cz2*r4_2(i1)%c(2
     & ,1)
      clineth1(i1)%a(iut,2)=cw1*r4_2(i1)%b(1,2)+cw2*r4_2(i1)%a(2
     & ,2)
      clineth1(i1)%b(iut,2)=cz1*r4_2(i1)%b(1,2)+cz2*r4_2(i1)%a(2
     & ,2)
      clineth1(i1)%c(iut,2)=cx1*r4_2(i1)%c(1,2)+cx2*r4_2(i1)%d(2
     & ,2)
      clineth1(i1)%d(iut,2)=cy1*r4_2(i1)%c(1,2)+cy2*r4_2(i1)%d(2
     & ,2)
      end do
      end do
      do i1=1,2
* mline -- res=ch324(&1,i1,&2),abcd=clineth1(i1)%,m1=rmassl,m2=rmassr,de
* n=(s234-cmh2),nsum=1
      do iut=1,2
      do jut=1,2
      ch324(iut,i1,jut)=ch324(iut,i1,jut)+(clineth1(i1)%a(iut,ju
     & t)+rmassl*clineth1(i1)%b(iut,jut)+rmassr*clineth1(i1)%c(i
     & ut,jut)+rmassl*rmassr*clineth1(i1)%d(iut,jut))/(s234-cmh2
     & )
      enddo
      enddo
      end do
  
      else
        do i3=1,2
          do i1=1,2
            do i4=1,2
              ch324(i3,i1,i4)=czero
            enddo
          enddo
        enddo
      endif
      endif   ! on (abs(id3).lt.7)
  
* compute all forks ( W's, Z's, gamma's, higgs's                        
*   "decaying" to two fermions) with two gluons                         
*                                                                       
  
*      W's                                                              
* quqd -- p=p1,q=p2
      quqd=p1(0)*p2(0)-p1(1)*p2(1)-p1(2)*p2(2)-p1(3)*p2(3)
      s12=2.d0*quqd
  
* quqd -- p=p51,q=p26
      quqd=p51(0)*p26(0)-p51(1)*p26(1)-p51(2)*p26(2)-p51(3)*p26(
     & 3)
      s1256=-2.d0*quqd+s51+s26
* quqd -- p=p5,q=p12
      quqd=p5(0)*p12(0)-p5(1)*p12(1)-p5(2)*p12(2)-p5(3)*p12(3)
      s512=2.d0*quqd+s12
* quqd -- p=p6,q=p12
      quqd=p6(0)*p12(0)-p6(1)*p12(1)-p6(2)*p12(2)-p6(3)*p12(3)
      s126=2.d0*quqd+s12
* quqd -- p=p71,q=p28
      quqd=p71(0)*p28(0)-p71(1)*p28(1)-p71(2)*p28(2)-p71(3)*p28(
     & 3)
      s1278=-2.d0*quqd+s71+s28
* quqd -- p=p7,q=p12
      quqd=p7(0)*p12(0)-p7(1)*p12(1)-p7(2)*p12(2)-p7(3)*p12(3)
      s712=2.d0*quqd+s12
* quqd -- p=p8,q=p12
      quqd=p8(0)*p12(0)-p8(1)*p12(1)-p8(2)*p12(2)-p8(3)*p12(3)
      s128=2.d0*quqd+s12
  
      if(abs(id5).lt.7)then
      cdw=-wcl/(s1256-cmw2)
  
*                                                                       
*                                                                       
*   1 ---|--- 2                    1 ---|--- 2                          
*        |                              |                               
*  5 ------------------- 6 + 5 --------------- 6                        
*              |                 |                                      
*              |  W              |  W                                   
*                                                                       
  
* triple vertex                                                         
* quqd -- p=p5,q=p512
      quqd=p5(0)*p512(0)-p5(1)*p512(1)-p5(2)*p512(2)-p5(3)*p512(
     & 3)
      ccl=gs*gs/(s512*p512k0*s12)
      do i1=1,2
      do i2=1,2
* TWL0 -- qu=p5,qd=p512,v=ctrip12(i1,i2)%e,a=l5_trip12(i1,i2)%a,c=l5_tri
* p12(i1,i2)%c,cl=ccl,nsum=0
      ceps_0=-ctrip12(i1,i2)%ek0*(p5(2)*p512(3)-p512(2)*p5(3))+p
     & 5k0*(ctrip12(i1,i2)%e(2)*p512(3)-p512(2)*ctrip12(i1,i2)%e
     & (3))-p512k0*(ctrip12(i1,i2)%e(2)*p5(3)-p5(2)*ctrip12(i1,i
     & 2)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-ctrip12(i1,i2)%e(3)*p5k0+p5(3)*ctrip12(i1,i2)%ek0
      ceps_1=ceps_1*cim
      cvqu=ctrip12(i1,i2)%e(0)*p5(0)-ctrip12(i1,i2)%e(1)*p5(1)-c
     & trip12(i1,i2)%e(2)*p5(2)-ctrip12(i1,i2)%e(3)*p5(3)
      cvqd=ctrip12(i1,i2)%e(0)*p512(0)-ctrip12(i1,i2)%e(1)*p512(
     & 1)-ctrip12(i1,i2)%e(2)*p512(2)-ctrip12(i1,i2)%e(3)*p512(3
     & )
      cauxa=-ctrip12(i1,i2)%ek0*quqd+p5k0*cvqd+p512k0*cvqu
      cauxc=+ctrip12(i1,i2)%ek0*p5(2)-p5k0*ctrip12(i1,i2)%e(2)
      l5_trip12(i1,i2)%a(2)=ccl*(cauxa-ceps_0)
      l5_trip12(i1,i2)%c(2)=ccl*(-cauxc+ceps_1)
      end do
      end do
  
* triple vertex                                                         
* quqd -- p=p126,q=p6
      quqd=p126(0)*p6(0)-p126(1)*p6(1)-p126(2)*p6(2)-p126(3)*p6(
     & 3)
      ccl=gs*gs/(s126*p126k0*s12)
      do i1=1,2
      do i2=1,2
* TWR0 -- qu=p126,qd=p6,v=ctrip12(i1,i2)%e,a=r6_trip12(i1,i2)%a,b=r6_tri
* p12(i1,i2)%b,cl=ccl,nsum=0
      ceps_0=-ctrip12(i1,i2)%ek0*(p126(2)*p6(3)-p6(2)*p126(3))+p
     & 126k0*(ctrip12(i1,i2)%e(2)*p6(3)-p6(2)*ctrip12(i1,i2)%e(3
     & ))-p6k0*(ctrip12(i1,i2)%e(2)*p126(3)-p126(2)*ctrip12(i1,i
     & 2)%e(3))
      ceps_0=ceps_0*cim
      ceps_2=-ctrip12(i1,i2)%e(3)*p6k0+p6(3)*ctrip12(i1,i2)%ek0
      ceps_2=ceps_2*cim
      cvqu=ctrip12(i1,i2)%e(0)*p126(0)-ctrip12(i1,i2)%e(1)*p126(
     & 1)-ctrip12(i1,i2)%e(2)*p126(2)-ctrip12(i1,i2)%e(3)*p126(3
     & )
      cvqd=ctrip12(i1,i2)%e(0)*p6(0)-ctrip12(i1,i2)%e(1)*p6(1)-c
     & trip12(i1,i2)%e(2)*p6(2)-ctrip12(i1,i2)%e(3)*p6(3)
      cauxa=-ctrip12(i1,i2)%ek0*quqd+p126k0*cvqd+p6k0*cvqu
      cauxb=-ctrip12(i1,i2)%ek0*p6(2)+p6k0*ctrip12(i1,i2)%e(2)
      r6_trip12(i1,i2)%a(2)=ccl*(cauxa-ceps_0)
      r6_trip12(i1,i2)%b(1)=ccl*(cauxb-ceps_2)
      end do
      end do
  
* quqd -- p=p512,q=p6
      quqd=p512(0)*p6(0)-p512(1)*p6(1)-p512(2)*p6(2)-p512(3)*p6(
     & 3)
* TWR0 -- qu=p512,qd=p6,v=0,a=rwlinet_mu(0)%a,b=rwlinet_mu(0)%b,cl=cdw,n
* sum=0
      eps_0=-p512(2)*p6(3)+p6(2)*p512(3)
      ceps_0=eps_0*cim
      ceps_2=p6(3)*cim
      auxa=-quqd+p512k0*p6(0)+p6k0*p512(0)
      rwlinet_mu(0)%a(2)=cdw*(auxa-ceps_0)
      rwlinet_mu(0)%b(1)=-cdw*(p6(2)+ceps_2)
* TWR0 -- qu=p512,qd=p6,v=1,a=rwlinet_mu(1)%a,b=rwlinet_mu(1)%b,cl=cdw,n
* sum=0
      auxa=-quqd+p512k0*p6(1)+p6k0*p512(1)
      rwlinet_mu(1)%a(2)=cdw*(auxa-ceps_0)
      rwlinet_mu(1)%b(1)=-cdw*(p6(2)+ceps_2)
* TWR0 -- qu=p512,qd=p6,v=2,a=rwlinet_mu(2)%a,b=rwlinet_mu(2)%b,cl=cdw,n
* sum=0
      eps_0=-p512k0*p6(3)+p6k0*p512(3)
      ceps_0=eps_0*cim
      auxa=p512k0*p6(2)+p6k0*p512(2)
      rwlinet_mu(2)%a(2)=cdw*(auxa-ceps_0)
      rwlinet_mu(2)%b(1)=-cdw*p6k0
* TWR0 -- qu=p512,qd=p6,v=3,a=rwlinet_mu(3)%a,b=rwlinet_mu(3)%b,cl=cdw,n
* sum=0
      eps_0=p512k0*p6(2)-p6k0*p512(2)
