     & )*p126(2)-ce1(i1)%e(3)*p126(3)
      cvqd=ce1(i1)%e(0)*p26(0)-ce1(i1)%e(1)*p26(1)-ce1(i1)%e(2)*
     & p26(2)-ce1(i1)%e(3)*p26(3)
      cauxa=-ce1(i1)%ek0*quqd+p126k0*cvqd+p26k0*cvqu
      cauxb=-ce1(i1)%ek0*p26(2)+p26k0*ce1(i1)%e(2)
      cauxc=+ce1(i1)%ek0*p126(2)-p126k0*ce1(i1)%e(2)
