* TTR0_W -- aa=r6_12(i1,i2)%a,bb=r6_12(i1,i2)%b,a1=wlinet(i1)%a,b1=wline
* t(i1)%b,c1=wlinet(i1)%c,d1=wlinet(i1)%d,a2=r6_2(i2)%a,b2=r6_2(i2)%b,pr
* q=s26,nsum=0
      r6_12(i1,i2)%b(1)=wlinet(i1)%d(1)*s26*r6_2(i2)%b(1)+wlinet
     & (i1)%b(1)*r6_2(i2)%a(2)
      r6_12(i1,i2)%a(2)=wlinet(i1)%c(2)*s26*r6_2(i2)%b(1)+wlinet
     & (i1)%a(2)*r6_2(i2)%a(2)
