     & (ce1(i1)%e(2)*p512(3)-p512(2)*ce1(i1)%e(3))-p512k0*(ce1(i
     & 1)%e(2)*p52(3)-p52(2)*ce1(i1)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-ce1(i1)%e(3)*p52k0+p52(3)*ce1(i1)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-ce1(i1)%e(3)*p512k0+p512(3)*ce1(i1)%ek0
      ceps_2=ceps_2*cim
      cvqu=ce1(i1)%e(0)*p52(0)-ce1(i1)%e(1)*p52(1)-ce1(i1)%e(2)*
     & p52(2)-ce1(i1)%e(3)*p52(3)
      cvqd=ce1(i1)%e(0)*p512(0)-ce1(i1)%e(1)*p512(1)-ce1(i1)%e(2
     & )*p512(2)-ce1(i1)%e(3)*p512(3)
      cauxa=-ce1(i1)%ek0*quqd+p52k0*cvqd+p512k0*cvqu
      cauxb=-ce1(i1)%ek0*p512(2)+p512k0*ce1(i1)%e(2)
      cauxc=+ce1(i1)%ek0*p52(2)-p52k0*ce1(i1)%e(2)
      wlinet(i1)%a(2)=ccl*(cauxa-ceps_0)
      wlinet(i1)%b(1)=ccl*(cauxb-ceps_2)
      wlinet(i1)%c(2)=ccl*(-cauxc+ceps_1)
      wlinet(i1)%d(1)=ccl*ce1(i1)%ek0
      end do
      do i1=1,2
      do i2=1,2
* TLT0_W -- aa=l5_21(i1,i2)%a,cc=l5_21(i1,i2)%c,a1=l5_2(i1)%a,c1=l5_2(i1
* )%c,a2=wlinet(i2)%a,b2=wlinet(i2)%b,c2=wlinet(i2)%c,d2=wlinet(i2)%d,pr
* q=s52,nsum=0
      l5_21(i1,i2)%c(2)=l5_2(i1)%c(2)*s52*wlinet(i2)%d(1)+l5_2(i
     & 1)%a(2)*wlinet(i2)%c(2)
      l5_21(i1,i2)%a(2)=l5_2(i1)%c(2)*s52*wlinet(i2)%b(1)+l5_2(i
     & 1)%a(2)*wlinet(i2)%a(2)
