* TW0 -- qu=p126,qd=p16,v=ce2(i1)%e,a=wlinet(i1)%a,b=wlinet(i1)%b,c=wlin
* et(i1)%c,d=wlinet(i1)%d,cl=ccl,nsum=0
      ceps_0=-ce2(i1)%ek0*(p126(2)*p16(3)-p16(2)*p126(3))+p126k0
