     & %e(2)*p126(3)-p126(2)*ce2(i1)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-ce2(i1)%e(3)*p126k0+p126(3)*ce2(i1)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-ce2(i1)%e(3)*p16k0+p16(3)*ce2(i1)%ek0
      ceps_2=ceps_2*cim
      cvqu=ce2(i1)%e(0)*p126(0)-ce2(i1)%e(1)*p126(1)-ce2(i1)%e(2
     & )*p126(2)-ce2(i1)%e(3)*p126(3)
      cvqd=ce2(i1)%e(0)*p16(0)-ce2(i1)%e(1)*p16(1)-ce2(i1)%e(2)*
     & p16(2)-ce2(i1)%e(3)*p16(3)
      cauxa=-ce2(i1)%ek0*quqd+p126k0*cvqd+p16k0*cvqu
      cauxb=-ce2(i1)%ek0*p16(2)+p16k0*ce2(i1)%e(2)
      cauxc=+ce2(i1)%ek0*p126(2)-p126k0*ce2(i1)%e(2)
      wlinet(i1)%a(2)=ccl*(cauxa-ceps_0)
      wlinet(i1)%b(1)=ccl*(cauxb-ceps_2)
      wlinet(i1)%c(2)=ccl*(-cauxc+ceps_1)
      wlinet(i1)%d(1)=ccl*ce2(i1)%ek0
