* t(i1)%b,c1=wlinet(i1)%c,d1=wlinet(i1)%d,a2=r6_1(i2)%a,b2=r6_1(i2)%b,pr
* q=s16,nsum=0
      r6_21(i1,i2)%b(1)=wlinet(i1)%d(1)*s16*r6_1(i2)%b(1)+wlinet
     & (i1)%b(1)*r6_1(i2)%a(2)
      r6_21(i1,i2)%a(2)=wlinet(i1)%c(2)*s16*r6_1(i2)%b(1)+wlinet
     & (i1)%a(2)*r6_1(i2)%a(2)
      end do
