* Add/Subtract triple vertex contribution                               
      do i1=1,2
      do i2=1,2
        l5_12(i1,i2)%a(2)=l5_12(i1,i2)%a(2)
     &                   +l5_trip12(i1,i2)%a(2)
        l5_12(i1,i2)%c(2)=l5_12(i1,i2)%c(2)
     &                   +l5_trip12(i1,i2)%c(2)
        r6_12(i1,i2)%a(2)=r6_12(i1,i2)%a(2)
     &                   +r6_trip12(i1,i2)%a(2)
        r6_12(i1,i2)%b(1)=r6_12(i1,i2)%b(1)
     &                   +r6_trip12(i1,i2)%b(1)
