      enddo
  
      do i1=1,2
      do i2=1,2
        l5_21(i1,i2)%a(2)=l5_21(i1,i2)%a(2)
     &                   -l5_trip12(i2,i1)%a(2)
        l5_21(i1,i2)%c(2)=l5_21(i1,i2)%c(2)
     &                   -l5_trip12(i2,i1)%c(2)
        r6_21(i1,i2)%a(2)=r6_21(i1,i2)%a(2)
     &                   -r6_trip12(i2,i1)%a(2)
        r6_21(i1,i2)%b(1)=r6_21(i1,i2)%b(1)
     &                   -r6_trip12(i2,i1)%b(1)
      enddo
      enddo
  
  
      do i1=1,2
      do i2=1,2
      do mu=0,3
* TLTR0_W -- aa=cw5126(i1,i2)%e(mu),a1=l5_12(i1,i2)%a,c1=l5_12(i1,i2)%c,
* a2=rwlinet_mu(mu)%a,b2=rwlinet_mu(mu)%b,prq=s512,bef=,aft=
      cw5126(i1,i2)%e(mu)=(l5_12(i1,i2)%c(2)*s512*rwlinet_mu(mu)
     & %b(1)+l5_12(i1,i2)%a(2)*rwlinet_mu(mu)%a(2))
