* (1)%c,d=wlinet_mu(1)%d,cl=cdw,nsum=0
      auxa=-quqd+p51k0*p26(1)+p26k0*p51(1)
      wlinet_mu(1)%a(2)=cdw*(auxa-ceps_0)
      wlinet_mu(1)%b(1)=-cdw*(p26(2)+ceps_2)
      wlinet_mu(1)%c(2)=cdw*(-p51(2)+ceps_1)
