      do i2=1,2
* TTR0_W -- aa=r8_12(i1,i2)%a,bb=r8_12(i1,i2)%b,a1=wlinet(i1)%a,b1=wline
* t(i1)%b,c1=wlinet(i1)%c,d1=wlinet(i1)%d,a2=r8_2(i2)%a,b2=r8_2(i2)%b,pr
* q=s28,nsum=0
      r8_12(i1,i2)%b(1)=wlinet(i1)%d(1)*s28*r8_2(i2)%b(1)+wlinet
     & (i1)%b(1)*r8_2(i2)%a(2)
      r8_12(i1,i2)%a(2)=wlinet(i1)%c(2)*s28*r8_2(i2)%b(1)+wlinet
     & (i1)%a(2)*r8_2(i2)%a(2)
      end do
      end do
*                                                                       
*                                                                       
*       | 2     | 1                                                     
*       |       |                                                       
*  7 ----------------------                                             
*                       |                                               
*                       |  W                                            
