* quqd -- p=p72,q=p712
      quqd=p72(0)*p712(0)-p72(1)*p712(1)-p72(2)*p712(2)-p72(3)*p
     & 712(3)
      ccl=gs/(s712*p712k0)
      do i1=1,2
* TW0 -- qu=p72,qd=p712,v=ce1(i1)%e,a=wlinet(i1)%a,b=wlinet(i1)%b,c=wlin
* et(i1)%c,d=wlinet(i1)%d,cl=ccl,nsum=0
      ceps_0=-ce1(i1)%ek0*(p72(2)*p712(3)-p712(2)*p72(3))+p72k0*
     & (ce1(i1)%e(2)*p712(3)-p712(2)*ce1(i1)%e(3))-p712k0*(ce1(i
     & 1)%e(2)*p72(3)-p72(2)*ce1(i1)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-ce1(i1)%e(3)*p72k0+p72(3)*ce1(i1)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-ce1(i1)%e(3)*p712k0+p712(3)*ce1(i1)%ek0
      ceps_2=ceps_2*cim
      cvqu=ce1(i1)%e(0)*p72(0)-ce1(i1)%e(1)*p72(1)-ce1(i1)%e(2)*
     & p72(2)-ce1(i1)%e(3)*p72(3)
      cvqd=ce1(i1)%e(0)*p712(0)-ce1(i1)%e(1)*p712(1)-ce1(i1)%e(2
     & )*p712(2)-ce1(i1)%e(3)*p712(3)
      cauxa=-ce1(i1)%ek0*quqd+p72k0*cvqd+p712k0*cvqu
      cauxb=-ce1(i1)%ek0*p712(2)+p712k0*ce1(i1)%e(2)
      cauxc=+ce1(i1)%ek0*p72(2)-p72k0*ce1(i1)%e(2)
      wlinet(i1)%a(2)=ccl*(cauxa-ceps_0)
      wlinet(i1)%b(1)=ccl*(cauxb-ceps_2)
      wlinet(i1)%c(2)=ccl*(-cauxc+ceps_1)
      wlinet(i1)%d(1)=ccl*ce1(i1)%ek0
      end do
      do i1=1,2
      do i2=1,2
* TLT0_W -- aa=l7_21(i1,i2)%a,cc=l7_21(i1,i2)%c,a1=l7_2(i1)%a,c1=l7_2(i1
* )%c,a2=wlinet(i2)%a,b2=wlinet(i2)%b,c2=wlinet(i2)%c,d2=wlinet(i2)%d,pr
* q=s72,nsum=0
      l7_21(i1,i2)%c(2)=l7_2(i1)%c(2)*s72*wlinet(i2)%d(1)+l7_2(i
     & 1)%a(2)*wlinet(i2)%c(2)
      l7_21(i1,i2)%a(2)=l7_2(i1)%c(2)*s72*wlinet(i2)%b(1)+l7_2(i
     & 1)%a(2)*wlinet(i2)%a(2)
      end do
      end do
  
*                                                                       
*                                                                       
*            | 2     | 1                                                
*            |       |                                                  
*    ---------------------- 8                                           
*        |                                                              
*        |  W                                                           
*                                                                       
  
* quqd -- p=p128,q=p18
      quqd=p128(0)*p18(0)-p128(1)*p18(1)-p128(2)*p18(2)-p128(3)*
     & p18(3)
      ccl=gs/(s128*p128k0)
      do i1=1,2
* TW0 -- qu=p128,qd=p18,v=ce2(i1)%e,a=wlinet(i1)%a,b=wlinet(i1)%b,c=wlin
* et(i1)%c,d=wlinet(i1)%d,cl=ccl,nsum=0
      ceps_0=-ce2(i1)%ek0*(p128(2)*p18(3)-p18(2)*p128(3))+p128k0
     & *(ce2(i1)%e(2)*p18(3)-p18(2)*ce2(i1)%e(3))-p18k0*(ce2(i1)
     & %e(2)*p128(3)-p128(2)*ce2(i1)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-ce2(i1)%e(3)*p128k0+p128(3)*ce2(i1)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-ce2(i1)%e(3)*p18k0+p18(3)*ce2(i1)%ek0
      ceps_2=ceps_2*cim
      cvqu=ce2(i1)%e(0)*p128(0)-ce2(i1)%e(1)*p128(1)-ce2(i1)%e(2
     & )*p128(2)-ce2(i1)%e(3)*p128(3)
      cvqd=ce2(i1)%e(0)*p18(0)-ce2(i1)%e(1)*p18(1)-ce2(i1)%e(2)*
     & p18(2)-ce2(i1)%e(3)*p18(3)
      cauxa=-ce2(i1)%ek0*quqd+p128k0*cvqd+p18k0*cvqu
      cauxb=-ce2(i1)%ek0*p18(2)+p18k0*ce2(i1)%e(2)
      cauxc=+ce2(i1)%ek0*p128(2)-p128k0*ce2(i1)%e(2)
      wlinet(i1)%a(2)=ccl*(cauxa-ceps_0)
      wlinet(i1)%b(1)=ccl*(cauxb-ceps_2)
      wlinet(i1)%c(2)=ccl*(-cauxc+ceps_1)
      wlinet(i1)%d(1)=ccl*ce2(i1)%ek0
      end do
      do i1=1,2
      do i2=1,2
* TTR0_W -- aa=r8_21(i1,i2)%a,bb=r8_21(i1,i2)%b,a1=wlinet(i1)%a,b1=wline
* t(i1)%b,c1=wlinet(i1)%c,d1=wlinet(i1)%d,a2=r8_1(i2)%a,b2=r8_1(i2)%b,pr
* q=s18,nsum=0
      r8_21(i1,i2)%b(1)=wlinet(i1)%d(1)*s18*r8_1(i2)%b(1)+wlinet
     & (i1)%b(1)*r8_1(i2)%a(2)
      r8_21(i1,i2)%a(2)=wlinet(i1)%c(2)*s18*r8_1(i2)%b(1)+wlinet
     & (i1)%a(2)*r8_1(i2)%a(2)
      end do
      end do
  
* Add/Subtract triple vertex contribution                               
      do i1=1,2
      do i2=1,2
        l7_12(i1,i2)%a(2)=l7_12(i1,i2)%a(2)
     &                   +l7_trip12(i1,i2)%a(2)
        l7_12(i1,i2)%c(2)=l7_12(i1,i2)%c(2)
     &                   +l7_trip12(i1,i2)%c(2)
        r8_12(i1,i2)%a(2)=r8_12(i1,i2)%a(2)
     &                   +r8_trip12(i1,i2)%a(2)
        r8_12(i1,i2)%b(1)=r8_12(i1,i2)%b(1)
     &                   +r8_trip12(i1,i2)%b(1)
      enddo
      enddo
  
      do i1=1,2
      do i2=1,2
        l7_21(i1,i2)%a(2)=l7_21(i1,i2)%a(2)
     &                   -l7_trip12(i2,i1)%a(2)
        l7_21(i1,i2)%c(2)=l7_21(i1,i2)%c(2)
     &                   -l7_trip12(i2,i1)%c(2)
        r8_21(i1,i2)%a(2)=r8_21(i1,i2)%a(2)
     &                   -r8_trip12(i2,i1)%a(2)
        r8_21(i1,i2)%b(1)=r8_21(i1,i2)%b(1)
     &                   -r8_trip12(i2,i1)%b(1)
      enddo
      enddo
  
  
      do i1=1,2
      do i2=1,2
      do mu=0,3
* TLTR0_W -- aa=cw7128(i1,i2)%e(mu),a1=l7_12(i1,i2)%a,c1=l7_12(i1,i2)%c,
* a2=rwlinet_mu(mu)%a,b2=rwlinet_mu(mu)%b,prq=s712,bef=,aft=
      cw7128(i1,i2)%e(mu)=(l7_12(i1,i2)%c(2)*s712*rwlinet_mu(mu)
     & %b(1)+l7_12(i1,i2)%a(2)*rwlinet_mu(mu)%a(2))
      end do
      end do
      end do
      do i1=1,2
      do i2=1,2
      do mu=0,3
* TLTR0_W -- aa=cw7128(i1,i2)%e(mu),a1=lwlinet_mu(mu)%a,c1=lwlinet_mu(mu
* )%c,a2=r8_12(i1,i2)%a,b2=r8_12(i1,i2)%b,prq=s128,bef=cw7128(i1,i2)%e(m
* u)+,aft=
      cw7128(i1,i2)%e(mu)=cw7128(i1,i2)%e(mu)+(lwlinet_mu(mu)%c(
     & 2)*s128*r8_12(i1,i2)%b(1)+lwlinet_mu(mu)%a(2)*r8_12(i1,i2
     & )%a(2))
      end do
      end do
      end do
  
*                                                                       
*                                                                       
*        | 1         | 2                                                
*        |           |                                                  
*  7 ---------------------- 8                                           
*              |                                                        
*              |  W                                                     
*                                                                       
  
* quqd -- p=p71,q=p28
      quqd=p71(0)*p28(0)-p71(1)*p28(1)-p71(2)*p28(2)-p71(3)*p28(
     & 3)
* TW0 -- qu=p71,qd=p28,v=0,a=wlinet_mu(0)%a,b=wlinet_mu(0)%b,c=wlinet_mu
* (0)%c,d=wlinet_mu(0)%d,cl=cdw,nsum=0
      eps_0=-p71(2)*p28(3)+p28(2)*p71(3)
      ceps_0=eps_0*cim
      ceps_1=p71(3)*cim
      ceps_2=p28(3)*cim
      auxa=-quqd+p71k0*p28(0)+p28k0*p71(0)
      wlinet_mu(0)%a(2)=cdw*(auxa-ceps_0)
      wlinet_mu(0)%b(1)=-cdw*(p28(2)+ceps_2)
      wlinet_mu(0)%c(2)=cdw*(-p71(2)+ceps_1)
      wlinet_mu(0)%d(1)=cdw
* TW0 -- qu=p71,qd=p28,v=1,a=wlinet_mu(1)%a,b=wlinet_mu(1)%b,c=wlinet_mu
* (1)%c,d=wlinet_mu(1)%d,cl=cdw,nsum=0
      auxa=-quqd+p71k0*p28(1)+p28k0*p71(1)
      wlinet_mu(1)%a(2)=cdw*(auxa-ceps_0)
      wlinet_mu(1)%b(1)=-cdw*(p28(2)+ceps_2)
      wlinet_mu(1)%c(2)=cdw*(-p71(2)+ceps_1)
      wlinet_mu(1)%d(1)=cdw
* TW0 -- qu=p71,qd=p28,v=2,a=wlinet_mu(2)%a,b=wlinet_mu(2)%b,c=wlinet_mu
* (2)%c,d=wlinet_mu(2)%d,cl=cdw,nsum=0
      eps_0=-p71k0*p28(3)+p28k0*p71(3)
      ceps_0=eps_0*cim
      auxa=p71k0*p28(2)+p28k0*p71(2)
      wlinet_mu(2)%a(2)=cdw*(auxa-ceps_0)
      wlinet_mu(2)%b(1)=-cdw*p28k0
      wlinet_mu(2)%c(2)=-cdw*p71k0
* TW0 -- qu=p71,qd=p28,v=3,a=wlinet_mu(3)%a,b=wlinet_mu(3)%b,c=wlinet_mu
* (3)%c,d=wlinet_mu(3)%d,cl=cdw,nsum=0
      eps_0=p71k0*p28(2)-p28k0*p71(2)
      ceps_0=eps_0*cim
      ceps_1=p71k0*cim
      ceps_2=p28k0*cim
      auxa=+p71k0*p28(3)+p28k0*p71(3)
      wlinet_mu(3)%a(2)=cdw*(auxa-ceps_0)
      wlinet_mu(3)%b(1)=-cdw*ceps_2
      wlinet_mu(3)%c(2)=cdw*ceps_1
      do i2=1,2
      do mu=0,3
* TTR0_W -- aa=wlinet1(i2,mu)%a,bb=wlinet1(i2,mu)%b,a1=wlinet_mu(mu)%a,b
* 1=wlinet_mu(mu)%b,c1=wlinet_mu(mu)%c,d1=wlinet_mu(mu)%d,a2=r8_2(i2)%a,
* b2=r8_2(i2)%b,prq=s28,nsum=0
      wlinet1(i2,mu)%b(1)=wlinet_mu(mu)%d(1)*s28*r8_2(i2)%b(1)+w
     & linet_mu(mu)%b(1)*r8_2(i2)%a(2)
      wlinet1(i2,mu)%a(2)=wlinet_mu(mu)%c(2)*s28*r8_2(i2)%b(1)+w
     & linet_mu(mu)%a(2)*r8_2(i2)%a(2)
      end do
      end do
      do i1=1,2
      do i2=1,2
      do mu=0,3
* TLTR0_W -- aa=cw7128(i1,i2)%e(mu),a1=l7_1(i1)%a,c1=l7_1(i1)%c,a2=wline
* t1(i2,mu)%a,b2=wlinet1(i2,mu)%b,prq=s71,bef=cw7128(i1,i2)%e(mu)+,aft=
      cw7128(i1,i2)%e(mu)=cw7128(i1,i2)%e(mu)+(l7_1(i1)%c(2)*s71
     & *wlinet1(i2,mu)%b(1)+l7_1(i1)%a(2)*wlinet1(i2,mu)%a(2))
      end do
      end do
      end do
      do i1=1,2
      do i2=1,2
* pk0 -- p=cw7128(i1,i2)%e
      cw7128(i1,i2)%ek0=cw7128(i1,i2)%e(0)-cw7128(i1,i2)%e(1)
      end do
      end do
      do i1=1,2
      do i2=1,2
      do mu=0,3
* TLTR0_W -- aa=cw7218(i1,i2)%e(mu),a1=l7_21(i1,i2)%a,c1=l7_21(i1,i2)%c,
* a2=rwlinet_mu(mu)%a,b2=rwlinet_mu(mu)%b,prq=s712,bef=,aft=
      cw7218(i1,i2)%e(mu)=(l7_21(i1,i2)%c(2)*s712*rwlinet_mu(mu)
     & %b(1)+l7_21(i1,i2)%a(2)*rwlinet_mu(mu)%a(2))
      end do
      end do
      end do
      do i1=1,2
      do i2=1,2
      do mu=0,3
* TLTR0_W -- aa=cw7218(i1,i2)%e(mu),a1=lwlinet_mu(mu)%a,c1=lwlinet_mu(mu
* )%c,a2=r8_21(i1,i2)%a,b2=r8_21(i1,i2)%b,prq=s128,bef=cw7218(i1,i2)%e(m
* u)+,aft=
      cw7218(i1,i2)%e(mu)=cw7218(i1,i2)%e(mu)+(lwlinet_mu(mu)%c(
     & 2)*s128*r8_21(i1,i2)%b(1)+lwlinet_mu(mu)%a(2)*r8_21(i1,i2
     & )%a(2))
      end do
      end do
      end do
  
