* quqd -- p=p72,q=p18
      quqd=p72(0)*p18(0)-p72(1)*p18(1)-p72(2)*p18(2)-p72(3)*p18(
     & 3)
* TW0 -- qu=p72,qd=p18,v=0,a=wlinet_mu(0)%a,b=wlinet_mu(0)%b,c=wlinet_mu
* (0)%c,d=wlinet_mu(0)%d,cl=cdw,nsum=0
      eps_0=-p72(2)*p18(3)+p18(2)*p72(3)
      ceps_0=eps_0*cim
      ceps_1=p72(3)*cim
      ceps_2=p18(3)*cim
      auxa=-quqd+p72k0*p18(0)+p18k0*p72(0)
      wlinet_mu(0)%a(2)=cdw*(auxa-ceps_0)
      wlinet_mu(0)%b(1)=-cdw*(p18(2)+ceps_2)
      wlinet_mu(0)%c(2)=cdw*(-p72(2)+ceps_1)
      wlinet_mu(0)%d(1)=cdw
* TW0 -- qu=p72,qd=p18,v=1,a=wlinet_mu(1)%a,b=wlinet_mu(1)%b,c=wlinet_mu
* (1)%c,d=wlinet_mu(1)%d,cl=cdw,nsum=0
      auxa=-quqd+p72k0*p18(1)+p18k0*p72(1)
      wlinet_mu(1)%a(2)=cdw*(auxa-ceps_0)
      wlinet_mu(1)%b(1)=-cdw*(p18(2)+ceps_2)
      wlinet_mu(1)%c(2)=cdw*(-p72(2)+ceps_1)
      wlinet_mu(1)%d(1)=cdw
* TW0 -- qu=p72,qd=p18,v=2,a=wlinet_mu(2)%a,b=wlinet_mu(2)%b,c=wlinet_mu
* (2)%c,d=wlinet_mu(2)%d,cl=cdw,nsum=0
      eps_0=-p72k0*p18(3)+p18k0*p72(3)
      ceps_0=eps_0*cim
      auxa=p72k0*p18(2)+p18k0*p72(2)
      wlinet_mu(2)%a(2)=cdw*(auxa-ceps_0)
      wlinet_mu(2)%b(1)=-cdw*p18k0
      wlinet_mu(2)%c(2)=-cdw*p72k0
* TW0 -- qu=p72,qd=p18,v=3,a=wlinet_mu(3)%a,b=wlinet_mu(3)%b,c=wlinet_mu
* (3)%c,d=wlinet_mu(3)%d,cl=cdw,nsum=0
      eps_0=p72k0*p18(2)-p18k0*p72(2)
      ceps_0=eps_0*cim
      ceps_1=p72k0*cim
      ceps_2=p18k0*cim
      auxa=+p72k0*p18(3)+p18k0*p72(3)
      wlinet_mu(3)%a(2)=cdw*(auxa-ceps_0)
      wlinet_mu(3)%b(1)=-cdw*ceps_2
      wlinet_mu(3)%c(2)=cdw*ceps_1
      do i2=1,2
      do mu=0,3
* TTR0_W -- aa=wlinet1(i2,mu)%a,bb=wlinet1(i2,mu)%b,a1=wlinet_mu(mu)%a,b
* 1=wlinet_mu(mu)%b,c1=wlinet_mu(mu)%c,d1=wlinet_mu(mu)%d,a2=r8_1(i2)%a,
* b2=r8_1(i2)%b,prq=s18,nsum=0
      wlinet1(i2,mu)%b(1)=wlinet_mu(mu)%d(1)*s18*r8_1(i2)%b(1)+w
     & linet_mu(mu)%b(1)*r8_1(i2)%a(2)
      wlinet1(i2,mu)%a(2)=wlinet_mu(mu)%c(2)*s18*r8_1(i2)%b(1)+w
     & linet_mu(mu)%a(2)*r8_1(i2)%a(2)
      end do
      end do
      do i1=1,2
      do i2=1,2
      do mu=0,3
* TLTR0_W -- aa=cw7218(i1,i2)%e(mu),a1=l7_2(i1)%a,c1=l7_2(i1)%c,a2=wline
* t1(i2,mu)%a,b2=wlinet1(i2,mu)%b,prq=s72,bef=cw7218(i1,i2)%e(mu)+,aft=
      cw7218(i1,i2)%e(mu)=cw7218(i1,i2)%e(mu)+(l7_2(i1)%c(2)*s72
     & *wlinet1(i2,mu)%b(1)+l7_2(i1)%a(2)*wlinet1(i2,mu)%a(2))
      end do
      end do
      end do
      do i1=1,2
      do i2=1,2
* pk0 -- p=cw7218(i1,i2)%e
      cw7218(i1,i2)%ek0=cw7218(i1,i2)%e(0)-cw7218(i1,i2)%e(1)
      end do
      end do
      endif  ! on (id7.lt.7)
  
*      Z's and gammas  and higgs                                        
*                                                                       
*                                                                       
*   1 ---|--- 2                    1 ---|--- 2                          
*        |                              |                               
*  3 ------------------- 4 + 3 --------------- 4                        
*              |                |                                       
*              |  Z,f,h         |  Z,f,h                                
*                                                                       
  
* quqd -- p=p3,q=p12
      quqd=p3(0)*p12(0)-p3(1)*p12(1)-p3(2)*p12(2)-p3(3)*p12(3)
      s312=2.d0*quqd+s12+rmass2(id3)
* quqd -- p=p4,q=p12
