     & l3_2(i1)%a(2,2)*clinet(i2)%c(2,1)
      l3_21(i1,i2)%d(2,1)=rmass(id3)*(l3_2(i1)%b(2,1)*clinet(i2)
     & %d(1,1)+l3_2(i1)%d(2,2)*clinet(i2)%c(2,1))
      l3_21(i1,i2)%a(2,2)=l3_2(i1)%c(2,1)*s32*clinet(i2)%b(1,2)+
     & l3_2(i1)%a(2,2)*clinet(i2)%a(2,2)
      l3_21(i1,i2)%b(2,2)=rmass(id3)*(l3_2(i1)%b(2,1)*clinet(i2)
     & %b(1,2)+l3_2(i1)%d(2,2)*clinet(i2)%a(2,2))
      l3_21(i1,i2)%c(2,2)=rmass(id3)*(l3_2(i1)%c(2,1)*clinet(i2)
     & %c(1,2)+l3_2(i1)%a(2,2)*clinet(i2)%d(2,2))
      l3_21(i1,i2)%d(2,2)=l3_2(i1)%b(2,1)*clinet(i2)%c(1,2)+l3_2
     & (i1)%d(2,2)*s32*clinet(i2)%d(2,2)
      end do
      end do
  
*                                                                       
*                                                                       
*            | 2     | 1                                                
*            |       |                                                  
*    ---------------------- 4                                           
*        |                                                              
*        |  Z,f                                                         
*                                                                       
  
* t for 2 insertion                                                     
*                                                                       
* quqd -- p=p124,q=p14
      quqd=p124(0)*p14(0)-p124(1)*p14(1)-p124(2)*p14(2)-p124(3)*
     & p14(3)
      ccr=gs/((s124-rmass2(id4))*p124k0)
      ccl=gs/((s124-rmass2(id4))*p124k0)
      do i1=1,2
* T -- qu=p124,qd=p14,v=ce2(i1)%e,a=clinet(i1)%a,b=clinet(i1)%b,c=clinet
* (i1)%c,d=clinet(i1)%d,cr=ccr,cl=ccl,nsum=0
      ceps_0=-ce2(i1)%ek0*(p124(2)*p14(3)-p14(2)*p124(3))+p124k0
     & *(ce2(i1)%e(2)*p14(3)-p14(2)*ce2(i1)%e(3))-p14k0*(ce2(i1)
     & %e(2)*p124(3)-p124(2)*ce2(i1)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-ce2(i1)%e(3)*p124k0+p124(3)*ce2(i1)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-ce2(i1)%e(3)*p14k0+p14(3)*ce2(i1)%ek0
      ceps_2=ceps_2*cim
      cvqu=ce2(i1)%e(0)*p124(0)-ce2(i1)%e(1)*p124(1)-ce2(i1)%e(2
     & )*p124(2)-ce2(i1)%e(3)*p124(3)
      cvqd=ce2(i1)%e(0)*p14(0)-ce2(i1)%e(1)*p14(1)-ce2(i1)%e(2)*
     & p14(2)-ce2(i1)%e(3)*p14(3)
      cauxa=-ce2(i1)%ek0*quqd+p124k0*cvqd+p14k0*cvqu
      cauxb=-ce2(i1)%ek0*p14(2)+p14k0*ce2(i1)%e(2)
      cauxc=+ce2(i1)%ek0*p124(2)-p124k0*ce2(i1)%e(2)
      clinet(i1)%a(1,1)=ccr*(cauxa+ceps_0)
      clinet(i1)%a(2,2)=ccl*(cauxa-ceps_0)
      clinet(i1)%b(1,2)=ccl*(cauxb-ceps_2)
      clinet(i1)%b(2,1)=ccr*(-cauxb-ceps_2)
      clinet(i1)%c(1,2)=ccr*(cauxc+ceps_1)
      clinet(i1)%c(2,1)=ccl*(-cauxc+ceps_1)
      clinet(i1)%d(1,1)=ccl*ce2(i1)%ek0
      clinet(i1)%d(2,2)=ccr*ce2(i1)%ek0
      end do
  
      do i1=1,2
      do i2=1,2
* TT -- aa=r4_21(i1,i2)%a,bb=r4_21(i1,i2)%b,cc=r4_21(i1,i2)%c,dd=r4_21(i
* 1,i2)%d,a1=clinet(i1)%a,b1=clinet(i1)%b,c1=clinet(i1)%c,d1=clinet(i1)%
* d,a2=r4_1(i2)%a,b2=r4_1(i2)%b,c2=r4_1(i2)%c,d2=r4_1(i2)%d,prq=s14,m=rm
* ass(id4),nsum=0
      r4_21(i1,i2)%a(1,1)=clinet(i1)%a(1,1)*r4_1(i2)%a(1,1)+clin
     & et(i1)%c(1,2)*s14*r4_1(i2)%b(2,1)
      r4_21(i1,i2)%b(1,1)=rmass(id4)*(clinet(i1)%d(1,1)*r4_1(i2)
     & %a(1,1)+clinet(i1)%b(1,2)*r4_1(i2)%b(2,1))
      r4_21(i1,i2)%c(1,1)=rmass(id4)*(clinet(i1)%a(1,1)*r4_1(i2)
     & %d(1,1)+clinet(i1)%c(1,2)*r4_1(i2)%c(2,1))
      r4_21(i1,i2)%d(1,1)=clinet(i1)%d(1,1)*s14*r4_1(i2)%d(1,1)+
     & clinet(i1)%b(1,2)*r4_1(i2)%c(2,1)
      r4_21(i1,i2)%a(1,2)=rmass(id4)*(clinet(i1)%a(1,1)*r4_1(i2)
     & %b(1,2)+clinet(i1)%c(1,2)*r4_1(i2)%a(2,2))
      r4_21(i1,i2)%b(1,2)=clinet(i1)%d(1,1)*s14*r4_1(i2)%b(1,2)+
     & clinet(i1)%b(1,2)*r4_1(i2)%a(2,2)
      r4_21(i1,i2)%c(1,2)=clinet(i1)%a(1,1)*r4_1(i2)%c(1,2)+clin
     & et(i1)%c(1,2)*s14*r4_1(i2)%d(2,2)
      r4_21(i1,i2)%d(1,2)=rmass(id4)*(clinet(i1)%d(1,1)*r4_1(i2)
     & %c(1,2)+clinet(i1)%b(1,2)*r4_1(i2)%d(2,2))
      r4_21(i1,i2)%a(2,1)=rmass(id4)*(clinet(i1)%c(2,1)*r4_1(i2)
     & %a(1,1)+clinet(i1)%a(2,2)*r4_1(i2)%b(2,1))
      r4_21(i1,i2)%b(2,1)=clinet(i1)%b(2,1)*r4_1(i2)%a(1,1)+clin
     & et(i1)%d(2,2)*s14*r4_1(i2)%b(2,1)
      r4_21(i1,i2)%c(2,1)=clinet(i1)%c(2,1)*s14*r4_1(i2)%d(1,1)+
     & clinet(i1)%a(2,2)*r4_1(i2)%c(2,1)
      r4_21(i1,i2)%d(2,1)=rmass(id4)*(clinet(i1)%b(2,1)*r4_1(i2)
     & %d(1,1)+clinet(i1)%d(2,2)*r4_1(i2)%c(2,1))
      r4_21(i1,i2)%a(2,2)=clinet(i1)%c(2,1)*s14*r4_1(i2)%b(1,2)+
     & clinet(i1)%a(2,2)*r4_1(i2)%a(2,2)
      r4_21(i1,i2)%b(2,2)=rmass(id4)*(clinet(i1)%b(2,1)*r4_1(i2)
     & %b(1,2)+clinet(i1)%d(2,2)*r4_1(i2)%a(2,2))
      r4_21(i1,i2)%c(2,2)=rmass(id4)*(clinet(i1)%c(2,1)*r4_1(i2)
     & %c(1,2)+clinet(i1)%a(2,2)*r4_1(i2)%d(2,2))
      r4_21(i1,i2)%d(2,2)=clinet(i1)%b(2,1)*r4_1(i2)%c(1,2)+clin
     & et(i1)%d(2,2)*s14*r4_1(i2)%d(2,2)
      end do
      end do
  
* Add/Subtract triple vertex contribution                               
      do i1=1,2
      do i2=1,2
        do iut=1,2
        do jut=1,2
          l3_12(i1,i2)%a(iut,jut)=l3_12(i1,i2)%a(iut,jut)
     &                     +l3_trip12(i1,i2)%a(iut,jut)
          l3_12(i1,i2)%b(iut,jut)=l3_12(i1,i2)%b(iut,jut)
     &                     +l3_trip12(i1,i2)%b(iut,jut)
          l3_12(i1,i2)%c(iut,jut)=l3_12(i1,i2)%c(iut,jut)
     &                     +l3_trip12(i1,i2)%c(iut,jut)
          l3_12(i1,i2)%d(iut,jut)=l3_12(i1,i2)%d(iut,jut)
     &                     +l3_trip12(i1,i2)%d(iut,jut)
          r4_12(i1,i2)%a(iut,jut)=r4_12(i1,i2)%a(iut,jut)
     &                     +r4_trip12(i1,i2)%a(iut,jut)
          r4_12(i1,i2)%b(iut,jut)=r4_12(i1,i2)%b(iut,jut)
     &                     +r4_trip12(i1,i2)%b(iut,jut)
          r4_12(i1,i2)%c(iut,jut)=r4_12(i1,i2)%c(iut,jut)
     &                     +r4_trip12(i1,i2)%c(iut,jut)
          r4_12(i1,i2)%d(iut,jut)=r4_12(i1,i2)%d(iut,jut)
     &                     +r4_trip12(i1,i2)%d(iut,jut)
        enddo
        enddo
      enddo
      enddo
  
      do i1=1,2
      do i2=1,2
        do iut=1,2
        do jut=1,2
          l3_21(i1,i2)%a(iut,jut)=l3_21(i1,i2)%a(iut,jut)
     &                     -l3_trip12(i2,i1)%a(iut,jut)
          l3_21(i1,i2)%b(iut,jut)=l3_21(i1,i2)%b(iut,jut)
     &                     -l3_trip12(i2,i1)%b(iut,jut)
          l3_21(i1,i2)%c(iut,jut)=l3_21(i1,i2)%c(iut,jut)
     &                     -l3_trip12(i2,i1)%c(iut,jut)
          l3_21(i1,i2)%d(iut,jut)=l3_21(i1,i2)%d(iut,jut)
     &                     -l3_trip12(i2,i1)%d(iut,jut)
          r4_21(i1,i2)%a(iut,jut)=r4_21(i1,i2)%a(iut,jut)
     &                     -r4_trip12(i2,i1)%a(iut,jut)
          r4_21(i1,i2)%b(iut,jut)=r4_21(i1,i2)%b(iut,jut)
     &                     -r4_trip12(i2,i1)%b(iut,jut)
          r4_21(i1,i2)%c(iut,jut)=r4_21(i1,i2)%c(iut,jut)
     &                     -r4_trip12(i2,i1)%c(iut,jut)
          r4_21(i1,i2)%d(iut,jut)=r4_21(i1,i2)%d(iut,jut)
     &                     -r4_trip12(i2,i1)%d(iut,jut)
        enddo
        enddo
      enddo
      enddo
  
  
      do i1=1,2
      do i2=1,2
      do mu=0,3
* TsT -- aa=clinet2(i1,i2,mu)%a,bb=clinet2(i1,i2,mu)%b,cc=clinet2(i1,i2,
* mu)%c,dd=clinet2(i1,i2,mu)%d,a1=l3_12(i1,i2)%a,b1=l3_12(i1,i2)%b,c1=l3
* _12(i1,i2)%c,d1=l3_12(i1,i2)%d,a2=crzlinet_mu(mu)%a,b2=crzlinet_mu(mu)
* %b,c2=crzlinet_mu(mu)%c,d2=crzlinet_mu(mu)%d,prq=s312,m=rmass(id3),nsu
* m=0
      do iut=1,2
      cx1=l3_12(i1,i2)%a(iut,1)+l3_12(i1,i2)%c(iut,1)*rmass(id3)
      cx2=l3_12(i1,i2)%c(iut,2)*s312+l3_12(i1,i2)%a(iut,2)*rmass
     & (id3)
      cy1=l3_12(i1,i2)%b(iut,1)+l3_12(i1,i2)%d(iut,1)*rmass(id3)
      cy2=l3_12(i1,i2)%d(iut,2)*s312+l3_12(i1,i2)%b(iut,2)*rmass
     & (id3)
      cw1=l3_12(i1,i2)%c(iut,1)*s312+l3_12(i1,i2)%a(iut,1)*rmass
     & (id3)
      cw2=l3_12(i1,i2)%a(iut,2)+l3_12(i1,i2)%c(iut,2)*rmass(id3)
      cz1=l3_12(i1,i2)%d(iut,1)*s312+l3_12(i1,i2)%b(iut,1)*rmass
     & (id3)
      cz2=l3_12(i1,i2)%b(iut,2)+l3_12(i1,i2)%d(iut,2)*rmass(id3)
      clinet2(i1,i2,mu)%a(iut,1)=cx1*crzlinet_mu(mu)%a(1,1)+cx2*
     & crzlinet_mu(mu)%b(2,1)
      clinet2(i1,i2,mu)%b(iut,1)=cy1*crzlinet_mu(mu)%a(1,1)+cy2*
     & crzlinet_mu(mu)%b(2,1)
      clinet2(i1,i2,mu)%c(iut,1)=cw1*crzlinet_mu(mu)%d(1,1)+cw2*
     & crzlinet_mu(mu)%c(2,1)
      clinet2(i1,i2,mu)%d(iut,1)=cz1*crzlinet_mu(mu)%d(1,1)+cz2*
     & crzlinet_mu(mu)%c(2,1)
      clinet2(i1,i2,mu)%a(iut,2)=cw1*crzlinet_mu(mu)%b(1,2)+cw2*
     & crzlinet_mu(mu)%a(2,2)
      clinet2(i1,i2,mu)%b(iut,2)=cz1*crzlinet_mu(mu)%b(1,2)+cz2*
     & crzlinet_mu(mu)%a(2,2)
      clinet2(i1,i2,mu)%c(iut,2)=cx1*crzlinet_mu(mu)%c(1,2)+cx2*
     & crzlinet_mu(mu)%d(2,2)
      clinet2(i1,i2,mu)%d(iut,2)=cy1*crzlinet_mu(mu)%c(1,2)+cy2*
     & crzlinet_mu(mu)%d(2,2)
      end do
      end do
      end do
      end do
      do i1=1,2
      do i2=1,2
      do mu=0,3
* mline -- res=cz3124(&1,i1,i2,&2)%e(mu),abcd=clinet2(i1,i2,mu)%,m1=rmas
* sl,m2=rmassr,den=(-s3124+cmz2),nsum=0
      do iut=1,2
      do jut=1,2
      cz3124(iut,i1,i2,jut)%e(mu)=(clinet2(i1,i2,mu)%a(iut,jut)+
     & rmassl*clinet2(i1,i2,mu)%b(iut,jut)+rmassr*clinet2(i1,i2,
     & mu)%c(iut,jut)+rmassl*rmassr*clinet2(i1,i2,mu)%d(iut,jut)
     & )/(-s3124+cmz2)
      enddo
      enddo
      end do
      end do
      end do
  
      do i1=1,2
      do i2=1,2
      do mu=0,3
* TTs -- aa=clinet2(i1,i2,mu)%a,bb=clinet2(i1,i2,mu)%b,cc=clinet2(i1,i2,
* mu)%c,dd=clinet2(i1,i2,mu)%d,a1=clzlinet_mu(mu)%a,b1=clzlinet_mu(mu)%b
* ,c1=clzlinet_mu(mu)%c,d1=clzlinet_mu(mu)%d,a2=r4_12(i1,i2)%a,b2=r4_12(
* i1,i2)%b,c2=r4_12(i1,i2)%c,d2=r4_12(i1,i2)%d,prq=s124,m=rmass(id3),nsu
* m=0
      do jut=1,2
      cx1=r4_12(i1,i2)%a(1,jut)+rmass(id3)*r4_12(i1,i2)%b(1,jut)
      cx2=r4_12(i1,i2)%a(2,jut)+rmass(id3)*r4_12(i1,i2)%b(2,jut)
      cy1=s124*r4_12(i1,i2)%b(1,jut)+rmass(id3)*r4_12(i1,i2)%a(1
     & ,jut)
      cy2=s124*r4_12(i1,i2)%b(2,jut)+rmass(id3)*r4_12(i1,i2)%a(2
     & ,jut)
      cw1=r4_12(i1,i2)%c(1,jut)+rmass(id3)*r4_12(i1,i2)%d(1,jut)
      cw2=r4_12(i1,i2)%c(2,jut)+rmass(id3)*r4_12(i1,i2)%d(2,jut)
      cz1=s124*r4_12(i1,i2)%d(1,jut)+rmass(id3)*r4_12(i1,i2)%c(1
     & ,jut)
      cz2=s124*r4_12(i1,i2)%d(2,jut)+rmass(id3)*r4_12(i1,i2)%c(2
     & ,jut)
      clinet2(i1,i2,mu)%a(1,jut)=clzlinet_mu(mu)%a(1,1)*cx1+clzl
     & inet_mu(mu)%c(1,2)*cy2
      clinet2(i1,i2,mu)%b(1,jut)=clzlinet_mu(mu)%d(1,1)*cy1+clzl
     & inet_mu(mu)%b(1,2)*cx2
      clinet2(i1,i2,mu)%c(1,jut)=clzlinet_mu(mu)%a(1,1)*cw1+clzl
     & inet_mu(mu)%c(1,2)*cz2
      clinet2(i1,i2,mu)%d(1,jut)=clzlinet_mu(mu)%d(1,1)*cz1+clzl
     & inet_mu(mu)%b(1,2)*cw2
      clinet2(i1,i2,mu)%a(2,jut)=clzlinet_mu(mu)%c(2,1)*cy1+clzl
     & inet_mu(mu)%a(2,2)*cx2
      clinet2(i1,i2,mu)%b(2,jut)=clzlinet_mu(mu)%b(2,1)*cx1+clzl
     & inet_mu(mu)%d(2,2)*cy2
      clinet2(i1,i2,mu)%c(2,jut)=clzlinet_mu(mu)%c(2,1)*cz1+clzl
     & inet_mu(mu)%a(2,2)*cw2
      clinet2(i1,i2,mu)%d(2,jut)=clzlinet_mu(mu)%b(2,1)*cw1+clzl
     & inet_mu(mu)%d(2,2)*cz2
      end do
      end do
      end do
      end do
      do i1=1,2
      do i2=1,2
      do mu=0,3
* mline -- res=cz3124(&1,i1,i2,&2)%e(mu),abcd=clinet2(i1,i2,mu)%,m1=rmas
* sl,m2=rmassr,den=(-s3124+cmz2),nsum=1
      do iut=1,2
      do jut=1,2
      cz3124(iut,i1,i2,jut)%e(mu)=cz3124(iut,i1,i2,jut)%e(mu)+(c
     & linet2(i1,i2,mu)%a(iut,jut)+rmassl*clinet2(i1,i2,mu)%b(iu
     & t,jut)+rmassr*clinet2(i1,i2,mu)%c(iut,jut)+rmassl*rmassr*
     & clinet2(i1,i2,mu)%d(iut,jut))/(-s3124+cmz2)
      enddo
      enddo
      end do
      end do
      end do
  
*                                                                       
*                                                                       
*        | 1         | 2                                                
*        |           |                                                  
*  3 ---------------------- 4                                           
*              |                                                        
*              |  Z,f                                                   
*                                                                       
* quqd -- p=p31,q=p24
      quqd=p31(0)*p24(0)-p31(1)*p24(1)-p31(2)*p24(2)-p31(3)*p24(
     & 3)
* T -- qu=p31,qd=p24,v=0,a=clinet_mu(0)%a,b=clinet_mu(0)%b,c=clinet_mu(0
* )%c,d=clinet_mu(0)%d,cr=zcr(id3),cl=zcl(id3),nsum=0
      eps_0=-p31(2)*p24(3)+p24(2)*p31(3)
      ceps_0=eps_0*cim
      ceps_1=p31(3)*cim
      ceps_2=p24(3)*cim
      auxa=-quqd+p31k0*p24(0)+p24k0*p31(0)
      clinet_mu(0)%a(1,1)=zcr(id3)*(auxa+ceps_0)
      clinet_mu(0)%a(2,2)=zcl(id3)*(auxa-ceps_0)
      clinet_mu(0)%b(1,2)=-zcl(id3)*(p24(2)+ceps_2)
      clinet_mu(0)%b(2,1)=zcr(id3)*(p24(2)-ceps_2)
      clinet_mu(0)%c(1,2)=zcr(id3)*(p31(2)+ceps_1)
      clinet_mu(0)%c(2,1)=zcl(id3)*(-p31(2)+ceps_1)
      clinet_mu(0)%d(1,1)=zcl(id3)
      clinet_mu(0)%d(2,2)=zcr(id3)
* T -- qu=p31,qd=p24,v=1,a=clinet_mu(1)%a,b=clinet_mu(1)%b,c=clinet_mu(1
