      clinet_mu(0)%b(2,1)=fcr(id3)*(p14(2)-ceps_2)
      clinet_mu(0)%c(1,2)=fcr(id3)*(p32(2)+ceps_1)
      clinet_mu(0)%c(2,1)=fcl(id3)*(-p32(2)+ceps_1)
      clinet_mu(0)%d(1,1)=fcl(id3)
