      ceps_1=p32k0*cim
      ceps_2=p14k0*cim
      auxa=+p32k0*p14(3)+p14k0*p32(3)
      clinet_mu(3)%a(1,1)=fcr(id3)*(auxa+ceps_0)
      clinet_mu(3)%a(2,2)=fcl(id3)*(auxa-ceps_0)
      clinet_mu(3)%b(1,2)=-fcl(id3)*ceps_2
      clinet_mu(3)%b(2,1)=-fcr(id3)*ceps_2
      clinet_mu(3)%c(1,2)=fcr(id3)*ceps_1
      clinet_mu(3)%c(2,1)=fcl(id3)*ceps_1
      do i1=1,2
      do mu=0,3
* TT -- aa=clinet1(i1,mu)%a,bb=clinet1(i1,mu)%b,cc=clinet1(i1,mu)%c,dd=c
* linet1(i1,mu)%d,a1=l3_2(i1)%a,b1=l3_2(i1)%b,c1=l3_2(i1)%c,d1=l3_2(i1)%
* d,a2=clinet_mu(mu)%a,b2=clinet_mu(mu)%b,c2=clinet_mu(mu)%c,d2=clinet_m
