      clinet1(i1,mu)%d(1,2)=rmass(id3)*(l3_2(i1)%d(1,1)*clinet_m
     & u(mu)%c(1,2)+l3_2(i1)%b(1,2)*clinet_mu(mu)%d(2,2))
      clinet1(i1,mu)%a(2,1)=rmass(id3)*(l3_2(i1)%c(2,1)*clinet_m
     & u(mu)%a(1,1)+l3_2(i1)%a(2,2)*clinet_mu(mu)%b(2,1))
      clinet1(i1,mu)%b(2,1)=l3_2(i1)%b(2,1)*clinet_mu(mu)%a(1,1)
     & +l3_2(i1)%d(2,2)*s32*clinet_mu(mu)%b(2,1)
      clinet1(i1,mu)%c(2,1)=l3_2(i1)%c(2,1)*s32*clinet_mu(mu)%d(
