* TsT -- aa=clinet2(i1,i2,mu)%a,bb=clinet2(i1,i2,mu)%b,cc=clinet2(i1,i2,
* mu)%c,dd=clinet2(i1,i2,mu)%d,a1=clinet1(i1,mu)%a,b1=clinet1(i1,mu)%b,c
* 1=clinet1(i1,mu)%c,d1=clinet1(i1,mu)%d,a2=r4_1(i2)%a,b2=r4_1(i2)%b,c2=
