     & )%c(2,1)
      clinet2(i1,i2,mu)%d(iut,1)=cz1*r4_1(i2)%d(1,1)+cz2*r4_1(i2
     & )%c(2,1)
      clinet2(i1,i2,mu)%a(iut,2)=cw1*r4_1(i2)%b(1,2)+cw2*r4_1(i2
