      end do
  
      do i1=1,2
      do mu=0,3
* TWTs -- aa=twtslinet1(i1,mu)%a,bb=twtslinet1(i1,mu)%b,cc=twtslinet1(i1
* ,mu)%c,dd=twtslinet1(i1,mu)%d,a1=l3_56%a,b1=l3_56%b,c1=l3_56%c,d1=l3_5
* 6%d,a2=twtlinet1(i1,mu)%a,b2=twtlinet1(i1,mu)%b,c2=twtlinet1(i1,mu)%c,
* d2=twtlinet1(i1,mu)%d,prq=s356,m=rmass(id3+1),nsum=0
      do jut=1,2
      cx1=twtlinet1(i1,mu)%a(1,jut)+rmass(id3+1)*twtlinet1(i1,mu
     & )%b(1,jut)
      cx2=twtlinet1(i1,mu)%a(2,jut)+rmass(id3+1)*twtlinet1(i1,mu
     & )%b(2,jut)
      cy1=s356*twtlinet1(i1,mu)%b(1,jut)+rmass(id3+1)*twtlinet1(
     & i1,mu)%a(1,jut)
      cy2=s356*twtlinet1(i1,mu)%b(2,jut)+rmass(id3+1)*twtlinet1(
     & i1,mu)%a(2,jut)
      cw1=twtlinet1(i1,mu)%c(1,jut)+rmass(id3+1)*twtlinet1(i1,mu
     & )%d(1,jut)
      cw2=twtlinet1(i1,mu)%c(2,jut)+rmass(id3+1)*twtlinet1(i1,mu
     & )%d(2,jut)
      cz1=s356*twtlinet1(i1,mu)%d(1,jut)+rmass(id3+1)*twtlinet1(
     & i1,mu)%c(1,jut)
      cz2=s356*twtlinet1(i1,mu)%d(2,jut)+rmass(id3+1)*twtlinet1(
     & i1,mu)%c(2,jut)
      twtslinet1(i1,mu)%b(1,jut)=l3_56%d(1,1)*cy1+l3_56%b(1,2)*c
     & x2
      twtslinet1(i1,mu)%d(1,jut)=l3_56%d(1,1)*cz1+l3_56%b(1,2)*c
     & w2
      twtslinet1(i1,mu)%a(2,jut)=l3_56%c(2,1)*cy1+l3_56%a(2,2)*c
     & x2
      twtslinet1(i1,mu)%c(2,jut)=l3_56%c(2,1)*cz1+l3_56%a(2,2)*c
     & w2
      end do
      end do
      end do
  
      do i1=1,2
      do mu=0,3
* mline -- res=cww324_56(&1,i1,&2)%e(mu),abcd=twtslinet1(i1,mu)%,m1=rmas
* sl,m2=rmassr,den=0,nsum=1
      do iut=1,2
      do jut=1,2
      cww324_56(iut,i1,jut)%e(mu)=cww324_56(iut,i1,jut)%e(mu)+tw
     & tslinet1(i1,mu)%a(iut,jut)+rmassl*twtslinet1(i1,mu)%b(iut
     & ,jut)+rmassr*twtslinet1(i1,mu)%c(iut,jut)+rmassl*rmassr*t
     & wtslinet1(i1,mu)%d(iut,jut)
      enddo
      enddo
      end do
      end do
  
      endif   !  on (abs(id7).lt.7)
      endif   !  on (abs(id3).lt.7)
  
      endif   ! on (iup(id3).eq.1)
  
********** compute triple gluon in the middle of z and w                
  
* quqd -- p=p534,q=p534
      quqd=p534(0)*p534(0)-p534(1)*p534(1)-p534(2)*p534(2)-p534(
     & 3)*p534(3)
      s534=quqd
* quqd -- p=p346,q=p346
      quqd=p346(0)*p346(0)-p346(1)*p346(1)-p346(2)*p346(2)-p346(
     & 3)*p346(3)
      s346=quqd
  
*                                                                       
*  5 --------------                                                     
*        |                                                              
*        | z(mu)                                                        
*                                                                       
* quqd -- p=p5,q=p534
      quqd=p5(0)*p534(0)-p5(1)*p534(1)-p5(2)*p534(2)-p5(3)*p534(
     & 3)
      ccl=zcl(id5)/(s534*p534k0)
* TWL0 -- qu=p5,qd=p534,v=0,a=lzlinet_mu(0)%a,c=lzlinet_mu(0)%c,cl=ccl,n
* sum=0
      eps_0=-p5(2)*p534(3)+p534(2)*p5(3)
      ceps_0=eps_0*cim
      ceps_1=p5(3)*cim
      auxa=-quqd+p5k0*p534(0)+p534k0*p5(0)
      lzlinet_mu(0)%a(2)=ccl*(auxa-ceps_0)
      lzlinet_mu(0)%c(2)=ccl*(-p5(2)+ceps_1)
* TWL0 -- qu=p5,qd=p534,v=1,a=lzlinet_mu(1)%a,c=lzlinet_mu(1)%c,cl=ccl,n
* sum=0
      auxa=-quqd+p5k0*p534(1)+p534k0*p5(1)
      lzlinet_mu(1)%a(2)=ccl*(auxa-ceps_0)
      lzlinet_mu(1)%c(2)=ccl*(-p5(2)+ceps_1)
* TWL0 -- qu=p5,qd=p534,v=2,a=lzlinet_mu(2)%a,c=lzlinet_mu(2)%c,cl=ccl,n
* sum=0
      eps_0=-p5k0*p534(3)+p534k0*p5(3)
      ceps_0=eps_0*cim
      auxa=p5k0*p534(2)+p534k0*p5(2)
      lzlinet_mu(2)%a(2)=ccl*(auxa-ceps_0)
      lzlinet_mu(2)%c(2)=-ccl*p5k0
* TWL0 -- qu=p5,qd=p534,v=3,a=lzlinet_mu(3)%a,c=lzlinet_mu(3)%c,cl=ccl,n
* sum=0
      eps_0=p5k0*p534(2)-p534k0*p5(2)
      ceps_0=eps_0*cim
      ceps_1=p5k0*cim
      auxa=p5k0*p534(3)+p534k0*p5(3)
      lzlinet_mu(3)%a(2)=ccl*(auxa-ceps_0)
      lzlinet_mu(3)%c(2)=ccl*ceps_1
  
*                                                                       
*                                                                       
*                                                                       
*                                                                       
*  ------------ 6                                                       
*    |                                                                  
*    | z(mu)                                                            
*                                                                       
* quqd -- p=p346,q=p6
      quqd=p346(0)*p6(0)-p346(1)*p6(1)-p346(2)*p6(2)-p346(3)*p6(
     & 3)
      ccl=zcl(id6)/(s346*p346k0)
* TWR0 -- qu=p346,qd=p6,v=0,a=rzlinet_mu(0)%a,b=rzlinet_mu(0)%b,cl=ccl,n
* sum=0
      eps_0=-p346(2)*p6(3)+p6(2)*p346(3)
      ceps_0=eps_0*cim
      ceps_2=p6(3)*cim
      auxa=-quqd+p346k0*p6(0)+p6k0*p346(0)
      rzlinet_mu(0)%a(2)=ccl*(auxa-ceps_0)
      rzlinet_mu(0)%b(1)=-ccl*(p6(2)+ceps_2)
* TWR0 -- qu=p346,qd=p6,v=1,a=rzlinet_mu(1)%a,b=rzlinet_mu(1)%b,cl=ccl,n
* sum=0
      auxa=-quqd+p346k0*p6(1)+p6k0*p346(1)
      rzlinet_mu(1)%a(2)=ccl*(auxa-ceps_0)
      rzlinet_mu(1)%b(1)=-ccl*(p6(2)+ceps_2)
* TWR0 -- qu=p346,qd=p6,v=2,a=rzlinet_mu(2)%a,b=rzlinet_mu(2)%b,cl=ccl,n
* sum=0
      eps_0=-p346k0*p6(3)+p6k0*p346(3)
      ceps_0=eps_0*cim
      auxa=p346k0*p6(2)+p6k0*p346(2)
      rzlinet_mu(2)%a(2)=ccl*(auxa-ceps_0)
      rzlinet_mu(2)%b(1)=-ccl*p6k0
* TWR0 -- qu=p346,qd=p6,v=3,a=rzlinet_mu(3)%a,b=rzlinet_mu(3)%b,cl=ccl,n
* sum=0
      eps_0=p346k0*p6(2)-p6k0*p346(2)
      ceps_0=eps_0*cim
      ceps_2=p6k0*cim
      auxa=p346k0*p6(3)+p6k0*p346(3)
      rzlinet_mu(3)%a(2)=ccl*(auxa-ceps_0)
      rzlinet_mu(3)%b(1)=-ccl*ceps_2
*                                                                       
*  5 --------------                                                     
*        |                                                              
*        | f(mu)                                                        
*                                                                       
* quqd -- p=p5,q=p534
      quqd=p5(0)*p534(0)-p5(1)*p534(1)-p5(2)*p534(2)-p5(3)*p534(
     & 3)
      ccl=fcl(id5)/(s534*p534k0)
* TWL0 -- qu=p5,qd=p534,v=0,a=lflinet_mu(0)%a,c=lflinet_mu(0)%c,cl=ccl,n
* sum=0
      eps_0=-p5(2)*p534(3)+p534(2)*p5(3)
      ceps_0=eps_0*cim
      ceps_1=p5(3)*cim
      auxa=-quqd+p5k0*p534(0)+p534k0*p5(0)
      lflinet_mu(0)%a(2)=ccl*(auxa-ceps_0)
      lflinet_mu(0)%c(2)=ccl*(-p5(2)+ceps_1)
* TWL0 -- qu=p5,qd=p534,v=1,a=lflinet_mu(1)%a,c=lflinet_mu(1)%c,cl=ccl,n
* sum=0
      auxa=-quqd+p5k0*p534(1)+p534k0*p5(1)
      lflinet_mu(1)%a(2)=ccl*(auxa-ceps_0)
      lflinet_mu(1)%c(2)=ccl*(-p5(2)+ceps_1)
* TWL0 -- qu=p5,qd=p534,v=2,a=lflinet_mu(2)%a,c=lflinet_mu(2)%c,cl=ccl,n
* sum=0
      eps_0=-p5k0*p534(3)+p534k0*p5(3)
      ceps_0=eps_0*cim
      auxa=p5k0*p534(2)+p534k0*p5(2)
      lflinet_mu(2)%a(2)=ccl*(auxa-ceps_0)
      lflinet_mu(2)%c(2)=-ccl*p5k0
* TWL0 -- qu=p5,qd=p534,v=3,a=lflinet_mu(3)%a,c=lflinet_mu(3)%c,cl=ccl,n
* sum=0
      eps_0=p5k0*p534(2)-p534k0*p5(2)
      ceps_0=eps_0*cim
      ceps_1=p5k0*cim
      auxa=p5k0*p534(3)+p534k0*p5(3)
      lflinet_mu(3)%a(2)=ccl*(auxa-ceps_0)
      lflinet_mu(3)%c(2)=ccl*ceps_1
  
*                                                                       
*                                                                       
*                                                                       
*                                                                       
*  ------------ 6                                                       
*    |                                                                  
*    | f(mu)                                                            
*                                                                       
* quqd -- p=p346,q=p6
      quqd=p346(0)*p6(0)-p346(1)*p6(1)-p346(2)*p6(2)-p346(3)*p6(
     & 3)
      ccl=fcl(id6)/(s346*p346k0)
* TWR0 -- qu=p346,qd=p6,v=0,a=rflinet_mu(0)%a,b=rflinet_mu(0)%b,cl=ccl,n
* sum=0
      eps_0=-p346(2)*p6(3)+p6(2)*p346(3)
      ceps_0=eps_0*cim
      ceps_2=p6(3)*cim
      auxa=-quqd+p346k0*p6(0)+p6k0*p346(0)
      rflinet_mu(0)%a(2)=ccl*(auxa-ceps_0)
      rflinet_mu(0)%b(1)=-ccl*(p6(2)+ceps_2)
* TWR0 -- qu=p346,qd=p6,v=1,a=rflinet_mu(1)%a,b=rflinet_mu(1)%b,cl=ccl,n
* sum=0
      auxa=-quqd+p346k0*p6(1)+p6k0*p346(1)
      rflinet_mu(1)%a(2)=ccl*(auxa-ceps_0)
      rflinet_mu(1)%b(1)=-ccl*(p6(2)+ceps_2)
* TWR0 -- qu=p346,qd=p6,v=2,a=rflinet_mu(2)%a,b=rflinet_mu(2)%b,cl=ccl,n
* sum=0
      eps_0=-p346k0*p6(3)+p6k0*p346(3)
      ceps_0=eps_0*cim
      auxa=p346k0*p6(2)+p6k0*p346(2)
      rflinet_mu(2)%a(2)=ccl*(auxa-ceps_0)
      rflinet_mu(2)%b(1)=-ccl*p6k0
* TWR0 -- qu=p346,qd=p6,v=3,a=rflinet_mu(3)%a,b=rflinet_mu(3)%b,cl=ccl,n
* sum=0
      eps_0=p346k0*p6(2)-p6k0*p346(2)
      ceps_0=eps_0*cim
      ceps_2=p6k0*cim
      auxa=p346k0*p6(3)+p6k0*p346(3)
      rflinet_mu(3)%a(2)=ccl*(auxa-ceps_0)
      rflinet_mu(3)%b(1)=-ccl*ceps_2
  
      if(abs(id5).lt.7)then
*                                                                       
*                                                                       
*           g1 ----|---- g2                                             
*                  |                                                    
*  5 --------------------------------- 6                                
*        |                |                                             
*        | z(mu)        | W(7,8)                                        
*                                                                       
* quqd -- p=p534,q=p786
      quqd=p534(0)*p786(0)-p534(1)*p786(1)-p534(2)*p786(2)-p534(
     & 3)*p786(3)
      rcl=gs/s12
      do i1=1,2
      do i2=1,2
* TW0 -- qu=p534,qd=p786,v=ctrip12(i1,i2)%e,a=wlinet2(i1,i2)%a,b=wlinet2
* (i1,i2)%b,c=wlinet2(i1,i2)%c,d=wlinet2(i1,i2)%d,cl=rcl,nsum=0
      ceps_0=-ctrip12(i1,i2)%ek0*(p534(2)*p786(3)-p786(2)*p534(3
     & ))+p534k0*(ctrip12(i1,i2)%e(2)*p786(3)-p786(2)*ctrip12(i1
     & ,i2)%e(3))-p786k0*(ctrip12(i1,i2)%e(2)*p534(3)-p534(2)*ct
     & rip12(i1,i2)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-ctrip12(i1,i2)%e(3)*p534k0+p534(3)*ctrip12(i1,i2)%
     & ek0
      ceps_1=ceps_1*cim
      ceps_2=-ctrip12(i1,i2)%e(3)*p786k0+p786(3)*ctrip12(i1,i2)%
     & ek0
      ceps_2=ceps_2*cim
      cvqu=ctrip12(i1,i2)%e(0)*p534(0)-ctrip12(i1,i2)%e(1)*p534(
     & 1)-ctrip12(i1,i2)%e(2)*p534(2)-ctrip12(i1,i2)%e(3)*p534(3
     & )
      cvqd=ctrip12(i1,i2)%e(0)*p786(0)-ctrip12(i1,i2)%e(1)*p786(
     & 1)-ctrip12(i1,i2)%e(2)*p786(2)-ctrip12(i1,i2)%e(3)*p786(3
     & )
      cauxa=-ctrip12(i1,i2)%ek0*quqd+p534k0*cvqd+p786k0*cvqu
      cauxb=-ctrip12(i1,i2)%ek0*p786(2)+p786k0*ctrip12(i1,i2)%e(
     & 2)
      cauxc=+ctrip12(i1,i2)%ek0*p534(2)-p534k0*ctrip12(i1,i2)%e(
     & 2)
      wlinet2(i1,i2)%a(2)=rcl*(cauxa-ceps_0)
      wlinet2(i1,i2)%b(1)=rcl*(cauxb-ceps_2)
      wlinet2(i1,i2)%c(2)=rcl*(-cauxc+ceps_1)
      wlinet2(i1,i2)%d(1)=rcl*ctrip12(i1,i2)%ek0
      end do
      end do
      do i1=1,2
      do i2=1,2
      do mu=0,3
* TLT0_W -- aa=wlinet3(i1,i2,mu)%a,cc=wlinet3(i1,i2,mu)%c,a1=lzlinet_mu(
* mu)%a,c1=lzlinet_mu(mu)%c,a2=wlinet2(i1,i2)%a,b2=wlinet2(i1,i2)%b,c2=w
* linet2(i1,i2)%c,d2=wlinet2(i1,i2)%d,prq=s534,nsum=0
      wlinet3(i1,i2,mu)%c(2)=lzlinet_mu(mu)%c(2)*s534*wlinet2(i1
     & ,i2)%d(1)+lzlinet_mu(mu)%a(2)*wlinet2(i1,i2)%c(2)
      wlinet3(i1,i2,mu)%a(2)=lzlinet_mu(mu)%c(2)*s534*wlinet2(i1
     & ,i2)%b(1)+lzlinet_mu(mu)%a(2)*wlinet2(i1,i2)%a(2)
      end do
      end do
      end do
      do i1=1,2
      do i2=1,2
      do mu=0,3
* TLTR0_W -- aa=czw56trip_78(i1,i2)%e(mu),a1=wlinet3(i1,i2,mu)%a,c1=wlin
* et3(i1,i2,mu)%c,a2=r6_78%a,b2=r6_78%b,prq=s786,bef=,aft=
      czw56trip_78(i1,i2)%e(mu)=(wlinet3(i1,i2,mu)%c(2)*s786*r6_
     & 78%b(1)+wlinet3(i1,i2,mu)%a(2)*r6_78%a(2))
      end do
      end do
      end do
*                                                                       
*                                                                       
*           g1 ----|---- g2                                             
*                  |                                                    
*  5 --------------------------------- 6                                
*        |                |                                             
*        | W(7,8)         | z(mu)                                       
*                                                                       
* quqd -- p=p578,q=p346
      quqd=p578(0)*p346(0)-p578(1)*p346(1)-p578(2)*p346(2)-p578(
     & 3)*p346(3)
      rcl=gs/s12
      do i1=1,2
      do i2=1,2
* TW0 -- qu=p578,qd=p346,v=ctrip12(i1,i2)%e,a=wlinet2(i1,i2)%a,b=wlinet2
* (i1,i2)%b,c=wlinet2(i1,i2)%c,d=wlinet2(i1,i2)%d,cl=rcl,nsum=0
      ceps_0=-ctrip12(i1,i2)%ek0*(p578(2)*p346(3)-p346(2)*p578(3
     & ))+p578k0*(ctrip12(i1,i2)%e(2)*p346(3)-p346(2)*ctrip12(i1
     & ,i2)%e(3))-p346k0*(ctrip12(i1,i2)%e(2)*p578(3)-p578(2)*ct
     & rip12(i1,i2)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-ctrip12(i1,i2)%e(3)*p578k0+p578(3)*ctrip12(i1,i2)%
     & ek0
      ceps_1=ceps_1*cim
      ceps_2=-ctrip12(i1,i2)%e(3)*p346k0+p346(3)*ctrip12(i1,i2)%
     & ek0
      ceps_2=ceps_2*cim
      cvqu=ctrip12(i1,i2)%e(0)*p578(0)-ctrip12(i1,i2)%e(1)*p578(
     & 1)-ctrip12(i1,i2)%e(2)*p578(2)-ctrip12(i1,i2)%e(3)*p578(3
     & )
      cvqd=ctrip12(i1,i2)%e(0)*p346(0)-ctrip12(i1,i2)%e(1)*p346(
     & 1)-ctrip12(i1,i2)%e(2)*p346(2)-ctrip12(i1,i2)%e(3)*p346(3
     & )
      cauxa=-ctrip12(i1,i2)%ek0*quqd+p578k0*cvqd+p346k0*cvqu
      cauxb=-ctrip12(i1,i2)%ek0*p346(2)+p346k0*ctrip12(i1,i2)%e(
     & 2)
      cauxc=+ctrip12(i1,i2)%ek0*p578(2)-p578k0*ctrip12(i1,i2)%e(
     & 2)
      wlinet2(i1,i2)%a(2)=rcl*(cauxa-ceps_0)
      wlinet2(i1,i2)%b(1)=rcl*(cauxb-ceps_2)
      wlinet2(i1,i2)%c(2)=rcl*(-cauxc+ceps_1)
      wlinet2(i1,i2)%d(1)=rcl*ctrip12(i1,i2)%ek0
      end do
      end do
      do i1=1,2
      do i2=1,2
      do mu=0,3
* TTR0_W -- aa=wlinet3(i1,i2,mu)%a,bb=wlinet3(i1,i2,mu)%b,a1=wlinet2(i1,
* i2)%a,b1=wlinet2(i1,i2)%b,c1=wlinet2(i1,i2)%c,d1=wlinet2(i1,i2)%d,a2=r
* zlinet_mu(mu)%a,b2=rzlinet_mu(mu)%b,prq=s346,nsum=0
      wlinet3(i1,i2,mu)%b(1)=wlinet2(i1,i2)%d(1)*s346*rzlinet_mu
     & (mu)%b(1)+wlinet2(i1,i2)%b(1)*rzlinet_mu(mu)%a(2)
      wlinet3(i1,i2,mu)%a(2)=wlinet2(i1,i2)%c(2)*s346*rzlinet_mu
     & (mu)%b(1)+wlinet2(i1,i2)%a(2)*rzlinet_mu(mu)%a(2)
      end do
      end do
      end do
      do i1=1,2
      do i2=1,2
      do mu=0,3
