* quqd -- p=p5,q=p786
      quqd=p5(0)*p786(0)-p5(1)*p786(1)-p5(2)*p786(2)-p5(3)*p786(
     & 3)
* TWL0 -- qu=p5,qd=p786,v=0,a=lzlinet_mu(0)%a,c=lzlinet_mu(0)%c,cl=zcl(i
* d5),nsum=0
      eps_0=-p5(2)*p786(3)+p786(2)*p5(3)
      ceps_0=eps_0*cim
      ceps_1=p5(3)*cim
      auxa=-quqd+p5k0*p786(0)+p786k0*p5(0)
      lzlinet_mu(0)%a(2)=zcl(id5)*(auxa-ceps_0)
      lzlinet_mu(0)%c(2)=zcl(id5)*(-p5(2)+ceps_1)
* TWL0 -- qu=p5,qd=p786,v=1,a=lzlinet_mu(1)%a,c=lzlinet_mu(1)%c,cl=zcl(i
* d5),nsum=0
