      lzlinet_mu(1)%a(2)=zcl(id5)*(auxa-ceps_0)
      lzlinet_mu(1)%c(2)=zcl(id5)*(-p5(2)+ceps_1)
* TWL0 -- qu=p5,qd=p786,v=2,a=lzlinet_mu(2)%a,c=lzlinet_mu(2)%c,cl=zcl(i
* d5),nsum=0
