      ceps_0=eps_0*cim
      auxa=p5k0*p786(2)+p786k0*p5(2)
      lzlinet_mu(2)%a(2)=zcl(id5)*(auxa-ceps_0)
      lzlinet_mu(2)%c(2)=-zcl(id5)*p5k0
* TWL0 -- qu=p5,qd=p786,v=3,a=lzlinet_mu(3)%a,c=lzlinet_mu(3)%c,cl=zcl(i
* d5),nsum=0
      eps_0=p5k0*p786(2)-p786k0*p5(2)
      ceps_0=eps_0*cim
      ceps_1=p5k0*cim
      auxa=p5k0*p786(3)+p786k0*p5(3)
