*                    /_  W(78)                                          
*                   /                                                   
*       (mu)_Z,f___/                                                    
*                  \                                                    
*                   \_                                                  
*                    \   W(5126)                                        
*                                                                       
*                                                                       
*                                                                       
*** triple vertex -- pfz(mu)=p34(mu),pwm(mu)=p78(mu),pwp(mu)=p1256(mu),e
* fz=#,ewm=cw78,ewp=cw5126(i1,i2),res=ctrip5126_78(i1?,i2?,mu#)
      do mu=0,3
      vfz(mu)=p78(mu)-p1256(mu)
      vwm(mu)=p1256(mu)-p34(mu)
      vwp(mu)=p34(mu)-p78(mu)
      end do !mu
* vwm%ewm
* p.q -- p.q=cw78%v,p=cw78%e,q=vwm,bef=,aft=
      cw78%v=(cw78%e(0)*vwm(0)-cw78%e(1)*vwm(1)-cw78%e(2)*vwm(2)
     & -cw78%e(3)*vwm(3))
* vwp%ewp
      do i1=1,2
      do i2=1,2
* p.q -- p.q=cw5126(i1,i2)%v,p=cw5126(i1,i2)%e,q=vwp,bef=,aft=
      cw5126(i1,i2)%v=(cw5126(i1,i2)%e(0)*vwp(0)-cw5126(i1,i2)%e
     & (1)*vwp(1)-cw5126(i1,i2)%e(2)*vwp(2)-cw5126(i1,i2)%e(3)*v
     & wp(3))
      end do
      end do
* ewm%ewp
      do i1=1,2
      do i2=1,2
* p.q -- p.q=caux,p=cw78%e,q=cw5126(i1,i2)%e,bef=,aft=
      caux=(cw78%e(0)*cw5126(i1,i2)%e(0)-cw78%e(1)*cw5126(i1,i2)
     & %e(1)-cw78%e(2)*cw5126(i1,i2)%e(2)-cw78%e(3)*cw5126(i1,i2
     & )%e(3))
      do mu=0,3
      ctrip5126_78(i1,i2,mu)=vfz(mu)*caux+cw78%v*cw5126(i1,i2)%e
     & (mu)+cw5126(i1,i2)%v*cw78%e(mu)
      end do
      end do
      end do
  
      do i1=1,2
        do i2=1,2
          do mu=0,3
            czw78_5126(i1,i2)%e(mu)=
     &                +rcotw*ctrip5126_78(i1,i2,mu)
     &                     +czw78_5126(i1,i2)%e(mu)
          enddo
        enddo
      enddo
  
  
  
*                                                                       
*                    /_  W(78)                                          
*                   /                                                   
*       (mu)_Z,f___/                                                    
*                  \                                                    
*                   \_                                                  
*                    \   W(5126)                                        
*                                                                       
*                                                                       
*                                                                       
  
      do i1=1,2
        do i2=1,2
          do mu=0,3
            cfw78_5126(i1,i2)%e(mu)=
     &                +ctrip5126_78(i1,i2,mu)
     &                     +cfw78_5126(i1,i2)%e(mu)
          enddo
        enddo
      enddo
  
  
  
*                                                                       
*                    /_  W(78)                                          
*                   /                                                   
*       (mu)_Z,f___/                                                    
*                  \                                                    
*                   \_                                                  
*                    \   W(5216)                                        
*                                                                       
*                                                                       
*                                                                       
*** triple vertex -- pfz(mu)=p34(mu),pwm(mu)=p78(mu),pwp(mu)=p1256(mu),e
* fz=#,ewm=cw78,ewp=cw5216(i1,i2),res=ctrip5216_78(i1?,i2?,mu#)
      do mu=0,3
      vfz(mu)=p78(mu)-p1256(mu)
      vwm(mu)=p1256(mu)-p34(mu)
      vwp(mu)=p34(mu)-p78(mu)
      end do !mu
* vwm%ewm
* p.q -- p.q=cw78%v,p=cw78%e,q=vwm,bef=,aft=
      cw78%v=(cw78%e(0)*vwm(0)-cw78%e(1)*vwm(1)-cw78%e(2)*vwm(2)
     & -cw78%e(3)*vwm(3))
* vwp%ewp
      do i1=1,2
      do i2=1,2
* p.q -- p.q=cw5216(i1,i2)%v,p=cw5216(i1,i2)%e,q=vwp,bef=,aft=
      cw5216(i1,i2)%v=(cw5216(i1,i2)%e(0)*vwp(0)-cw5216(i1,i2)%e
     & (1)*vwp(1)-cw5216(i1,i2)%e(2)*vwp(2)-cw5216(i1,i2)%e(3)*v
     & wp(3))
      end do
      end do
* ewm%ewp
      do i1=1,2
      do i2=1,2
* p.q -- p.q=caux,p=cw78%e,q=cw5216(i1,i2)%e,bef=,aft=
      caux=(cw78%e(0)*cw5216(i1,i2)%e(0)-cw78%e(1)*cw5216(i1,i2)
     & %e(1)-cw78%e(2)*cw5216(i1,i2)%e(2)-cw78%e(3)*cw5216(i1,i2
     & )%e(3))
      do mu=0,3
      ctrip5216_78(i1,i2,mu)=vfz(mu)*caux+cw78%v*cw5216(i1,i2)%e
     & (mu)+cw5216(i1,i2)%v*cw78%e(mu)
      end do
      end do
      end do
  
      do i1=1,2
        do i2=1,2
          do mu=0,3
            czw78_5216(i1,i2)%e(mu)=
     &                +rcotw*ctrip5216_78(i1,i2,mu)
     &                     +czw78_5216(i1,i2)%e(mu)
          enddo
        enddo
      enddo
  
  
  
*                                                                       
*                    /_  W(78)                                          
*                   /                                                   
*       (mu)_Z,f___/                                                    
*                  \                                                    
*                   \_                                                  
*                    \   W(5216)                                        
