*                                                                       
*                                                                       
  
      do i1=1,2
        do i2=1,2
          do mu=0,3
            cfw78_5216(i1,i2)%e(mu)=
     &                +ctrip5216_78(i1,i2,mu)
     &                     +cfw78_5216(i1,i2)%e(mu)
          enddo
        enddo
      enddo
  
  
  
      if(id3.eq.5)then
* compute  subdiagram with a higgs decaying to 4 fermions (two w's)     
*                                                                       
*               /_  W(78)                                               
*              /                                                        
*       ___h__/                                                         
*             \                                                         
*              \_                                                       
*               \  W(5126)                                              
*                                                                       
* We factorize out from the amplitude the modulus of the electric       
* charge from every coupling, hence instead of g  we have               
* coupling g/|e|=1/sw                                                   
  
      do i1=1,2
      do i2=1,2
* p.q -- p.q=ch78_5126(i1,i2),p=cw5126(i1,i2)%e,q=cw78%e,bef=,aft=*rmw/s
* w
      ch78_5126(i1,i2)=(cw5126(i1,i2)%e(0)*cw78%e(0)-cw5126(i1,i
     & 2)%e(1)*cw78%e(1)-cw5126(i1,i2)%e(2)*cw78%e(2)-cw5126(i1,
     & i2)%e(3)*cw78%e(3))*rmw/sw
      end do
      end do
  
* compute  subdiagram with a higgs decaying to 4 fermions (two w's)     
*                                                                       
*               /_  W(78)                                               
*              /                                                        
*       ___h__/                                                         
*             \                                                         
*              \_                                                       
*               \  W(5216)                                              
*                                                                       
* We factorize out from the amplitude the modulus of the electric       
* charge from every coupling, hence instead of g  we have               
* coupling g/|e|=1/sw                                                   
  
      do i1=1,2
      do i2=1,2
* p.q -- p.q=ch78_5216(i1,i2),p=cw5216(i1,i2)%e,q=cw78%e,bef=,aft=*rmw/s
* w
      ch78_5216(i1,i2)=(cw5216(i1,i2)%e(0)*cw78%e(0)-cw5216(i1,i
     & 2)%e(1)*cw78%e(1)-cw5216(i1,i2)%e(2)*cw78%e(2)-cw5216(i1,
     & i2)%e(3)*cw78%e(3))*rmw/sw
      end do
      end do
  
      else
        do i2=1,2
          do i1=1,2
            ch78_5126(i1,i2)=czero
            ch78_5216(i1,i2)=czero
          enddo
        enddo
      endif
      endif   ! on (abs(id5.lt.7)
** Diagrams with two gluons on the 78 fork                              
  
* quqd -- p=p534,q=p534
      quqd=p534(0)*p534(0)-p534(1)*p534(1)-p534(2)*p534(2)-p534(
     & 3)*p534(3)
      s534=quqd
* quqd -- p=p346,q=p346
      quqd=p346(0)*p346(0)-p346(1)*p346(1)-p346(2)*p346(2)-p346(
     & 3)*p346(3)
      s346=quqd
  
      do m=0,3
        p1278(m)=p12(m)+p78(m)
      enddo
  
      if(abs(id7).lt.7)then
  
*                                                                       
*                                                                       
*            | W(7,1,2,8)                                               
*            |                                                          
*  5 --------------- 6                                                  
*        |                                                              
*        |  z(mu)                                                       
*                                                                       
* quqd -- p=p534,q=p6
      quqd=p534(0)*p6(0)-p534(1)*p6(1)-p534(2)*p6(2)-p534(3)*p6(
     & 3)
      ccl=wcl/(s534*p534k0)
      do i1=1,2
      do i2=1,2
* TWR0 -- qu=p534,qd=p6,v=cw7128(i1,i2)%e,a=wlinet2(i1,i2)%a,b=wlinet2(i
* 1,i2)%b,cl=ccl,nsum=0
      ceps_0=-cw7128(i1,i2)%ek0*(p534(2)*p6(3)-p6(2)*p534(3))+p5
     & 34k0*(cw7128(i1,i2)%e(2)*p6(3)-p6(2)*cw7128(i1,i2)%e(3))-
     & p6k0*(cw7128(i1,i2)%e(2)*p534(3)-p534(2)*cw7128(i1,i2)%e(
     & 3))
      ceps_0=ceps_0*cim
      ceps_2=-cw7128(i1,i2)%e(3)*p6k0+p6(3)*cw7128(i1,i2)%ek0
      ceps_2=ceps_2*cim
      cvqu=cw7128(i1,i2)%e(0)*p534(0)-cw7128(i1,i2)%e(1)*p534(1)
     & -cw7128(i1,i2)%e(2)*p534(2)-cw7128(i1,i2)%e(3)*p534(3)
      cvqd=cw7128(i1,i2)%e(0)*p6(0)-cw7128(i1,i2)%e(1)*p6(1)-cw7
     & 128(i1,i2)%e(2)*p6(2)-cw7128(i1,i2)%e(3)*p6(3)
      cauxa=-cw7128(i1,i2)%ek0*quqd+p534k0*cvqd+p6k0*cvqu
      cauxb=-cw7128(i1,i2)%ek0*p6(2)+p6k0*cw7128(i1,i2)%e(2)
      wlinet2(i1,i2)%a(2)=ccl*(cauxa-ceps_0)
      wlinet2(i1,i2)%b(1)=ccl*(cauxb-ceps_2)
      end do
      end do
* quqd -- p=p5,q=p534
      quqd=p5(0)*p534(0)-p5(1)*p534(1)-p5(2)*p534(2)-p5(3)*p534(
     & 3)
* TWL0 -- qu=p5,qd=p534,v=0,a=lwlinet_mu(0)%a,c=lwlinet_mu(0)%c,cl=zcl(i
* d5),nsum=0
      eps_0=-p5(2)*p534(3)+p534(2)*p5(3)
      ceps_0=eps_0*cim
      ceps_1=p5(3)*cim
      auxa=-quqd+p5k0*p534(0)+p534k0*p5(0)
      lwlinet_mu(0)%a(2)=zcl(id5)*(auxa-ceps_0)
      lwlinet_mu(0)%c(2)=zcl(id5)*(-p5(2)+ceps_1)
* TWL0 -- qu=p5,qd=p534,v=1,a=lwlinet_mu(1)%a,c=lwlinet_mu(1)%c,cl=zcl(i
* d5),nsum=0
      auxa=-quqd+p5k0*p534(1)+p534k0*p5(1)
      lwlinet_mu(1)%a(2)=zcl(id5)*(auxa-ceps_0)
      lwlinet_mu(1)%c(2)=zcl(id5)*(-p5(2)+ceps_1)
* TWL0 -- qu=p5,qd=p534,v=2,a=lwlinet_mu(2)%a,c=lwlinet_mu(2)%c,cl=zcl(i
* d5),nsum=0
      eps_0=-p5k0*p534(3)+p534k0*p5(3)
      ceps_0=eps_0*cim
      auxa=p5k0*p534(2)+p534k0*p5(2)
      lwlinet_mu(2)%a(2)=zcl(id5)*(auxa-ceps_0)
      lwlinet_mu(2)%c(2)=-zcl(id5)*p5k0
* TWL0 -- qu=p5,qd=p534,v=3,a=lwlinet_mu(3)%a,c=lwlinet_mu(3)%c,cl=zcl(i
* d5),nsum=0
      eps_0=p5k0*p534(2)-p534k0*p5(2)
      ceps_0=eps_0*cim
      ceps_1=p5k0*cim
      auxa=p5k0*p534(3)+p534k0*p5(3)
      lwlinet_mu(3)%a(2)=zcl(id5)*(auxa-ceps_0)
      lwlinet_mu(3)%c(2)=zcl(id5)*ceps_1
      do i1=1,2
      do i2=1,2
      do mu=0,3
* TLTR0_W -- aa=czw56_7128(i1,i2)%e(mu),a1=lwlinet_mu(mu)%a,c1=lwlinet_m
* u(mu)%c,a2=wlinet2(i1,i2)%a,b2=wlinet2(i1,i2)%b,prq=s534,bef=,aft=
      czw56_7128(i1,i2)%e(mu)=(lwlinet_mu(mu)%c(2)*s534*wlinet2(
     & i1,i2)%b(1)+lwlinet_mu(mu)%a(2)*wlinet2(i1,i2)%a(2))
      end do
      end do
      end do
  
*                                                                       
*       | W(7,1,2,8)                                                    
*       |                                                               
*  5 --------------- 6                                                  
*            |                                                          
*            |  z(mu)                                                   
*                                                                       
*                                                                       
* quqd -- p=p5,q=p346
      quqd=p5(0)*p346(0)-p5(1)*p346(1)-p5(2)*p346(2)-p5(3)*p346(
     & 3)
      ccl=wcl/(s346*p346k0)
      do i1=1,2
      do i2=1,2
* TWL0 -- qu=p5,qd=p346,v=cw7128(i1,i2)%e,a=wlinet2(i1,i2)%a,c=wlinet2(i
* 1,i2)%c,cl=ccl,nsum=0
      ceps_0=-cw7128(i1,i2)%ek0*(p5(2)*p346(3)-p346(2)*p5(3))+p5
     & k0*(cw7128(i1,i2)%e(2)*p346(3)-p346(2)*cw7128(i1,i2)%e(3)
     & )-p346k0*(cw7128(i1,i2)%e(2)*p5(3)-p5(2)*cw7128(i1,i2)%e(
     & 3))
      ceps_0=ceps_0*cim
      ceps_1=-cw7128(i1,i2)%e(3)*p5k0+p5(3)*cw7128(i1,i2)%ek0
      ceps_1=ceps_1*cim
      cvqu=cw7128(i1,i2)%e(0)*p5(0)-cw7128(i1,i2)%e(1)*p5(1)-cw7
     & 128(i1,i2)%e(2)*p5(2)-cw7128(i1,i2)%e(3)*p5(3)
      cvqd=cw7128(i1,i2)%e(0)*p346(0)-cw7128(i1,i2)%e(1)*p346(1)
     & -cw7128(i1,i2)%e(2)*p346(2)-cw7128(i1,i2)%e(3)*p346(3)
      cauxa=-cw7128(i1,i2)%ek0*quqd+p5k0*cvqd+p346k0*cvqu
      cauxc=+cw7128(i1,i2)%ek0*p5(2)-p5k0*cw7128(i1,i2)%e(2)
      wlinet2(i1,i2)%a(2)=ccl*(cauxa-ceps_0)
      wlinet2(i1,i2)%c(2)=ccl*(-cauxc+ceps_1)
      end do
      end do
* quqd -- p=p346,q=p6
      quqd=p346(0)*p6(0)-p346(1)*p6(1)-p346(2)*p6(2)-p346(3)*p6(
     & 3)
* TWR0 -- qu=p346,qd=p6,v=0,a=rwlinet_mu(0)%a,b=rwlinet_mu(0)%b,cl=zcl(i
* d6),nsum=0
      eps_0=-p346(2)*p6(3)+p6(2)*p346(3)
      ceps_0=eps_0*cim
      ceps_2=p6(3)*cim
      auxa=-quqd+p346k0*p6(0)+p6k0*p346(0)
      rwlinet_mu(0)%a(2)=zcl(id6)*(auxa-ceps_0)
      rwlinet_mu(0)%b(1)=-zcl(id6)*(p6(2)+ceps_2)
* TWR0 -- qu=p346,qd=p6,v=1,a=rwlinet_mu(1)%a,b=rwlinet_mu(1)%b,cl=zcl(i
* d6),nsum=0
      auxa=-quqd+p346k0*p6(1)+p6k0*p346(1)
      rwlinet_mu(1)%a(2)=zcl(id6)*(auxa-ceps_0)
      rwlinet_mu(1)%b(1)=-zcl(id6)*(p6(2)+ceps_2)
* TWR0 -- qu=p346,qd=p6,v=2,a=rwlinet_mu(2)%a,b=rwlinet_mu(2)%b,cl=zcl(i
* d6),nsum=0
      eps_0=-p346k0*p6(3)+p6k0*p346(3)
      ceps_0=eps_0*cim
      auxa=p346k0*p6(2)+p6k0*p346(2)
      rwlinet_mu(2)%a(2)=zcl(id6)*(auxa-ceps_0)
      rwlinet_mu(2)%b(1)=-zcl(id6)*p6k0
* TWR0 -- qu=p346,qd=p6,v=3,a=rwlinet_mu(3)%a,b=rwlinet_mu(3)%b,cl=zcl(i
* d6),nsum=0
      eps_0=p346k0*p6(2)-p6k0*p346(2)
      ceps_0=eps_0*cim
      ceps_2=p6k0*cim
      auxa=p346k0*p6(3)+p6k0*p346(3)
      rwlinet_mu(3)%a(2)=zcl(id6)*(auxa-ceps_0)
      rwlinet_mu(3)%b(1)=-zcl(id6)*ceps_2
      do i1=1,2
      do i2=1,2
      do mu=0,3
* TLTR0_W -- aa=czw56_7128(i1,i2)%e(mu),a1=wlinet2(i1,i2)%a,c1=wlinet2(i
* 1,i2)%c,a2=rwlinet_mu(mu)%a,b2=rwlinet_mu(mu)%b,prq=s346,bef=czw56_712
* 8(i1,i2)%e(mu)+,aft=
      czw56_7128(i1,i2)%e(mu)=czw56_7128(i1,i2)%e(mu)+(wlinet2(i
     & 1,i2)%c(2)*s346*rwlinet_mu(mu)%b(1)+wlinet2(i1,i2)%a(2)*r
     & wlinet_mu(mu)%a(2))
      end do
      end do
      end do
  
*                                                                       
*                                                                       
*            | W(7,1,2,8)                                               
*            |                                                          
*  5 --------------- 6                                                  
*        |                                                              
*        |  f(mu)                                                       
*                                                                       
* quqd -- p=p534,q=p6
      quqd=p534(0)*p6(0)-p534(1)*p6(1)-p534(2)*p6(2)-p534(3)*p6(
     & 3)
      ccl=wcl/(s534*p534k0)
      do i1=1,2
      do i2=1,2
* TWR0 -- qu=p534,qd=p6,v=cw7128(i1,i2)%e,a=wlinet2(i1,i2)%a,b=wlinet2(i
* 1,i2)%b,cl=ccl,nsum=0
      ceps_0=-cw7128(i1,i2)%ek0*(p534(2)*p6(3)-p6(2)*p534(3))+p5
     & 34k0*(cw7128(i1,i2)%e(2)*p6(3)-p6(2)*cw7128(i1,i2)%e(3))-
     & p6k0*(cw7128(i1,i2)%e(2)*p534(3)-p534(2)*cw7128(i1,i2)%e(
     & 3))
      ceps_0=ceps_0*cim
      ceps_2=-cw7128(i1,i2)%e(3)*p6k0+p6(3)*cw7128(i1,i2)%ek0
      ceps_2=ceps_2*cim
      cvqu=cw7128(i1,i2)%e(0)*p534(0)-cw7128(i1,i2)%e(1)*p534(1)
     & -cw7128(i1,i2)%e(2)*p534(2)-cw7128(i1,i2)%e(3)*p534(3)
      cvqd=cw7128(i1,i2)%e(0)*p6(0)-cw7128(i1,i2)%e(1)*p6(1)-cw7
     & 128(i1,i2)%e(2)*p6(2)-cw7128(i1,i2)%e(3)*p6(3)
      cauxa=-cw7128(i1,i2)%ek0*quqd+p534k0*cvqd+p6k0*cvqu
      cauxb=-cw7128(i1,i2)%ek0*p6(2)+p6k0*cw7128(i1,i2)%e(2)
      wlinet2(i1,i2)%a(2)=ccl*(cauxa-ceps_0)
      wlinet2(i1,i2)%b(1)=ccl*(cauxb-ceps_2)
      end do
      end do
* quqd -- p=p5,q=p534
