* TWL0 -- qu=p5,qd=p534,v=2,a=lwlinet_mu(2)%a,c=lwlinet_mu(2)%c,cl=fcl(i
* d5),nsum=0
      eps_0=-p5k0*p534(3)+p534k0*p5(3)
      ceps_0=eps_0*cim
      auxa=p5k0*p534(2)+p534k0*p5(2)
      lwlinet_mu(2)%a(2)=fcl(id5)*(auxa-ceps_0)
      lwlinet_mu(2)%c(2)=-fcl(id5)*p5k0
* TWL0 -- qu=p5,qd=p534,v=3,a=lwlinet_mu(3)%a,c=lwlinet_mu(3)%c,cl=fcl(i
* d5),nsum=0
      eps_0=p5k0*p534(2)-p534k0*p5(2)
      ceps_0=eps_0*cim
      ceps_1=p5k0*cim
      auxa=p5k0*p534(3)+p534k0*p5(3)
      lwlinet_mu(3)%a(2)=fcl(id5)*(auxa-ceps_0)
      lwlinet_mu(3)%c(2)=fcl(id5)*ceps_1
      do i1=1,2
      do i2=1,2
      do mu=0,3
* TLTR0_W -- aa=cfw56_7218(i1,i2)%e(mu),a1=lwlinet_mu(mu)%a,c1=lwlinet_m
* u(mu)%c,a2=wlinet2(i1,i2)%a,b2=wlinet2(i1,i2)%b,prq=s534,bef=,aft=
      cfw56_7218(i1,i2)%e(mu)=(lwlinet_mu(mu)%c(2)*s534*wlinet2(
     & i1,i2)%b(1)+lwlinet_mu(mu)%a(2)*wlinet2(i1,i2)%a(2))
      end do
      end do
      end do
  
*                                                                       
*       | W(7,2,1,8)                                                    
*       |                                                               
*  5 --------------- 6                                                  
*            |                                                          
*            |  f(mu)                                                   
*                                                                       
*                                                                       
* quqd -- p=p5,q=p346
      quqd=p5(0)*p346(0)-p5(1)*p346(1)-p5(2)*p346(2)-p5(3)*p346(
     & 3)
      ccl=wcl/(s346*p346k0)
      do i1=1,2
      do i2=1,2
* TWL0 -- qu=p5,qd=p346,v=cw7218(i1,i2)%e,a=wlinet2(i1,i2)%a,c=wlinet2(i
* 1,i2)%c,cl=ccl,nsum=0
      ceps_0=-cw7218(i1,i2)%ek0*(p5(2)*p346(3)-p346(2)*p5(3))+p5
     & k0*(cw7218(i1,i2)%e(2)*p346(3)-p346(2)*cw7218(i1,i2)%e(3)
     & )-p346k0*(cw7218(i1,i2)%e(2)*p5(3)-p5(2)*cw7218(i1,i2)%e(
     & 3))
      ceps_0=ceps_0*cim
      ceps_1=-cw7218(i1,i2)%e(3)*p5k0+p5(3)*cw7218(i1,i2)%ek0
      ceps_1=ceps_1*cim
      cvqu=cw7218(i1,i2)%e(0)*p5(0)-cw7218(i1,i2)%e(1)*p5(1)-cw7
     & 218(i1,i2)%e(2)*p5(2)-cw7218(i1,i2)%e(3)*p5(3)
      cvqd=cw7218(i1,i2)%e(0)*p346(0)-cw7218(i1,i2)%e(1)*p346(1)
     & -cw7218(i1,i2)%e(2)*p346(2)-cw7218(i1,i2)%e(3)*p346(3)
      cauxa=-cw7218(i1,i2)%ek0*quqd+p5k0*cvqd+p346k0*cvqu
      cauxc=+cw7218(i1,i2)%ek0*p5(2)-p5k0*cw7218(i1,i2)%e(2)
      wlinet2(i1,i2)%a(2)=ccl*(cauxa-ceps_0)
      wlinet2(i1,i2)%c(2)=ccl*(-cauxc+ceps_1)
      end do
      end do
* quqd -- p=p346,q=p6
      quqd=p346(0)*p6(0)-p346(1)*p6(1)-p346(2)*p6(2)-p346(3)*p6(
     & 3)
* TWR0 -- qu=p346,qd=p6,v=0,a=rwlinet_mu(0)%a,b=rwlinet_mu(0)%b,cl=fcl(i
* d6),nsum=0
      eps_0=-p346(2)*p6(3)+p6(2)*p346(3)
      ceps_0=eps_0*cim
      ceps_2=p6(3)*cim
      auxa=-quqd+p346k0*p6(0)+p6k0*p346(0)
      rwlinet_mu(0)%a(2)=fcl(id6)*(auxa-ceps_0)
      rwlinet_mu(0)%b(1)=-fcl(id6)*(p6(2)+ceps_2)
* TWR0 -- qu=p346,qd=p6,v=1,a=rwlinet_mu(1)%a,b=rwlinet_mu(1)%b,cl=fcl(i
* d6),nsum=0
      auxa=-quqd+p346k0*p6(1)+p6k0*p346(1)
      rwlinet_mu(1)%a(2)=fcl(id6)*(auxa-ceps_0)
      rwlinet_mu(1)%b(1)=-fcl(id6)*(p6(2)+ceps_2)
* TWR0 -- qu=p346,qd=p6,v=2,a=rwlinet_mu(2)%a,b=rwlinet_mu(2)%b,cl=fcl(i
* d6),nsum=0
      eps_0=-p346k0*p6(3)+p6k0*p346(3)
      ceps_0=eps_0*cim
      auxa=p346k0*p6(2)+p6k0*p346(2)
      rwlinet_mu(2)%a(2)=fcl(id6)*(auxa-ceps_0)
      rwlinet_mu(2)%b(1)=-fcl(id6)*p6k0
* TWR0 -- qu=p346,qd=p6,v=3,a=rwlinet_mu(3)%a,b=rwlinet_mu(3)%b,cl=fcl(i
* d6),nsum=0
      eps_0=p346k0*p6(2)-p6k0*p346(2)
      ceps_0=eps_0*cim
      ceps_2=p6k0*cim
      auxa=p346k0*p6(3)+p6k0*p346(3)
      rwlinet_mu(3)%a(2)=fcl(id6)*(auxa-ceps_0)
      rwlinet_mu(3)%b(1)=-fcl(id6)*ceps_2
      do i1=1,2
      do i2=1,2
      do mu=0,3
* TLTR0_W -- aa=cfw56_7218(i1,i2)%e(mu),a1=wlinet2(i1,i2)%a,c1=wlinet2(i
* 1,i2)%c,a2=rwlinet_mu(mu)%a,b2=rwlinet_mu(mu)%b,prq=s346,bef=cfw56_721
* 8(i1,i2)%e(mu)+,aft=
      cfw56_7218(i1,i2)%e(mu)=cfw56_7218(i1,i2)%e(mu)+(wlinet2(i
     & 1,i2)%c(2)*s346*rwlinet_mu(mu)%b(1)+wlinet2(i1,i2)%a(2)*r
     & wlinet_mu(mu)%a(2))
      end do
      end do
      end do
  
  
*                                                                       
*                    /_  W(56)                                          
*                   /                                                   
*       (mu)_Z,f___/                                                    
*                  \                                                    
*                   \_                                                  
*                    \   W(7128)                                        
*                                                                       
*                                                                       
*                                                                       
*** triple vertex -- pfz(mu)=p34(mu),pwm(mu)=p56(mu),pwp(mu)=p1278(mu),e
* fz=#,ewm=cw56,ewp=cw7128(i1,i2),res=ctrip7128_56(i1?,i2?,mu#)
      do mu=0,3
      vfz(mu)=p56(mu)-p1278(mu)
      vwm(mu)=p1278(mu)-p34(mu)
      vwp(mu)=p34(mu)-p56(mu)
      end do !mu
* vwm%ewm
* p.q -- p.q=cw56%v,p=cw56%e,q=vwm,bef=,aft=
      cw56%v=(cw56%e(0)*vwm(0)-cw56%e(1)*vwm(1)-cw56%e(2)*vwm(2)
     & -cw56%e(3)*vwm(3))
* vwp%ewp
      do i1=1,2
      do i2=1,2
* p.q -- p.q=cw7128(i1,i2)%v,p=cw7128(i1,i2)%e,q=vwp,bef=,aft=
      cw7128(i1,i2)%v=(cw7128(i1,i2)%e(0)*vwp(0)-cw7128(i1,i2)%e
     & (1)*vwp(1)-cw7128(i1,i2)%e(2)*vwp(2)-cw7128(i1,i2)%e(3)*v
     & wp(3))
      end do
      end do
* ewm%ewp
      do i1=1,2
      do i2=1,2
* p.q -- p.q=caux,p=cw56%e,q=cw7128(i1,i2)%e,bef=,aft=
      caux=(cw56%e(0)*cw7128(i1,i2)%e(0)-cw56%e(1)*cw7128(i1,i2)
     & %e(1)-cw56%e(2)*cw7128(i1,i2)%e(2)-cw56%e(3)*cw7128(i1,i2
     & )%e(3))
      do mu=0,3
      ctrip7128_56(i1,i2,mu)=vfz(mu)*caux+cw56%v*cw7128(i1,i2)%e
     & (mu)+cw7128(i1,i2)%v*cw56%e(mu)
      end do
      end do
      end do
  
      do i1=1,2
        do i2=1,2
          do mu=0,3
            czw56_7128(i1,i2)%e(mu)=
     &                -rcotw*ctrip7128_56(i1,i2,mu)
     &                     +czw56_7128(i1,i2)%e(mu)
          enddo
        enddo
      enddo
  
  
  
