      do i1=1,2
      do i2=1,2
* p.q -- p.q=cw7218(i1,i2)%v,p=cw7218(i1,i2)%e,q=vwp,bef=,aft=
      cw7218(i1,i2)%v=(cw7218(i1,i2)%e(0)*vwp(0)-cw7218(i1,i2)%e
     & (1)*vwp(1)-cw7218(i1,i2)%e(2)*vwp(2)-cw7218(i1,i2)%e(3)*v
     & wp(3))
      end do
      end do
* ewm%ewp
      do i1=1,2
      do i2=1,2
* p.q -- p.q=caux,p=cw56%e,q=cw7218(i1,i2)%e,bef=,aft=
      caux=(cw56%e(0)*cw7218(i1,i2)%e(0)-cw56%e(1)*cw7218(i1,i2)
     & %e(1)-cw56%e(2)*cw7218(i1,i2)%e(2)-cw56%e(3)*cw7218(i1,i2
     & )%e(3))
      do mu=0,3
      ctrip7218_56(i1,i2,mu)=vfz(mu)*caux+cw56%v*cw7218(i1,i2)%e
     & (mu)+cw7218(i1,i2)%v*cw56%e(mu)
      end do
      end do
      end do
  
      do i1=1,2
        do i2=1,2
          do mu=0,3
            czw56_7218(i1,i2)%e(mu)=
     &                -rcotw*ctrip7218_56(i1,i2,mu)
     &                     +czw56_7218(i1,i2)%e(mu)
          enddo
        enddo
      enddo
  
  
  
