      if(id3.eq.5)then
* compute  subdiagram with a higgs decaying to 4 fermions (two w's)     
*                                                                       
*               /_  W(56)                                               
*              /                                                        
*       ___h__/                                                         
*             \                                                         
*              \_                                                       
*               \  W(7128)                                              
*                                                                       
* We factorize out from the amplitude the modulus of the electric       
* charge from every coupling, hence instead of g  we have               
* coupling g/|e|=1/sw                                                   
  
      do i1=1,2
      do i2=1,2
* p.q -- p.q=ch56_7128(i1,i2),p=cw7128(i1,i2)%e,q=cw56%e,bef=,aft=*rmw/s
* w
      ch56_7128(i1,i2)=(cw7128(i1,i2)%e(0)*cw56%e(0)-cw7128(i1,i
     & 2)%e(1)*cw56%e(1)-cw7128(i1,i2)%e(2)*cw56%e(2)-cw7128(i1,
     & i2)%e(3)*cw56%e(3))*rmw/sw
      end do
      end do
  
* compute  subdiagram with a higgs decaying to 4 fermions (two w's)     
*                                                                       
*               /_  W(56)                                               
*              /                                                        
*       ___h__/                                                         
*             \                                                         
*              \_                                                       
*               \  W(7218)                                              
*                                                                       
* We factorize out from the amplitude the modulus of the electric       
* charge from every coupling, hence instead of g  we have               
* coupling g/|e|=1/sw                                                   
  
      do i1=1,2
      do i2=1,2
* p.q -- p.q=ch56_7218(i1,i2),p=cw7218(i1,i2)%e,q=cw56%e,bef=,aft=*rmw/s
* w
      ch56_7218(i1,i2)=(cw7218(i1,i2)%e(0)*cw56%e(0)-cw7218(i1,i
     & 2)%e(1)*cw56%e(1)-cw7218(i1,i2)%e(2)*cw56%e(2)-cw7218(i1,
     & i2)%e(3)*cw56%e(3))*rmw/sw
      end do
      end do
  
      else
        do i2=1,2
          do i1=1,2
            ch56_7128(i1,i2)=czero
            ch56_7218(i1,i2)=czero
          enddo
        enddo
      endif
