      cwline_mu_aux(mu)%c(2,1)=l3_78%c(2,1)*s378*cwline_mu(mu)%d
     & (1,1)+l3_78%a(2,2)*cwline_mu(mu)%c(2,1)
      cwline_mu_aux(mu)%a(2,2)=l3_78%c(2,1)*s378*cwline_mu(mu)%b
     & (1,2)+l3_78%a(2,2)*cwline_mu(mu)%a(2,2)
      end do
      do mu=0,3
