* TW -- qu=p378,qd=p4,v=0,a=cwline_mu(0)%a,b=cwline_mu(0)%b,c=cwline_mu(
* 0)%c,d=cwline_mu(0)%d,cl=wcl,nsum=0
      eps_0=-p378(2)*p4(3)+p4(2)*p378(3)
      ceps_0=eps_0*cim
