      do iut=1,2
      do jut=1,2
      cww34_728(iut,i1,jut)%e(mu)=(cwline_mu1(i1,mu)%a(iut,jut)+
     & rmassl*cwline_mu1(i1,mu)%b(iut,jut)+rmassr*cwline_mu1(i1,
     & mu)%c(iut,jut)+rmassl*rmassr*cwline_mu1(i1,mu)%d(iut,jut)
     & )/((s2784-cmass2(id3+1))*p2784k0)
      enddo
      enddo
      end do
      end do
  
      endif
  
      if(id3.eq.5)then
* compute  subdiagram with a higgs decaying to 4 fermions (two w's)     
*                                                                       
*               /_  W(718)                                              
*              /                                                        
*       ___h__/                                                         
*             \                                                         
*              \_                                                       
*               \  W(526)                                               
*                                                                       
* We factorize out from the amplitude the modulus of the electric       
* charge from every coupling, hence instead of g  we have               
* coupling g/|e|=1/sw                                                   
  
      do i1=1,2
      do i2=1,2
* p.q -- p.q=ch718_526(i1,i2),p=cw526(i2)%e,q=cw718(i1)%e,bef=,aft=*rmw/
* sw
      ch718_526(i1,i2)=(cw526(i2)%e(0)*cw718(i1)%e(0)-cw526(i2)%
     & e(1)*cw718(i1)%e(1)-cw526(i2)%e(2)*cw718(i1)%e(2)-cw526(i
     & 2)%e(3)*cw718(i1)%e(3))*rmw/sw
      end do
      end do
  
* compute  subdiagram with a higgs decaying to 4 fermions (two w's)     
*                                                                       
*               /_  W(728)                                              
*              /                                                        
*       ___h__/                                                         
*             \                                                         
*              \_                                                       
*               \  W(516)                                               
*                                                                       
* We factorize out from the amplitude the modulus of the electric       
* charge from every coupling, hence instead of g  we have               
* coupling g/|e|=1/sw                                                   
  
      do i1=1,2
      do i2=1,2
* p.q -- p.q=ch728_516(i1,i2),p=cw516(i2)%e,q=cw728(i1)%e,bef=,aft=*rmw/
* sw
      ch728_516(i1,i2)=(cw516(i2)%e(0)*cw728(i1)%e(0)-cw516(i2)%
     & e(1)*cw728(i1)%e(1)-cw516(i2)%e(2)*cw728(i1)%e(2)-cw516(i
     & 2)%e(3)*cw728(i1)%e(3))*rmw/sw
      end do
      end do
  
      else
        do i2=1,2
          do i1=1,2
            ch718_526(i1,i2)=czero
            ch728_516(i1,i2)=czero
          enddo
        enddo
      endif
  
* Two EW bosons + 1g on W lines                                         
  
*                                                                       
*  5 --------------                                                     
*        |                                                              
*        | W(7,1,8)                                                     
*                                                                       
* quqd -- p=p5,q=p1578
      quqd=p5(0)*p1578(0)-p5(1)*p1578(1)-p5(2)*p1578(2)-p5(3)*p1
     & 578(3)
      ccl=wcl/(s1578*p1578k0)
      do i1=1,2
* TWL0 -- qu=p5,qd=p1578,v=cw718(i1)%e,a=l5_718(i1)%a,c=l5_718(i1)%c,cl=
* ccl,nsum=0
      ceps_0=-cw718(i1)%ek0*(p5(2)*p1578(3)-p1578(2)*p5(3))+p5k0
     & *(cw718(i1)%e(2)*p1578(3)-p1578(2)*cw718(i1)%e(3))-p1578k
     & 0*(cw718(i1)%e(2)*p5(3)-p5(2)*cw718(i1)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cw718(i1)%e(3)*p5k0+p5(3)*cw718(i1)%ek0
      ceps_1=ceps_1*cim
      cvqu=cw718(i1)%e(0)*p5(0)-cw718(i1)%e(1)*p5(1)-cw718(i1)%e
     & (2)*p5(2)-cw718(i1)%e(3)*p5(3)
      cvqd=cw718(i1)%e(0)*p1578(0)-cw718(i1)%e(1)*p1578(1)-cw718
     & (i1)%e(2)*p1578(2)-cw718(i1)%e(3)*p1578(3)
      cauxa=-cw718(i1)%ek0*quqd+p5k0*cvqd+p1578k0*cvqu
      cauxc=+cw718(i1)%ek0*p5(2)-p5k0*cw718(i1)%e(2)
      l5_718(i1)%a(2)=ccl*(cauxa-ceps_0)
      l5_718(i1)%c(2)=ccl*(-cauxc+ceps_1)
      end do
  
*                                                                       
* --------------- 6                                                     
*   |                                                                   
*   | W(7,1,8)                                                          
*                                                                       
* quqd -- p=p1786,q=p6
      quqd=p1786(0)*p6(0)-p1786(1)*p6(1)-p1786(2)*p6(2)-p1786(3)
     & *p6(3)
      ccl=wcl/(s1786*p1786k0)
      do i1=1,2
* TWR0 -- qu=p1786,qd=p6,v=cw718(i1)%e,a=r6_718(i1)%a,b=r6_718(i1)%b,cl=
* ccl,nsum=0
      ceps_0=-cw718(i1)%ek0*(p1786(2)*p6(3)-p6(2)*p1786(3))+p178
     & 6k0*(cw718(i1)%e(2)*p6(3)-p6(2)*cw718(i1)%e(3))-p6k0*(cw7
     & 18(i1)%e(2)*p1786(3)-p1786(2)*cw718(i1)%e(3))
      ceps_0=ceps_0*cim
      ceps_2=-cw718(i1)%e(3)*p6k0+p6(3)*cw718(i1)%ek0
      ceps_2=ceps_2*cim
      cvqu=cw718(i1)%e(0)*p1786(0)-cw718(i1)%e(1)*p1786(1)-cw718
     & (i1)%e(2)*p1786(2)-cw718(i1)%e(3)*p1786(3)
      cvqd=cw718(i1)%e(0)*p6(0)-cw718(i1)%e(1)*p6(1)-cw718(i1)%e
     & (2)*p6(2)-cw718(i1)%e(3)*p6(3)
      cauxa=-cw718(i1)%ek0*quqd+p1786k0*cvqd+p6k0*cvqu
      cauxb=-cw718(i1)%ek0*p6(2)+p6k0*cw718(i1)%e(2)
      r6_718(i1)%a(2)=ccl*(cauxa-ceps_0)
      r6_718(i1)%b(1)=ccl*(cauxb-ceps_2)
      end do
  
*                                                                       
*  5 --------------                                                     
*        |                                                              
*        | W(7,2,8)                                                     
*                                                                       
* quqd -- p=p5,q=p2578
      quqd=p5(0)*p2578(0)-p5(1)*p2578(1)-p5(2)*p2578(2)-p5(3)*p2
     & 578(3)
      ccl=wcl/(s2578*p2578k0)
      do i1=1,2
* TWL0 -- qu=p5,qd=p2578,v=cw728(i1)%e,a=l5_728(i1)%a,c=l5_728(i1)%c,cl=
* ccl,nsum=0
      ceps_0=-cw728(i1)%ek0*(p5(2)*p2578(3)-p2578(2)*p5(3))+p5k0
     & *(cw728(i1)%e(2)*p2578(3)-p2578(2)*cw728(i1)%e(3))-p2578k
     & 0*(cw728(i1)%e(2)*p5(3)-p5(2)*cw728(i1)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cw728(i1)%e(3)*p5k0+p5(3)*cw728(i1)%ek0
      ceps_1=ceps_1*cim
      cvqu=cw728(i1)%e(0)*p5(0)-cw728(i1)%e(1)*p5(1)-cw728(i1)%e
     & (2)*p5(2)-cw728(i1)%e(3)*p5(3)
      cvqd=cw728(i1)%e(0)*p2578(0)-cw728(i1)%e(1)*p2578(1)-cw728
     & (i1)%e(2)*p2578(2)-cw728(i1)%e(3)*p2578(3)
      cauxa=-cw728(i1)%ek0*quqd+p5k0*cvqd+p2578k0*cvqu
      cauxc=+cw728(i1)%ek0*p5(2)-p5k0*cw728(i1)%e(2)
      l5_728(i1)%a(2)=ccl*(cauxa-ceps_0)
      l5_728(i1)%c(2)=ccl*(-cauxc+ceps_1)
      end do
  
*                                                                       
* --------------- 6                                                     
*   |                                                                   
*   | W(7,2,8)                                                          
*                                                                       
* quqd -- p=p2786,q=p6
      quqd=p2786(0)*p6(0)-p2786(1)*p6(1)-p2786(2)*p6(2)-p2786(3)
     & *p6(3)
      ccl=wcl/(s2786*p2786k0)
      do i1=1,2
* TWR0 -- qu=p2786,qd=p6,v=cw728(i1)%e,a=r6_728(i1)%a,b=r6_728(i1)%b,cl=
* ccl,nsum=0
      ceps_0=-cw728(i1)%ek0*(p2786(2)*p6(3)-p6(2)*p2786(3))+p278
     & 6k0*(cw728(i1)%e(2)*p6(3)-p6(2)*cw728(i1)%e(3))-p6k0*(cw7
     & 28(i1)%e(2)*p2786(3)-p2786(2)*cw728(i1)%e(3))
      ceps_0=ceps_0*cim
      ceps_2=-cw728(i1)%e(3)*p6k0+p6(3)*cw728(i1)%ek0
      ceps_2=ceps_2*cim
      cvqu=cw728(i1)%e(0)*p2786(0)-cw728(i1)%e(1)*p2786(1)-cw728
     & (i1)%e(2)*p2786(2)-cw728(i1)%e(3)*p2786(3)
      cvqd=cw728(i1)%e(0)*p6(0)-cw728(i1)%e(1)*p6(1)-cw728(i1)%e
     & (2)*p6(2)-cw728(i1)%e(3)*p6(3)
      cauxa=-cw728(i1)%ek0*quqd+p2786k0*cvqd+p6k0*cvqu
      cauxb=-cw728(i1)%ek0*p6(2)+p6k0*cw728(i1)%e(2)
      r6_728(i1)%a(2)=ccl*(cauxa-ceps_0)
      r6_728(i1)%b(1)=ccl*(cauxb-ceps_2)
      end do
  
  
  
*                                                                       
*                                                                       
*       | 1                                                             
*       |                                                               
*  5 ----------------------------- 6                                    
*           |           |                                               
*           | z(mu)     | W(7,2,8)                                      
*                                                                       
* quqd -- p=p51,q=p2786
      quqd=p51(0)*p2786(0)-p51(1)*p2786(1)-p51(2)*p2786(2)-p51(3
     & )*p2786(3)
* TW0 -- qu=p51,qd=p2786,v=0,a=wlinet_mu(0)%a,b=wlinet_mu(0)%b,c=wlinet_
* mu(0)%c,d=wlinet_mu(0)%d,cl=zcl(id5),nsum=0
      eps_0=-p51(2)*p2786(3)+p2786(2)*p51(3)
      ceps_0=eps_0*cim
      ceps_1=p51(3)*cim
      ceps_2=p2786(3)*cim
      auxa=-quqd+p51k0*p2786(0)+p2786k0*p51(0)
      wlinet_mu(0)%a(2)=zcl(id5)*(auxa-ceps_0)
      wlinet_mu(0)%b(1)=-zcl(id5)*(p2786(2)+ceps_2)
      wlinet_mu(0)%c(2)=zcl(id5)*(-p51(2)+ceps_1)
      wlinet_mu(0)%d(1)=zcl(id5)
* TW0 -- qu=p51,qd=p2786,v=1,a=wlinet_mu(1)%a,b=wlinet_mu(1)%b,c=wlinet_
* mu(1)%c,d=wlinet_mu(1)%d,cl=zcl(id5),nsum=0
      auxa=-quqd+p51k0*p2786(1)+p2786k0*p51(1)
      wlinet_mu(1)%a(2)=zcl(id5)*(auxa-ceps_0)
      wlinet_mu(1)%b(1)=-zcl(id5)*(p2786(2)+ceps_2)
      wlinet_mu(1)%c(2)=zcl(id5)*(-p51(2)+ceps_1)
      wlinet_mu(1)%d(1)=zcl(id5)
* TW0 -- qu=p51,qd=p2786,v=2,a=wlinet_mu(2)%a,b=wlinet_mu(2)%b,c=wlinet_
* mu(2)%c,d=wlinet_mu(2)%d,cl=zcl(id5),nsum=0
      eps_0=-p51k0*p2786(3)+p2786k0*p51(3)
      ceps_0=eps_0*cim
      auxa=p51k0*p2786(2)+p2786k0*p51(2)
      wlinet_mu(2)%a(2)=zcl(id5)*(auxa-ceps_0)
      wlinet_mu(2)%b(1)=-zcl(id5)*p2786k0
      wlinet_mu(2)%c(2)=-zcl(id5)*p51k0
* TW0 -- qu=p51,qd=p2786,v=3,a=wlinet_mu(3)%a,b=wlinet_mu(3)%b,c=wlinet_
* mu(3)%c,d=wlinet_mu(3)%d,cl=zcl(id5),nsum=0
      eps_0=p51k0*p2786(2)-p2786k0*p51(2)
      ceps_0=eps_0*cim
      ceps_1=p51k0*cim
      ceps_2=p2786k0*cim
      auxa=+p51k0*p2786(3)+p2786k0*p51(3)
      wlinet_mu(3)%a(2)=zcl(id5)*(auxa-ceps_0)
      wlinet_mu(3)%b(1)=-zcl(id5)*ceps_2
      wlinet_mu(3)%c(2)=zcl(id5)*ceps_1
      do i1=1,2
      do mu=0,3
* TLT0_W -- aa=wlinet1(i1,mu)%a,cc=wlinet1(i1,mu)%c,a1=l5_1(i1)%a,c1=l5_
* 1(i1)%c,a2=wlinet_mu(mu)%a,b2=wlinet_mu(mu)%b,c2=wlinet_mu(mu)%c,d2=wl
* inet_mu(mu)%d,prq=s51,nsum=0
      wlinet1(i1,mu)%c(2)=l5_1(i1)%c(2)*s51*wlinet_mu(mu)%d(1)+l
     & 5_1(i1)%a(2)*wlinet_mu(mu)%c(2)
      wlinet1(i1,mu)%a(2)=l5_1(i1)%c(2)*s51*wlinet_mu(mu)%b(1)+l
     & 5_1(i1)%a(2)*wlinet_mu(mu)%a(2)
      end do
      end do
      do i1=1,2
      do i2=1,2
      do mu=0,3
* TLTR0_W -- aa=czw516_728(i1,i2)%e(mu),a1=wlinet1(i1,mu)%a,c1=wlinet1(i
* 1,mu)%c,a2=r6_728(i2)%a,b2=r6_728(i2)%b,prq=s2786,bef=,aft=
      czw516_728(i1,i2)%e(mu)=(wlinet1(i1,mu)%c(2)*s2786*r6_728(
     & i2)%b(1)+wlinet1(i1,mu)%a(2)*r6_728(i2)%a(2))
      end do
      end do
      end do
  
*                                                                       
*                                                                       
*                   | 1                                                 
*                   |                                                   
*  5 ----------------------------- 6                                    
*        |            |                                                 
*        | z(mu)      | W(7,2,8)                                        
*                                                                       
* quqd -- p=p534,q=p2786
      quqd=p534(0)*p2786(0)-p534(1)*p2786(1)-p534(2)*p2786(2)-p5
     & 34(3)*p2786(3)
      ccl=gs/(s534*p534k0)
      do i1=1,2
* TW0 -- qu=p534,qd=p2786,v=ce1(i1)%e,a=wlinet(i1)%a,b=wlinet(i1)%b,c=wl
* inet(i1)%c,d=wlinet(i1)%d,cl=ccl,nsum=0
      ceps_0=-ce1(i1)%ek0*(p534(2)*p2786(3)-p2786(2)*p534(3))+p5
     & 34k0*(ce1(i1)%e(2)*p2786(3)-p2786(2)*ce1(i1)%e(3))-p2786k
     & 0*(ce1(i1)%e(2)*p534(3)-p534(2)*ce1(i1)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-ce1(i1)%e(3)*p534k0+p534(3)*ce1(i1)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-ce1(i1)%e(3)*p2786k0+p2786(3)*ce1(i1)%ek0
      ceps_2=ceps_2*cim
      cvqu=ce1(i1)%e(0)*p534(0)-ce1(i1)%e(1)*p534(1)-ce1(i1)%e(2
     & )*p534(2)-ce1(i1)%e(3)*p534(3)
      cvqd=ce1(i1)%e(0)*p2786(0)-ce1(i1)%e(1)*p2786(1)-ce1(i1)%e
     & (2)*p2786(2)-ce1(i1)%e(3)*p2786(3)
      cauxa=-ce1(i1)%ek0*quqd+p534k0*cvqd+p2786k0*cvqu
      cauxb=-ce1(i1)%ek0*p2786(2)+p2786k0*ce1(i1)%e(2)
      cauxc=+ce1(i1)%ek0*p534(2)-p534k0*ce1(i1)%e(2)
      wlinet(i1)%a(2)=ccl*(cauxa-ceps_0)
      wlinet(i1)%b(1)=ccl*(cauxb-ceps_2)
      wlinet(i1)%c(2)=ccl*(-cauxc+ceps_1)
      wlinet(i1)%d(1)=ccl*ce1(i1)%ek0
      end do
      do i1=1,2
      do i2=1,2
* TTR0_W -- aa=r6_1728(i1,i2)%a,bb=r6_1728(i1,i2)%b,a1=wlinet(i1)%a,b1=w
* linet(i1)%b,c1=wlinet(i1)%c,d1=wlinet(i1)%d,a2=r6_728(i2)%a,b2=r6_728(
* i2)%b,prq=s2786,nsum=0
      r6_1728(i1,i2)%b(1)=wlinet(i1)%d(1)*s2786*r6_728(i2)%b(1)+
     & wlinet(i1)%b(1)*r6_728(i2)%a(2)
      r6_1728(i1,i2)%a(2)=wlinet(i1)%c(2)*s2786*r6_728(i2)%b(1)+
     & wlinet(i1)%a(2)*r6_728(i2)%a(2)
      end do
      end do
* quqd -- p=p5,q=p534
      quqd=p5(0)*p534(0)-p5(1)*p534(1)-p5(2)*p534(2)-p5(3)*p534(
     & 3)
* TWL0 -- qu=p5,qd=p534,v=0,a=lwlinet_mu(0)%a,c=lwlinet_mu(0)%c,cl=zcl(i
* d5),nsum=0
      eps_0=-p5(2)*p534(3)+p534(2)*p5(3)
      ceps_0=eps_0*cim
      ceps_1=p5(3)*cim
      auxa=-quqd+p5k0*p534(0)+p534k0*p5(0)
      lwlinet_mu(0)%a(2)=zcl(id5)*(auxa-ceps_0)
      lwlinet_mu(0)%c(2)=zcl(id5)*(-p5(2)+ceps_1)
* TWL0 -- qu=p5,qd=p534,v=1,a=lwlinet_mu(1)%a,c=lwlinet_mu(1)%c,cl=zcl(i
* d5),nsum=0
      auxa=-quqd+p5k0*p534(1)+p534k0*p5(1)
      lwlinet_mu(1)%a(2)=zcl(id5)*(auxa-ceps_0)
      lwlinet_mu(1)%c(2)=zcl(id5)*(-p5(2)+ceps_1)
* TWL0 -- qu=p5,qd=p534,v=2,a=lwlinet_mu(2)%a,c=lwlinet_mu(2)%c,cl=zcl(i
* d5),nsum=0
      eps_0=-p5k0*p534(3)+p534k0*p5(3)
      ceps_0=eps_0*cim
      auxa=p5k0*p534(2)+p534k0*p5(2)
      lwlinet_mu(2)%a(2)=zcl(id5)*(auxa-ceps_0)
      lwlinet_mu(2)%c(2)=-zcl(id5)*p5k0
* TWL0 -- qu=p5,qd=p534,v=3,a=lwlinet_mu(3)%a,c=lwlinet_mu(3)%c,cl=zcl(i
* d5),nsum=0
      eps_0=p5k0*p534(2)-p534k0*p5(2)
      ceps_0=eps_0*cim
      ceps_1=p5k0*cim
      auxa=p5k0*p534(3)+p534k0*p5(3)
      lwlinet_mu(3)%a(2)=zcl(id5)*(auxa-ceps_0)
      lwlinet_mu(3)%c(2)=zcl(id5)*ceps_1
      do i1=1,2
      do i2=1,2
      do mu=0,3
* TLTR0_W -- aa=czw516_728(i1,i2)%e(mu),a1=lwlinet_mu(mu)%a,c1=lwlinet_m
* u(mu)%c,a2=r6_1728(i1,i2)%a,b2=r6_1728(i1,i2)%b,prq=s534,bef=czw516_72
* 8(i1,i2)%e(mu)+,aft=
      czw516_728(i1,i2)%e(mu)=czw516_728(i1,i2)%e(mu)+(lwlinet_m
     & u(mu)%c(2)*s534*r6_1728(i1,i2)%b(1)+lwlinet_mu(mu)%a(2)*r
     & 6_1728(i1,i2)%a(2))
      end do
      end do
      end do
  
*                                                                       
